INSERT INTO `wp_amorlibre_n_1_options` (`option_id`, `option_name`, `option_value`, `autoload`) VALUES
(15845, '_site_transient_loopia_plugin_api_woocommerce', 'O:8:\"stdClass\":27:{s:4:\"name\";s:11:\"WooCommerce\";s:4:\"slug\";s:11:\"woocommerce\";s:7:\"version\";s:5:\"3.3.1\";s:6:\"author\";s:48:\"<a href=\"https://woocommerce.com\">Automattic</a>\";s:14:\"author_profile\";s:40:\"https://profiles.wordpress.org/woothemes\";s:8:\"requires\";s:3:\"4.7\";s:6:\"tested\";s:5:\"4.9.4\";s:12:\"requires_php\";b:0;s:6:\"rating\";d:92;s:7:\"ratings\";a:5:{i:5;i:2303;i:4;i:120;i:3;i:68;i:2;i:61;i:1;i:195;}s:11:\"num_ratings\";i:2747;s:15:\"support_threads\";i:1174;s:24:\"support_threads_resolved\";i:793;s:15:\"active_installs\";i:3000000;s:10:\"downloaded\";i:39110856;s:12:\"last_updated\";s:21:\"2018-02-06 5:53pm GMT\";s:5:\"added\";s:10:\"2011-09-27\";s:8:\"homepage\";s:24:\"https://woocommerce.com/\";s:8:\"sections\";a:5:{s:11:\"description\";s:7816:\"<p>WooCommerce es un plugin gratuito de eCommerce que te permite vender cualquier cosa, con elegancia. Creado para que se integre sin problemas con WordPress, WooCommerce es la solución eCommerce favorita en todo el mundo y ofrece un control total tanto a propietarios de tienda como a desarrolladores. </p>\n<p>Con una flexibilidad infinita y acceso a cientos de extensiones WordPress tanto gratis como de pago, WooCommerce actualmente gestiona el 30% de todas las tiendas online &#8211; más que ninguna otra plataforma.</p>\n<span class=\"embed-youtube\" style=\"text-align:center; display: block;\"><iframe class=\'youtube-player\' type=\'text/html\' width=\'640\' height=\'390\' src=\'https://www.youtube.com/embed/1KahlicghaE?version=3&#038;rel=1&#038;fs=1&#038;autohide=2&#038;showsearch=0&#038;showinfo=1&#038;iv_load_policy=1&#038;wmode=transparent\' allowfullscreen=\'true\' style=\'border:0;\'></iframe></span>\n<h4>Vende lo que sea, donde sea</h4>\n<p>Con WooCommerce puedes vender tanto productos físicos como digitales en cualquier forma o tamaño, ofrecer variaciones de productos, configuraciones múltiples y descargas instantáneas a los compradores, y puedes incluso vender productos afiliados de mercados online.</p>\n<p>Con las extensiones de pago puedes ofrecer reservas, membresías y suscripciones periódicas. ¿Quieres vender suscripciones mensuales de artículos físicos u ofrecer a tus clientes un descuento en descargas digitales? Todo es posible.</p>\n<h4>Envía donde quieras</h4>\n<p>Ofrece envíos gratuitos, envíos a precio fijo o haz cálculos en tiempo real. Limita los envíos a países concretos, o abre tu tienda a todo el mundo. El envío es sumamente configurable, y WooCommerce incluso es compatible con envíos directos.</p>\n<h4>Extensas opciones de pago</h4>\n<p>WooCommerce incluye la posibilidad de aceptar las principales tarjetas de crédito, PayPal, transferencias bancarias o pago contra reembolso. ¿Quieres más opciones? Más de 140 pasarelas de pago locales se integran con WooCommerce, incluyendo algunas tan populares como Stripe, Authorize.net y pagos Amazon.</p>\n<h4>Tu lo controlas todo &#8211; siempre</h4>\n<p>WooCommerce te permite un control completo de tu tienda, desde los impuestos a los niveles de inventario o las cuentas de cliente. Añade o quita extensiones, cambia tu diseño y modifica los ajustes a tu gusto. Todo está bajo tu control.</p>\n<p>Uno de los mayores riesgos de usar una plataforma de eCommerce alojada es qué pasa con tu tienda si el proveedor cierra la tienda. Con WooCommerce tienes un control completo así que no hay ninguna razón por la que preocuparse. Tus datos te pertenecen &#8211; y están seguros, gracias a auditorías frecuentes de los líderes de la industria.</p>\n<h4>Define tu estilo con Storefront</h4>\n<p><a href=\"https://es.wordpress.org/themes/storefront/\" rel=\"nofollow\">Storefront</a> es un tema gratuito de WordPress disponible para cualquier tienda WooCommerce. Además de una integración completa con WooCommerce, Storefront prioriza la velocidad y la disponibilidad, eliminando cualquier conflicto entre el tema y el plugin en las actualizaciones importantes.</p>\n<p>Define tus estilos aún más personalizando Storefront a tu gusto o eligiendo uno de nuestros variados <a href=\"https://woocommerce.com/product-category/themes/storefront-child-theme-themes/\" rel=\"nofollow\">temas hijo para Storefront</a>. Todo a tu alcance, y todo de código abierto.</p>\n<h4>Creado pensando en los desarrolladores</h4>\n<p>Ampliable, adaptable y de código abierto &#8212; WooCommerce se creó pensando en los desarrolladores. Con su fuerte y robusto framework puedes escalar la tienda de tus clientes hasta donde quieras, de lo más básico a lo más profesional (hasta el infinito y más allá).</p>\n<p>Creado con una REST API, WooCommerce puede integrarse prácticamente con cualquier servicio. Puedes acceder a los datos de tu tienda desde cualquier parte, en cualquier momento, con un 100% de seguridad. WooCommerce permite a los desarrolladores crear, modificar y hacer crecer fácilmente una tienda que reúna sus especificaciones.</p>\n<p>Da igual el tamaño de la tienda que quieras crear. WooCommerce se adapta a tus necesidades. Con la creciente colección de más de 300 extensiones puedes mejorar las funcionalidades de tu tienda para que se ajuste a las necesidades particulares de tus clientes &#8211; o incluso crear tu propia solución.</p>\n<p>Si te preocupa la seguridad descansa tranquilo. WooCommerce lo auditan un equipo especializado de desarrolladores que trabajan a todas horas para identificar y solucionar cualquier fallo que se descubra.</p>\n<p>Damos soporte a WooCommerce y toda sus extensiones mediante documentación accesible y fácil de comprender. Con nuestra documentación aprenderás a crear el sitio exacto que tu cliente necesita.</p>\n<h4>Montones de extensiones</h4>\n<p>WordPress.org aloja algunas fantásticas extensiones para WooCommerce, como:</p>\n<ul>\n<li><a href=\"https://wordpress.org/plugins/woocommerce-google-analytics-integration/\">Google Analytics</a></li>\n<li><a href=\"https://wordpress.org/plugins/woocommerce-delivery-notes/\">Delivery Notes</a></li>\n<li><a href=\"https://wordpress.org/plugins/woocommerce-pdf-invoices-packing-slips/\">PDF Invoices and Packing Slips</a></li>\n<li><a href=\"https://wordpress.org/plugins/affiliates-woocommerce-light/\">Affiliates Integration Light</a></li>\n<li><a href=\"https://wordpress.org/plugins/woocommerce-new-product-badge/\">New Product Badges</a></li>\n</ul>\n<p>¿Quieres verlos todos? Busca &#8216;WooCommerce&#8217; en WordPress.org para encontrarlos.</p>\n<p>Si buscas algo publicado y mantenido por los desarrolladores que han creado WooCommerce hay montones de extensiones de pago, las más populares son:</p>\n<ul>\n<li><a href=\"https://woocommerce.com/products/woocommerce-subscriptions/\" rel=\"nofollow\">WooCommerce Subscriptions</a></li>\n<li><a href=\"https://woocommerce.com/products/woocommerce-memberships/\" rel=\"nofollow\">WooCommerce Memberships</a></li>\n<li><a href=\"https://woocommerce.com/products/woocommerce-bookings/\" rel=\"nofollow\">WooCommerce Bookings</a></li>\n<li><a href=\"https://woocommerce.com/products/dynamic-pricing/\" rel=\"nofollow\">Dynamic Pricing</a></li>\n<li><a href=\"https://woocommerce.com/products/table-rate-shipping/\" rel=\"nofollow\">Table Rate Shipping</a></li>\n<li><a href=\"https://woocommerce.com/products/product-csv-import-suite/\" rel=\"nofollow\">Product CSV Import Suite</a></li>\n</ul>\n<p>Y hay un montón más en el mismo sitio. Visita nuestra <a href=\"https://woocommerce.com/product-category/woocommerce-extensions/\" rel=\"nofollow\">página de extensiones</a> para descubrir de todo lo que somos capaces y todo lo que se puede hacer con las extensiones de pago para WooCommerce.</p>\n<h4>Únete a nuestra creciente comunidad</h4>\n<p>Cuando descargas WooCommerce te unes a una comunidad de más de un millón de propietarios de tiendas, desarrolladores y entusiastas de WordPress. Somos una de las más prósperas y crecientes comunidades online de código abierto, y ya seas un novato o un ninja, ¡nos encantará contar contigo!</p>\n<p>Si tienes interés en colaborar con WooCommerce tenemos más de 350 colaboradores, y siempre hay sitio para más. Echa un vistazo al <a href=\"https://github.com/woocommerce/woocommerce\" rel=\"nofollow\">directorio de WooCommerce en GitHub</a> para descubrir en qué puedes echar una mano.</p>\n<p>¿Quieres añadir un nuevo idioma a WooCommerce? ¡Genial! Puedes contribuir en  <a href=\"https://translate.wordpress.org/projects/wp-plugins/woocommerce\" rel=\"nofollow\">translate.wordpress.org</a>.</p>\n<p>Y, para finalizar, valora iniciar o unirte a una Meetup local de WooCommerce, hay un montón <a href=\"https://woocommerce.com/woocommerce/meetups/\" rel=\"nofollow\">aquí</a>.</p>\n\";s:12:\"installation\";s:2563:\"<h4>Requisitos mínimos</h4>\n<ul>\n<li>Versión 5.2.4 de PHP o superior (se recomienda PHP 5.6 o superior)</li>\n<li>Versión 5.0 de MySQL o superior (se recomienda MySQL 5.6 o superior)</li>\n<li>Algunas pasarelas de pago requieren compatibilidad con fsockopen (para acceso por IPN)</li>\n<li>WooCommerce 2.5 requiere WordPress 4.1+</li>\n<li>WooCommerce 2.6 requiere WordPress 4.4+</li>\n</ul>\n<p>Visita la <a href=\"https://docs.woocommerce.com/document/server-requirements/\" rel=\"nofollow\">documentación de requisitos del servidor para WooCommerce</a> para una lista detallada de los requisitos del servidor.</p>\n<h4>Instalación automática</h4>\n<p>La instalación automática es la opción más sencilla ya que WordPress gestiona las transferencias de archivos y no tendrás que salir de tu navegador. Para hacer una instalación automática de WooCommerce accede a tu escritorio de WordPress, ve al menú de Plugins y haz clic en Añadir nuevo.</p>\n<p>Teclea &#8220;WooCommerce&#8221; en el campo de búsqueda y haz clic en Buscar plugins. Una vez encuentres nuestro plugin de eCommerce puedes ver detalles como la versión, puntuación y descripción. Y lo más importante, por supuesto, puedes instalarlo simplemente haciendo clic en &#8220;Instalar ahora&#8221;.</p>\n<h4>Instalación manual</h4>\n<p>El método de instalación manual pasa por descargar nuestro plugin de eCommerce y subirlo a tu servidor desde tu aplicación FTP favorita. El codex de WordPress tiene <a href=\"https://codex.wordpress.org/Managing_Plugins#Manual_Plugin_Installation\" rel=\"nofollow\">instrucciones de cómo se hace</a>.</p>\n<h4>Actualizaciones</h4>\n<p>Las actualizaciones automáticas deberían funcionar sin problemas; pero como siempre, antes haz copia de seguridad solo por asegurar.</p>\n<p>Si por algún motivo tienes problemas con las páginas de tienda/categoría después de actualizar, solo tienes que forzar los enlaces permanentes yendo a WordPress &gt; Ajustes &gt; Enlaces permanentes y pulsando en &#8216;Guardar&#8217;. Esto debería volver las cosas a la normalidad.</p>\n<h4>Datos de ejemplo</h4>\n<p>WooCommerce contiene algunos datos de muestra que puedes utilizar para ver como se mostrarán los productos; importa sample_products.xml con el <a href=\"https://es.wordpress.org/plugins/wordpress-importer/\" rel=\"nofollow\">importador de WordPress</a>. También puedes usar el importador de CSV incluido en nuestro <a href=\"https://woocommerce.com/products/product-csv-import-suite/\" rel=\"nofollow\">plugin CSV Import Suite</a> para importar sample_products.csv.</p>\n\";s:3:\"faq\";s:5056:\"\n<h4>Instrucciones de instalación</h4>\n<p>\n<h4>Requisitos mínimos</h4>\n<ul>\n<li>Versión 5.2.4 de PHP o superior (se recomienda PHP 5.6 o superior)</li>\n<li>Versión 5.0 de MySQL o superior (se recomienda MySQL 5.6 o superior)</li>\n<li>Algunas pasarelas de pago requieren compatibilidad con fsockopen (para acceso por IPN)</li>\n<li>WooCommerce 2.5 requiere WordPress 4.1+</li>\n<li>WooCommerce 2.6 requiere WordPress 4.4+</li>\n</ul>\n<p>Visita la <a href=\"https://docs.woocommerce.com/document/server-requirements/\" rel=\"nofollow\">documentación de requisitos del servidor para WooCommerce</a> para una lista detallada de los requisitos del servidor.</p>\n<h4>Instalación automática</h4>\n<p>La instalación automática es la opción más sencilla ya que WordPress gestiona las transferencias de archivos y no tendrás que salir de tu navegador. Para hacer una instalación automática de WooCommerce accede a tu escritorio de WordPress, ve al menú de Plugins y haz clic en Añadir nuevo.</p>\n<p>Teclea &#8220;WooCommerce&#8221; en el campo de búsqueda y haz clic en Buscar plugins. Una vez encuentres nuestro plugin de eCommerce puedes ver detalles como la versión, puntuación y descripción. Y lo más importante, por supuesto, puedes instalarlo simplemente haciendo clic en &#8220;Instalar ahora&#8221;.</p>\n<h4>Instalación manual</h4>\n<p>El método de instalación manual pasa por descargar nuestro plugin de eCommerce y subirlo a tu servidor desde tu aplicación FTP favorita. El codex de WordPress tiene <a href=\"https://codex.wordpress.org/Managing_Plugins#Manual_Plugin_Installation\" rel=\"nofollow\">instrucciones de cómo se hace</a>.</p>\n<h4>Actualizaciones</h4>\n<p>Las actualizaciones automáticas deberían funcionar sin problemas; pero como siempre, antes haz copia de seguridad solo por asegurar.</p>\n<p>Si por algún motivo tienes problemas con las páginas de tienda/categoría después de actualizar, solo tienes que forzar los enlaces permanentes yendo a WordPress &gt; Ajustes &gt; Enlaces permanentes y pulsando en &#8216;Guardar&#8217;. Esto debería volver las cosas a la normalidad.</p>\n<h4>Datos de ejemplo</h4>\n<p>WooCommerce contiene algunos datos de muestra que puedes utilizar para ver como se mostrarán los productos; importa sample_products.xml con el <a href=\"https://es.wordpress.org/plugins/wordpress-importer/\" rel=\"nofollow\">importador de WordPress</a>. También puedes usar el importador de CSV incluido en nuestro <a href=\"https://woocommerce.com/products/product-csv-import-suite/\" rel=\"nofollow\">plugin CSV Import Suite</a> para importar sample_products.csv.</p>\n</p>\n<h4>¿Dónde puedo encontrar documentación y guías de uso de WooCommerce?</h4>\n<p>\n<p>Por favor, para ajustes y configuración de WooCommerce dirígete a nuestra  <a href=\"https://docs.woocommerce.com/documentation/plugins/woocommerce/getting-started/\" rel=\"nofollow\">guía de usuario</a></p>\n<p>Para extensiones o temas de WooCommerce, mira nuestro <a href=\"https://docs.woocommerce.com/documentation/plugins/woocommerce/woocommerce-codex/\" rel=\"nofollow\">codex</a>.</p>\n</p>\n<h4>¿Dónde puedo obtener soporte o hablar con otros usuarios?</h4>\n<p>\n<p>Si te atascas puedes pedir ayuda en el <a href=\"https://wordpress.org/support/plugin/woocommerce\" rel=\"nofollow\">foro del plugin WooCommerce</a>.</p>\n<p>Para obtener ayuda con las extensiones premium de WooCommerce.com, utiliza <a href=\"https://woocommerce.com/my-account/tickets/\" rel=\"nofollow\">nuestro equipo de soporte</a>.</p>\n</p>\n<h4>¿Funcionará WooCommerce con mi tema?</h4>\n<p>\n<p>Si, WooCommerce funcionará con cualquier tema, pero puede requerir algún cambio de estilos para que se ajuste bien. Por favor, para obtener ayuda revisa nuestro <a href=\"https://docs.woocommerce.com/documentation/plugins/woocommerce/woocommerce-codex/\" rel=\"nofollow\">codex</a>. Si estás buscando un tema que incluya integración con WooCommerce, te recomendamos <a href=\"https://woocommerce.com/storefront/\" rel=\"nofollow\">Storefront</a>.</p>\n</p>\n<h4>¿Dónde puedo solicitar nuevas funcionalidades, temas eCommerce y extensiones?</h4>\n<p>\n<p>Puedes votar y solicitar nuevas funcionalidades y extensiones en nuestro <a href=\"http://ideas.woocommerce.com/forums/133476-woocommerce\" rel=\"nofollow\">panel de WooIdeas</a></p>\n</p>\n<h4>¿Dónde puedo informar de errores o contribuir con el proyecto?</h4>\n<p>\n<p>Se puede informar de los fallos en los foros de soporte o, preferentemente, en el <a href=\"https://github.com/woocommerce/woocommerce/issues\" rel=\"nofollow\">directorio en GitHub de WooCommerce</a>.</p>\n</p>\n<h4>¿Dónde puedo encontrar la documentación de la REST API?</h4>\n<p>\n<p>Puedes encontrar la documentación de nuestra REST API en los <a href=\"https://woocommerce.github.io/woocommerce-rest-api-docs/\" rel=\"nofollow\">documentos REST API de WooCommerce</a>.</p>\n</p>\n<h4>¡WooCommerce es alucinante! ¿Puedo contribuir?</h4>\n<p>\n<p>¡Sí que puedes! Únete a nuestro <a href=\"http://github.com/woocommerce/woocommerce/\" rel=\"nofollow\">repositorio en GitHub</a> 🙂</p>\n</p>\n\n\";s:9:\"changelog\";s:12178:\"<h4>3.3.1 &#8211; 2018-02-06</h4>\n<ul>\n<li>Corregido – Se añade <code>woocommerce_output_product_categories</code> para reemplazar la función <code>woocommerce_product_subcategories</code> y prevenir que los archivos de plantilla de tema obsoletos generen categorías en la tienda y en las páginas de categoría en error.</li>\n<li>Corregido – Se previene que el valor de las columnas pueda establecerse por debajo de 1.</li>\n<li>Corregido – Añadida una comprobación adicional de errores en la API de Webhooks para prevenir avisos cuando se eliminan Webhooks.</li>\n<li>Corregido – Se previene que las clases de tablas con listas se carguen varias veces. Esto también soluciona la compatibilidad con la extensión Smart Coupons.</li>\n<li>Corregido – Eliminada la cadena de depuración dependiente de la plantilla de correo electrónico de pedido y se corregidos algunos errores tipográficos.</li>\n<li>Corregido – Configurado el bucle cuando llama a wc_get_loop_prop. Soluciona la compatibilidad con algunos temas.</li>\n<li>Corregido – Se elimina la aplicación múltiple del filtro &#8216;woocommerce_order_item_product&#8217;.</li>\n<li>Corregido – Protección contra el soporte de temas que se define demasiado tarde. Soluciona algunos problemas con temas personalizados que definen la compatibilidad con WooCommerce de forma incorrecta.</li>\n<li>Corregido – Añadida alternativa para los temas que acaben de obtener la plantilla de paginación.</li>\n<li>Corregido – Se hace que la regeneración de imágenes al vuelo también regenere los tamaños que falten.</li>\n<li>Corregido – Corregido que falte el user_id en el webhook del script de migración.</li>\n<li>Corregido – Se permite que las categorías no categorizadas se ordenen como las demás.</li>\n<li>Corregido – Si el tema admite cambios, es posible que tengamos que actualizar los enlaces permanentes, ya que algunos se modifican según este indicador.</li>\n<li>Corregido – Se lanzan los ganchos para la paginación, etc. únicamente cuando está activada la paginación.</li>\n<li>Corregido – HTML por defecto al final del contenedor de la plantilla.</li>\n<li>Corregido – Se evita la paginación por defecto mostrada en los archivos para temas no soportados.</li>\n<li>Corregido – Corregida la tienda cuando se muestra como página de inicio en los temas no soportados.</li>\n<li>Corregido – Corregida la asignación de SKU para los marcadores de posición durante la importación de CSV.</li>\n<li>Corregido – Utilización de CRUD search helper en la tabla de productos del administrador, de forma que funcionan las búsquedas parciales de SKU.</li>\n<li>Corregido – Corregido el ajuste por lotes del porcentaje del precio rebajado/normal.</li>\n<li>Corregido – Reemplazo de estilos de columnas más específico en pantallas pequeñas.</li>\n<li>Mejora – Se ha añadido un aviso para el cambio de lugar del ajuste del aviso en la tienda.</li>\n<li>Mejora – Únicamente se permite eliminar los cupones en los pedidos que se pueden editar.</li>\n<li>Mejora – Extendido el procesamiento en segundo plano de la biblioteca para evitar que se cambien los métodos en la biblioteca.</li>\n<li>Mejora – No se muestran los ajustes de columnas si algo ya está administrando la cantidad de productos por página.</li>\n<li>Mejora – Se permite a los desarrolladores añadir la clase &#8216;no-link&#8217; a los elementos para prevenir que en la vista de pedidos se abra el enlace al hacer clic en una fila.</li>\n<li>Mejora – Se ha hecho más útil el filtro woocommerce_resize_images llamándolo más tarde.</li>\n<li>Mejora – Se ha vuelto a las 4 columnas por defecto, para que sea consistente con 3.2.</li>\n</ul>\n<h4>3.3.0 &#8211; 2018-01-30</h4>\n<ul>\n<li>Característica &#8211; Mejorada la apariencia por defecto en temas que no son compatibles con WooCommerce, haciendo la página de la tienda basada en shortcodes.</li>\n<li>Característica &#8211; Shortcodes de producto; mejorado el ordenamiento aleatorio, con algo de cacheo.</li>\n<li>Característica &#8211; Shortcodes de producto; compatible con paginación.</li>\n<li>Característica &#8211; Añadidas nuevas opciones al personalizador de apariencia de WordPress; controla la rejilla de productos (filas y columnas), y los tamaños de imagen.</li>\n<li>Característica &#8211; Mejorado cómo los tamaños de las imágenes son definidos y calculados. Establece una relación de aspecto (personalizada, 1:1, sin cortes) y unos tamaños de imagen que se calcularán automágicamente basado en sus anchos.</li>\n<li>Característica &#8211; Cambiar los tamaños de las imágenes provocará automáticamente la regeneración de miniaturas de manera interna.</li>\n<li>Característica &#8211; Mejorado cómo se guardan las descargas en los productos, y añadidas nuevas características de informes/registros para controlar quién descargó qué y cuándo.</li>\n<li>Característica &#8211; Mejorada la apariencia global de la lista de pedidos en el escritorio, y añadido un nuevo botón de previsualizar para ver rápidamente los detalles de los pedidos.</li>\n<li>Característica &#8211; Nuevos datos de ejemplo y marcadores de posición por defecto.</li>\n<li>Característica &#8211; Añadidos detalles de la API de pruebas y producción a los datos estándar de PayPal, así como una indicación en el pago sobre qué modo está actualmente activo. Los avisos por correo electrónico de la IPN de PayPal ahora son también opcionales.</li>\n<li>Característica &#8211; Se introduce un filtro umbral de categoría de producto (<code>woocommerce_product_category_filter_threshold</code>). El selector que funciona con AJAX se activará cuando haya más de 100 categorías.</li>\n<li>Característica &#8211; Añadido el método <code>add_to_cart_description</code> y aria-labels a los botones del carrito en el loop para la accesibilidad.</li>\n<li>Característica &#8211; Posibilidad de buscar en los registros cuando se utiliza el registro de base de datos.</li>\n<li>Rendimiento &#8211; Ajustado cómo se obtienen y se guardan los enlaces permanentes para evitar cambiar la localización en cada carga de página. </li>\n<li>Rendimiento: añadida caché a la carga de atributos de variaciones de productos.</li>\n<li>Corregido &#8211; Arreglada la lógica de wc_notice_count.</li>\n<li>Corregido &#8211; Corregido el formato del precio en la edición en bloque.</li>\n<li>Corregido &#8211; Correción del Ajax del shortcode del botón de añadir al carrito.</li>\n<li>Mejora &#8211; Se actualiza la facturación si el formulario de la cuenta cambia.</li>\n<li>Mejora &#8211; Eliminados los vídeos de las secciones de ayuda.</li>\n<li>Mejora &#8211; Se preservan los segundos al salvar la fecha del pedido.</li>\n<li>Mejora &#8211; Se permiten cantidades menores que 1, pero no 0, en la administración.</li>\n<li>Mejora &#8211; Los tipos de contenido que no tienen archivos no deberían mostrarse en las migas de pan.</li>\n<li>Mejora &#8211; Solamente se carga la clase del manejador de sesión en el frontend y no durante el cron.</li>\n<li>Mejora &#8211; Se ha movido la opción &#8220;Aviso de tienda&#8221; al personalizador.</li>\n<li>Mejora &#8211; Al mensaje de error de la validación del código postal al finalizar compra le faltaba la identificación de facturación/envío.</li>\n<li>Mejora &#8211; Añadida la validación Iris para el selector de color.</li>\n<li>Mejora &#8211; Utilizar scrollIntoView al finalizar compra.</li>\n<li>Mejora &#8211; Convertidos los elementos input submit a elementos button submit por todo el código para ser consistentes.</li>\n<li>Mejora &#8211; Añadido <code>{site_title}</code> para sustituir en los pies de los correos electrónicos.</li>\n<li>Mejora &#8211; Añadida confirmación al eliminar un producto si el producto ha tenido ventas.</li>\n<li>Mejora &#8211; Mejorado cuándo se muestra &#8220;incl. IVA&#8221; en los totales del carrito.</li>\n<li>Mejora &#8211; Utiliza el color base del texto para enlaces en las plantillas de correo electrónico.</li>\n<li>Mejora &#8211; Muestra las sobreescrituras del tema que se hacen a través del filtro wc_get_template en el informe de estado del sistema.</li>\n<li>Mejora &#8211; Añadidas etiquetas nofollow en la navegación por capas para prevenir contenido indexado duplicado.</li>\n<li>Mejora &#8211; Ocultar &#8220;incl. IVA&#8221; cuando no hay tasas definidas en el modo de visualización &#8220;total individual&#8221;.</li>\n<li>Mejora &#8211; Añadida protección repetida para reembolsos.</li>\n<li>Mejora &#8211; Manejo del archivo GeoDB vacío.</li>\n<li>Mejora &#8211; Se permite a wp_signon gestionar la conversión de correo electrónico a nombre de usuario.</li>\n<li>Mejora &#8211; Se ha hecho el campo de correo electrónico más ancho en la página de finalizar compra.</li>\n<li>Mejora &#8211; Publica la selección completa de envíos al mostrar múltiples paquetes.</li>\n<li>Desarrollo &#8211; REST API &#8211; Los pedidos deberían ser creados por usuarios que existen únicamente en el sitio.</li>\n<li>Desarrollo &#8211; REST API &#8211; Arreglado el valor por defecto de &#8220;dp&#8221; en pedidos y variables de reembolso.</li>\n<li>Desarrollo &#8211; Temas &#8211; Añadidas variables compatibles con el tema para declarar los tamaños de imagen utilizados para los productos.</li>\n<li>Desarrollo &#8211; Temas &#8211; Añadida compatibilidad para archivos de plantilla single-product-postname.php.</li>\n<li>Desarrollo &#8211; Añadidas acciones antes de los cálculos de los totales del pedido e impuestos y compatible con is_vat_excempt.</li>\n<li>Desarrollo &#8211; Añadido el filtro &#8216;woocommerce_coupon_get_apply_quantity&#8217;.</li>\n<li>Desarrollo &#8211; Productos agrupados; añadidos filtros para permitir columnas personalizadas y cambios a los valores.</li>\n<li>Desarrollo &#8211; Permiso para clonar el objeto WC_Cart</li>\n<li>Desarrollo &#8211; Aplicados filtros al error registration-error-email-exists.</li>\n<li>Desarrollo &#8211; Añadido el filtro <code>woocommerce_cross_sells_order</code>.</li>\n<li>Desarrollo &#8211; Añadido el gancho order-details <code>before</code> para complementar a los ganchos ya existentes.</li>\n<li>Desarrollo &#8211; Constante WC_CHUNK_SIZE para controlar el readfile.</li>\n<li>Desarrollo &#8211; Añado un cortocircuito a la función del producto comprado por el cliente.</li>\n<li>Desarrollo &#8211; Añadido un método <code>wc_caught_exception</code> para ayudar al registro.</li>\n<li>Desarrollo &#8211; Añadido almacenamiento de datos y CRUD para trabajar con webhooks.</li>\n<li>Desarrollo &#8211; Subida la versión mínima requerida de WP a 4.5 y eliminados archivos heredados de la API.</li>\n<li>Desarrollo &#8211; Nuevas acciones &#8211; <code>woocommerce_order_details_before_order_table_items</code>,  <code>woocommerce_order_details_after_order_table_items</code> y <code>woocommerce_order_details_before_order_table</code></li>\n<li>Desarrollo &#8211; Paso de <code>widget_id</code> a <code>content-widget-product.php</code> para que las acciones se puedan ejecutar condicionalmente y añadido saneado a <code>woocommerce_before_widget_product_list</code> y <code>woocommerce_after_widget_product_list</code>.</li>\n<li>Desarrollo &#8211; Mejoradas las comprobaciones <code>is_internal_meta_key</code> para considerar getters y setters.</li>\n<li>Desarrollo &#8211; Limpiada la plantilla de detalles del pedido del cliente.</li>\n<li>Desarrollo &#8211; Eventos JavaScript payment_method_selected al finalizar compra.</li>\n<li>Desarrollo &#8211; Añadido el método nuevo <code>$order-&gt;get_edit_order_url()</code></li>\n<li>Desarrollo &#8211; Paso a través de las opciones para hacer zoom, flexslider y photoswipe.</li>\n<li>Desarrollo &#8211; Añadidas acciones antes y después del inicio y completado de las ofertas programadas.</li>\n<li>Localización &#8211; Añadida caracter de dirección a la salida de moneda.</li>\n<li>Localización &#8211; Estados de Tanzania y Moldavia </li>\n</ul>\n<p><a href=\"https://raw.githubusercontent.com/woocommerce/woocommerce/master/CHANGELOG.txt\" rel=\"nofollow\">Ver el registro de cambios de todas las versiones</a>.</p>\n\";s:11:\"screenshots\";s:1503:\"<ol><li><a href=\"https://ps.w.org/woocommerce/assets/screenshot-1.png?rev=1063946\"><img src=\"https://ps.w.org/woocommerce/assets/screenshot-1.png?rev=1063946\" alt=\"El impecable panel de ajustes de WooCommerce.\"></a><p>El impecable panel de ajustes de WooCommerce.</p></li><li><a href=\"https://ps.w.org/woocommerce/assets/screenshot-2.png?rev=1063946\"><img src=\"https://ps.w.org/woocommerce/assets/screenshot-2.png?rev=1063946\" alt=\"Administración de productos en WooCommerce.\"></a><p>Administración de productos en WooCommerce.</p></li><li><a href=\"https://ps.w.org/woocommerce/assets/screenshot-3.png?rev=1063946\"><img src=\"https://ps.w.org/woocommerce/assets/screenshot-3.png?rev=1063946\" alt=\"Panel de datos de producto.\"></a><p>Panel de datos de producto.</p></li><li><a href=\"https://ps.w.org/woocommerce/assets/screenshot-4.png?rev=1063946\"><img src=\"https://ps.w.org/woocommerce/assets/screenshot-4.png?rev=1063946\" alt=\"Informe de ventas de WooCommerce.\"></a><p>Informe de ventas de WooCommerce.</p></li><li><a href=\"https://ps.w.org/woocommerce/assets/screenshot-5.png?rev=1087192\"><img src=\"https://ps.w.org/woocommerce/assets/screenshot-5.png?rev=1087192\" alt=\"Una página de producto simple.\"></a><p>Una página de producto simple.</p></li><li><a href=\"https://ps.w.org/woocommerce/assets/screenshot-6.png?rev=1087192\"><img src=\"https://ps.w.org/woocommerce/assets/screenshot-6.png?rev=1087192\" alt=\"