(15847, '_site_transient_loopia_plugin_api_wordfence', 'O:8:\"stdClass\":27:{s:4:\"name\";s:54:\"Wordfence Security &#8211; Firewall &amp; Malware Scan\";s:4:\"slug\";s:9:\"wordfence\";s:7:\"version\";s:5:\"7.0.4\";s:6:\"author\";s:49:\"<a href=\"http://www.wordfence.com/\">Wordfence</a>\";s:14:\"author_profile\";s:39:\"https://profiles.wordpress.org/mmaunder\";s:8:\"requires\";s:3:\"3.9\";s:6:\"tested\";s:5:\"4.9.4\";s:12:\"requires_php\";b:0;s:6:\"rating\";d:96;s:7:\"ratings\";a:5:{i:5;i:2976;i:4;i:71;i:3;i:32;i:2;i:27;i:1;i:113;}s:11:\"num_ratings\";i:3219;s:15:\"support_threads\";i:380;s:24:\"support_threads_resolved\";i:233;s:15:\"active_installs\";i:2000000;s:10:\"downloaded\";i:60959135;s:12:\"last_updated\";s:21:\"2018-02-12 8:30pm GMT\";s:5:\"added\";s:10:\"2012-04-21\";s:8:\"homepage\";s:25:\"http://www.wordfence.com/\";s:8:\"sections\";a:5:{s:11:\"description\";s:3297:\"<h3>THE MOST POPULAR WORDPRESS FIREWALL &amp; SECURITY SCANNER</h3>\n<p>Wordfence includes an endpoint firewall and malware scanner that were built from the ground up to protect WordPress. Our Threat Defense Feed arms Wordfence with the newest firewall rules, malware signatures and malicious IP addresses it needs to keep your website safe. Rounded out by a suite of additional features, Wordfence is the most comprehensive WordPress security solution available.</p>\n<h4>WORDPRESS FIREWALL</h4>\n<ul>\n<li>Web Application Firewall identifies and blocks malicious traffic. Built and maintained by a large team focused 100% on WordPress security.</li>\n<li>[Premium] Real-time firewall rule and malware signature updates via the Threat Defense Feed (free version is delayed by 30 days).</li>\n<li>[Premium] Real-time IP Blacklist blocks all requests from the most malicious IPs, protecting your site while reducing load.</li>\n<li>Protects your site at the endpoint, enabling deep integration with WordPress. Unlike cloud alternatives does not break encryption, cannot be bypassed and cannot leak data.</li>\n<li>Integrated malware scanner blocks requests that include malicious code or content.</li>\n<li>Protection from brute force attacks by limiting login attempts, enforcing strong passwords and other login security measures.</li>\n</ul>\n<h4>WORDPRESS SECURITY SCANNER</h4>\n<ul>\n<li>Malware scanner checks core files, themes and plugins for malware, bad URLs, backdoors, SEO spam, malicious redirects and code injections.</li>\n<li>[Premium] Real-time malware signature updates via the Threat Defense Feed (free version is delayed by 30 days).</li>\n<li>Compares your core files, themes and plugins with what is in the WordPress.org repository, checking their integrity and reporting any changes to you.</li>\n<li>Repair files that have changed by overwriting them with a pristine, original version. Delete any files that don’t belong easily within the Wordfence interface.</li>\n<li>Checks your site for known security vulnerabilities and alerts you to any issues. Also alerts you to potential security issues when a plugin has been closed or abandoned.</li>\n<li>Checks your content safety by scanning file contents, posts and comments for dangerous URLs and suspicious content.</li>\n<li>[Premium] Checks to see if your site or IP have been blacklisted for malicious activity, generating spam or other security issue.</li>\n</ul>\n<h4>SECURITY TOOLS</h4>\n<ul>\n<li>With Live Traffic, monitor visits and hack attempts not shown in other analytics packages in real time; including origin, their IP address, the time of day and time spent on your site.</li>\n<li>[Premium] Stop brute force attacks permanently by using two factor authentication, one of the most secure forms of remote system authentication available.</li>\n<li>[Premium] Password Audit ensures your passwords are strong by simulating a hack attempt using our password auditing GPU cluster.</li>\n<li>The free version of Wordfence includes an excellent comment spam filter. [Premium] An advanced comment spam filter is automatically enabled for premium customers.</li>\n<li>Block attackers by IP or build advanced rules based on IP Range, Hostname, User Agent and Referrer. [Premium] Country blocking available with Wordfence Premium.</li>\n</ul>\n\";s:12:\"installation\";s:2173:\"<p>Asegura tu sitio web siguiendo los próximos pasos para instalar Wordfence:</p>\n<ol>\n<li>Install Wordfence automatically or by uploading the ZIP file. </li>\n<li>Activate the Wordfence through the &#8216;Plugins&#8217; menu in WordPress. Wordfence is now activated.</li>\n<li>Go to the scan menu and start your first scan. Scheduled scanning will also be enabled.</li>\n<li>Once your first scan has completed, a list of threats will appear. Go through them one by one to secure your site.</li>\n<li>Visit the Wordfence options page to enter your email address so that you can receive email security alerts.</li>\n<li>Optionally, change your security level or adjust the advanced options to set individual scanning and protection options for your site.</li>\n<li>Click the &#8220;Live Traffic&#8221; menu option to watch your site activity in real-time. Situational awareness is an important part of website security.</li>\n</ol>\n<p>To install the Wordfence on WordPress Multi-Site installations:</p>\n<ol>\n<li>Install Wordfence via the plugin directory or by uploading the ZIP file.</li>\n<li>Network Activate Wordfence. This step is important because until you network activate it, your sites will see the plugin option on their plugins menu. Once activated that option disappears. </li>\n<li>Now that Wordfence is network activated it will appear on your Network Admin menu. Wordfence will not appear on any individual site&#8217;s menu. </li>\n<li>Go to the &#8220;Scan&#8221; menu and start your first scan. </li>\n<li>Wordfence will do a scan of all files in your WordPress installation including those in the blogs.dir directory of your individual sites. </li>\n<li>Live Traffic will appear for ALL sites in your network. If you have a heavily trafficked system you may want to disable live traffic which will stop logging to the DB. </li>\n<li>Firewall rules and login rules apply to the WHOLE system. So if you fail a login on site1.example.com and site2.example.com it counts as 2 failures. Crawler traffic is counted between blogs, so if you hit three sites in the network, all the hits are totalled and that counts as the rate you&#8217;re accessing the system.</li>\n</ol>\n\";s:3:\"faq\";s:13360:\"<p><a href=\"https://wordfence.com/help/\" rel=\"nofollow\">Visit our website to access our official documentation which includes security feature descriptions, common solutions and comprehensive help.</a></p>\n\n<h4>Installation Instructions</h4>\n<p>\n<p>Asegura tu sitio web siguiendo los próximos pasos para instalar Wordfence:</p>\n<ol>\n<li>Install Wordfence automatically or by uploading the ZIP file. </li>\n<li>Activate the Wordfence through the &#8216;Plugins&#8217; menu in WordPress. Wordfence is now activated.</li>\n<li>Go to the scan menu and start your first scan. Scheduled scanning will also be enabled.</li>\n<li>Once your first scan has completed, a list of threats will appear. Go through them one by one to secure your site.</li>\n<li>Visit the Wordfence options page to enter your email address so that you can receive email security alerts.</li>\n<li>Optionally, change your security level or adjust the advanced options to set individual scanning and protection options for your site.</li>\n<li>Click the &#8220;Live Traffic&#8221; menu option to watch your site activity in real-time. Situational awareness is an important part of website security.</li>\n</ol>\n<p>To install the Wordfence on WordPress Multi-Site installations:</p>\n<ol>\n<li>Install Wordfence via the plugin directory or by uploading the ZIP file.</li>\n<li>Network Activate Wordfence. This step is important because until you network activate it, your sites will see the plugin option on their plugins menu. Once activated that option disappears. </li>\n<li>Now that Wordfence is network activated it will appear on your Network Admin menu. Wordfence will not appear on any individual site&#8217;s menu. </li>\n<li>Go to the &#8220;Scan&#8221; menu and start your first scan. </li>\n<li>Wordfence will do a scan of all files in your WordPress installation including those in the blogs.dir directory of your individual sites. </li>\n<li>Live Traffic will appear for ALL sites in your network. If you have a heavily trafficked system you may want to disable live traffic which will stop logging to the DB. </li>\n<li>Firewall rules and login rules apply to the WHOLE system. So if you fail a login on site1.example.com and site2.example.com it counts as 2 failures. Crawler traffic is counted between blogs, so if you hit three sites in the network, all the hits are totalled and that counts as the rate you&#8217;re accessing the system.</li>\n</ol>\n</p>\n<h4>How does Wordfence Security protect sites from attackers?</h4>\n<p>\n<p>The WordPress security plugin provides the best protection available for your website. Powered by the constantly updated Threat Defense Feed, WordFence Firewall stops you from getting hacked. Wordfence Scan leverages the same proprietary feed, alerting you quickly about security issues or if your site is compromised. The Live Traffic view gives you real-time visibility into traffic and hack attempts on your website. A deep set of additional tools round out the most comprehensive WordPress security solution available.</p>\n</p>\n<h4>What features does Wordfence Premium enable?</h4>\n<p>\n<p>We offer a Premium API key that gives you real-time updates to the Threat Defense Feed which includes a real-time IP blacklist, firewall rules and malware signatures. Premium support, country blocking, more frequent scans, password auditing, two-factor authentication and spam and spamvertising checks are also included. <a href=\"http://www.wordfence.com/\" rel=\"nofollow\">Click here to sign-up for Wordfence Premium now</a> or simply install Wordfence free and start protecting your website.</p>\n</p>\n<h4>How does the Wordfence WordPress Firewall protect websites?</h4>\n<p>\n<ul>\n<li>El cortafuegos de la aplicación web previene que seas atacado identificando tráfico malicioso, bloqueando atacantes antes de que pueda acceder a tu sitio web.</li>\n<li>El Feed de Defensa ante Amenazas actualiza automáticamente las reglas del cortafuegos que te protege de las últimas amenazas. Los miembros Premium reciben la versión actualizada en tiempo real. </li>\n<li>Bloquea amenazas de seguridad comunes como falsos Googlebots, escaneos maliciosos de hackers y botnets.</li>\n</ul>\n</p>\n<h4>What checks does the Wordfence Security Scanner perform?</h4>\n<p>\n<ul>\n<li>Scans core files, themes and plugins against WordPress.org repository versions to check their integrity. Verify security of your source.</li>\n<li>See how files have changed. Optionally repair changed files that are security threats.</li>\n<li>Scans for signatures of over 44,000 known malware variants that are known WordPress security threats.</li>\n<li>Scans for many known backdoors that create security holes including C99, R57, RootShell, Crystal Shell, Matamu, Cybershell, W4cking, Sniper, Predator, Jackal, Phantasma, GFS, Dive, Dx and many more.</li>\n<li>Continuously scans for malware and phishing URL’s including all URLs on the Google Safe Browsing List in all your comments, posts and files that are security threats.</li>\n<li>Scans for heuristics of backdoors, trojans, suspicious code and other security issues.</li>\n</ul>\n</p>\n<h4>What security monitoring features does Wordfence include?</h4>\n<p>\n<ul>\n<li>See all your traffic in real-time, including robots, humans, 404 errors, logins and logouts and who is consuming most of your content. Enhances your situational awareness of which security threats your site is facing.</li>\n<li>A real-time view of all traffic including automated bots that often constitute security threats that Javascript analytics packages never show you.</li>\n<li>Real-time traffic includes reverse DNS and city-level geolocation. Know which geographic area security threats originate from.</li>\n<li>Monitor your DNS security for unauthorized DNS changes.</li>\n<li>Monitors disk space which is related to security because many DDoS attacks attempt to consume all disk space to create denial of service.</li>\n</ul>\n</p>\n<h4>What login security features are included</h4>\n<p>\n<ul>\n<li>See all your traffic in real-time, including robots, humans, 404 errors, logins and logouts and who is consuming most of your content. Enhances your situational awareness of which security threats your site is facing.</li>\n<li>A real-time view of all traffic including automated bots that often constitute security threats that Javascript analytics packages never show you.</li>\n<li>Real-time traffic includes reverse DNS and city-level geolocation. Know which geographic area security threats originate from.</li>\n<li>Monitor your DNS security for unauthorized DNS changes.</li>\n<li>Monitors disk space which is related to security because many DDoS attacks attempt to consume all disk space to create denial of service.</li>\n</ul>\n</p>\n<h4>¿Cómo seré alertado de que mi sitio web tiene un problema de seguridad?</h4>\n<p>\n<p>Wordfence sends security alerts via email. Once you install Wordfence, you will configure a list of email addresses where security alerts will be sent. When you receive a security alert, make sure you deal with it promptly to ensure your site stays secure.</p>\n</p>\n<h4>Do I need a security plugin like Wordfence if I’m using a cloud based firewall (WAF)?</h4>\n<p>\n<p>Wordfence provides true endpoint security for your WordPress website. Unlike cloud based firewalls, Wordfence executes within the WordPress environment, giving it knowledge like whether the user is signed in, their identity and what access level they have. Wordfence uses the user’s access level in more than 80% of the firewall rules it uses to protect WordPress websites. Learn more about the <a href=\"https://www.wordfence.com/blog/2016/10/endpoint-vs-cloud-security-cloud-waf-user-identity-problem/\" rel=\"nofollow\">Cloud WAF identity problem here</a>. Additionally, cloud based firewalls can be bypassed, leaving your site exposed to attackers. Because Wordfence is an integral part of the endpoint (your WordPress website), it can’t be bypassed. Learn more about the <a href=\"https://www.wordfence.com/blog/2016/10/endpoint-vs-cloud-security-cloud-waf-bypass-problem/\" rel=\"nofollow\">Cloud WAF bypass problem here</a>. To fully protect the investment you’ve made in your website you need to employ a defense in depth approach to security. Wordfence takes this approach.</p>\n</p>\n<h4>What blocking features does Wordfence include?</h4>\n<p>\n<ul>\n<li>Real-time blocking of known attackers. If another site using Wordfence is attacked and blocks the attacker, your site is automatically protected.</li>\n<li>Block entire malicious networks. Includes advanced IP and Domain WHOIS to report malicious IP’s or networks and block entire networks using the firewall. Report WordPress security threats to network owner.</li>\n<li>Rate limit or block WordPress security threats like aggressive crawlers, scrapers and bots doing security scans for vulnerabilities in your site.</li>\n<li>Choose whether you want to block or throttle users and robots who break your WordPress security rules.</li>\n<li>Premium users can also block countries and schedule scans for specific times and a higher frequency.</li>\n</ul>\n</p>\n<h4>What differentiates Wordfence from other WordPress Security plugins?</h4>\n<p>\n<ul>\n<li>Wordfence Security provides a WordPress Firewall developed specifically for WordPress and blocks attackers looking for vulnerabilities on your site.  The Firewall is powered by our Threat Defense Feed which is continually updated as new threats emerge.  Premium customers receive updates in real-time.</li>\n<li>Wordfence verifies your website source code integrity against the official WordPress repository and shows you the changes. </li>\n<li>Wordfence scans check all your files, comments and posts for URLs in Google&#8217;s Safe Browsing list. We are the only plugin to offer this very important security enhancement.</li>\n<li>Wordfence scans do not consume large amounts of your bandwidth because all security scans happen on your web server which makes them very fast.</li>\n<li>Wordfence fully supports WordPress Multi-Site which means you can security scan every blog in your Multi-Site installation with one click.</li>\n<li>Wordfence includes Two-Factor authentication, the most secure way to stop brute force attackers in their tracks.</li>\n<li>Wordfence fully supports IPv6 including giving you the ability to look up the location of IPv6 addresses, block IPv6 ranges, detect IPv6 country and do a whois lookup on IPv6 addresses and more.</li>\n</ul>\n</p>\n<h4>Will Wordfence slow down my website?</h4>\n<p>\n<p>No. Wordfence Security is extremely fast and uses techniques like caching its own configuration data to avoid database lookups and blocking malicious attacks that would slow down your site.</p>\n</p>\n<h4>What if my site has already been hacked?</h4>\n<p>\n<p>Wordfence Security is able to repair core files, themes and plugins on sites where security is already compromised. You can follow this guide on <a href=\"https://www.wordfence.com/docs/how-to-clean-a-hacked-wordpress-site-using-wordfence/\" rel=\"nofollow\">how to clean a hacked website</a> using Wordfence. However, please note that site security cannot be assured unless you do a full reinstall if your site has been hacked. We recommend you only use Wordfence Security to get your site into a running state in order to recover the data you need to do a full reinstall. If you need help repairing a hacked site, we offer an affordable, high-quality <a href=\"https://www.wordfence.com/wordfence-site-cleanings/\" rel=\"nofollow\">site cleaning service</a> that includes a Premium key for a year.</p>\n</p>\n<h4>¿Wordfence Security soporta IPv6?</h4>\n<p>\n<p>Yes. We fully support IPv6 with all security functions including country blocking, range blocking, city lookup, whois lookup and all other security functions. If you are not running IPv6, Wordfence will work great on your site too. We are fully compatible with both IPv4 and IPv6 whether you run both or only one addressing scheme.</p>\n</p>\n<h4>¿Soporta Wordfence Security instalaciones multisitio?</h4>\n<p>\n<p>Yes. WordPress Multi-Site is fully supported. Using Wordfence you can scan every blog in your network for malware with one click. If one of your customers posts a page or post with a known malware URL that threatens your whole domain with being blacklisted by Google, we will alert you in the next scan.</p>\n</p>\n<h4>What support options are available for Wordfence users?</h4>\n<p>\n<p>Providing excellent customer service is very important to us.  We offer help to all our customers whether you are using the Premium or free version of Wordfence.  For help with the free version, you can post in our <a href=\"https://wordpress.org/support/plugin/wordfence\" rel=\"nofollow\">forum</a> where we have dedicated staff responding to questions. If you need faster or more in-depth help, Premium customers can submit a <a href=\"https://support.wordfence.com/support/home\" rel=\"nofollow\">support ticket</a> to our Premium support team.</p>\n</p>\n<h4>¿Dónde puedo aprender más de WordPress security?</h4>\n<p>\n<p>Designed for every skill level, <a href=\"https://www.wordfence.com/learn/\" rel=\"nofollow\">The WordPress Security Learning Center</a> is dedicated to deepening users’ understanding of security best practices by providing free access to entry-level articles, in-depth articles, videos, industry survey results, graphics and more.</p>\n</p>\n\n\";s:9:\"changelog\";s:38816:\"<h4>7.0.4</h4>\n<ul>\n<li>Fix: Re-added missing file to fix commit excluding it.</li>\n</ul>\n<h4>7.0.3</h4>\n<ul>\n<li>Improvement: Added an &#8220;All Options&#8221; page to enable developers and others to more rapidly configure Wordfence.</li>\n<li>Improvement: Improved messaging for when a page has been open for more than a day and the security token expires.</li>\n<li>Improvement: Relocated the &#8220;Always display expanded Live Traffic records&#8221; option to be more accessible.</li>\n<li>Improvement: Improved appearance and behavior of option checkboxes.</li>\n<li>Improvement: For plugins with incomplete header information, they&#8217;re now shown with a fallback title in scan results as appropriate.</li>\n<li>Improvement: The country block rule in the blocks table now shows a count rather than a potentially large list of countries.</li>\n<li>Change: Modified behavior of the advanced country blocking options to always show.</li>\n<li>Fix: Fixed the &#8220;Make Permanent&#8221; button behavior for blocks created from Live Traffic.</li>\n<li>Fix: Better synchronization of block records to the WAF config to avoid duplicate queries.</li>\n<li>Fix: The diff viewer now forces wrapping to prevent long lines of text from stretching the layout.</li>\n<li>Fix: Fixed an issue where the scanned plugin count could be inaccurate due to forking during the plugin scan.</li>\n<li>Fix: Adjusted sizing on the country blocking options to prevent placeholder text from being cut off at some screen sizes.</li>\n<li>Fix: Block/Unblock now works correctly when viewing Live Traffic with it grouped by IP.</li>\n<li>Fix: Fixed an issue where the count of URLs checked was incorrect.</li>\n</ul>\n<h4>7.0.2</h4>\n<ul>\n<li>Improvement: Added CSS/JS filename versioning to address caching plugins not refreshing for plugin updates.</li>\n<li>Improvement: The premium key is no longer prompted for during installation if already present from an earlier version.</li>\n<li>Improvement: Added a check and corresponding notice if the WAF config is unreadable or invalid.</li>\n<li>Improvement: Improved live traffic sizing on smaller screens.</li>\n<li>Improvement: Added tour coverage for live traffic.</li>\n<li>Change: IPs blocked via live traffic now use the configurable how long is an IP blocked setting to match previous behavior.</li>\n<li>Change: Changed the option to enable live traffic to match the wording and style of other options.</li>\n<li>Change: Changed styling on the unknown country display in live traffic to match the common coloring.</li>\n<li>Change: Statistics that do not depend on the WAF for their data now display when it is in learning mode.</li>\n<li>Change: Scan issues that are indicative of a compromised site are moved to the top of the list.</li>\n<li>Change: Changed styling on unselected checkboxes.</li>\n<li>Fix: Quick scans no longer run daily if automatic scheduled scans are disabled.</li>\n<li>Fix: The update check in a quick scan no longer runs if the update check has been turned off for regular scans.</li>\n<li>Fix: Fixed the quick navigation letters in the country picker not scrolling.</li>\n<li>Fix: Fixed editing the country block configuration when there are a large number of other blocks.</li>\n<li>Fix: Addressed an issue where having the country block or a pattern block selected when clicking Make Permanent could break them.</li>\n<li>Fix: Live traffic entries with long user agents no longer cause the table to stretch.</li>\n<li>Fix: Fixed an issue where live traffic would stop loading new records if always display expanded records was on.</li>\n<li>Fix: Suppressed warnings on IP conversion functions when processing potentially incomplete data.</li>\n<li>Fix: Added a check in REST API hooks to avoid defining a constant twice.</li>\n</ul>\n<h4>7.0.1</h4>\n<ul>\n<li>Comprehensive UI refresh.</li>\n<li>Improvement: Updated bundled GeoIP database.</li>\n</ul>\n<h4>6.3.22</h4>\n<ul>\n<li>Fix: Addressed a warning that could occur on PHP 7.1 when reading php.ini size values.</li>\n<li>Fix: Fixed a warning by adjusting a query to remove old-style variable references.</li>\n</ul>\n<h4>6.3.21</h4>\n<ul>\n<li>Improvement: Updated bundled GeoIP database.</li>\n<li>Fix: Fixed a log warning that could occur during the scan for plugins not in the wordpress.org repository.</li>\n</ul>\n<h4>6.3.20</h4>\n<ul>\n<li>Improvement: The scan will now alert for a publicly visible .user.ini file.</li>\n<li>Fix: Fixed status code and human/bot tagging of block hit entries for live traffic and the Wordfence Security Network.</li>\n<li>Fix: Added internal throttling to ensure the daily cron does not run too frequently on some hosts.</li>\n</ul>\n<h4>6.3.19</h4>\n<ul>\n<li>Emergency Fix: Updated wpdb::prepare calls using %.6f since it is no longer supported.</li>\n</ul>\n<h4>6.3.18</h4>\n<ul>\n<li>Improvement: Reduced size of some JavaScript for faster loading.</li>\n<li>Improvement: Better block counting for advanced comment filtering.</li>\n<li>Improvement: Increased logging in debug mode for plugin updates to help resolve issues.</li>\n<li>Fix: Reduced the minimum duration of a scan stage to improve reliability on some hosts.</li>\n</ul>\n<h4>6.3.17</h4>\n<ul>\n<li>Improvement: Prepared code for upcoming scan improvement which will greatly increase scan performance by optimizing malware signatures.</li>\n<li>Improvement: Updated the bundled GeoIP database.</li>\n<li>Improvement: Better scan messaging when a publicly-reachable searchreplacedb2.php utility is found.</li>\n<li>Improvement: The no-cache constant for database caching is now set for W3TC for plugin updates and scans.</li>\n<li>Improvement: Added an additional home/siteurl resolution check for WPML installations.</li>\n</ul>\n<h4>6.3.16</h4>\n<ul>\n<li>Improvement: Introduced a new scan stage to check for malicious URLs and content within WordPress core, plugin, and theme options.</li>\n<li>Improvement: New scan stage includes a new check for TrafficTrade malware.</li>\n<li>Improvement: Reduced net memory usage during forked scan stages by up to 50%.</li>\n<li>Improvement: Reduced the number of queries executed for some configuration options.</li>\n<li>Improvement: Modified the default whitelisting to include the new core AJAX action in WordPress 4.8.1.</li>\n<li>Fix: Synchronized the scan option names between the main options page and smaller scan options page.</li>\n<li>Fix: Fixed CSS positioning issue for dashboard metabox with IPv6.</li>\n<li>Corrección: Corregido un error de compatibilidad con la sentencia del home_url de los sitios cuando está instalado WPML.</li>\n</ul>\n<h4>6.3.15</h4>\n<ul>\n<li>Improvement: Reduced memory usage on scan forking and during the known files scan stage.</li>\n<li>Improvement: Added additional scan options to allow for disabling the blacklist checks while still allowing malware scanning to be enabled.</li>\n<li>Improvement: Added a Wordfence Application Firewall code block for the lsapi variant of LiteSpeed.</li>\n<li>Improvement: Updated the bundled GeoIP database.</li>\n<li>Fix: Added a validation check to IP range whitelisting to avoid log warnings if they&#8217;re malformed.</li>\n</ul>\n<h4>6.3.14</h4>\n<ul>\n<li>Improvement: Introduced smart scan distribution. Scan times are now distributed intelligently across servers to provide consistent server performance. </li>\n<li>Improvement: Introduced light-weight scan that runs frequently to perform checks that do not use any server resources. </li>\n<li>Improvement: If unable to successfully look up the status of an IP claiming to be Googlebot, the hit is now allowed.</li>\n<li>Improvement: Scan issue results for abandoned plugins and unpatched vulnerabilities include more info.</li>\n<li>Fix: Suppressed PHP notice with time formatting when a microtimestamp is passed.</li>\n<li>Fix: Improved binary data to HTML entity conversion to avoid wpdb stripping out-of-range UTF-8 sequences.</li>\n<li>Fix: Added better detection to SSL status, particularly for IIS.</li>\n<li>Fix: Fixed PHP notice in the diff renderer.</li>\n<li>Fix: Fixed typo in lockout alert.</li>\n</ul>\n<h4>6.3.12</h4>\n<ul>\n<li>Improvement: Adjusted the password audit to use a better cryptographic padding option.</li>\n<li>Improvement: Improved the option value entry process for the modified files exclusion list.</li>\n<li>Improvement: Added rel=&#8221;noopener noreferrer&#8221; to all external links from the plugin for better interoperability with other scanners.</li>\n<li>Improvement: Added support to the WAF for validating URLs for future use in rules.</li>\n<li>Fix: Time formatting will now correctly handle :30 and :45 time zone offsets.</li>\n<li>Fix: Hosts using mod_lsapi will now be detected as Litespeed for WAF optimization.</li>\n<li>Fix: Added an option to allow automatic updates to function on Litespeed servers that have the global noabort set rather than site-local.</li>\n<li>Fix: Fixed a PHP notice that could occur when running a scan immediately after removing a plugin.</li>\n</ul>\n<h4>6.3.11</h4>\n<ul>\n<li>Improvement: The scan will alert for plugins that have not been updated in 2+ years or have been removed from the wordpress.org directory. It will also indicate if there is a known vulnerability.</li>\n<li>Improvement: Added a self-check to the scan to detect if it has stalled.</li>\n<li>Improvement: If WordPress auto-updates while a scan is running, the scan will self-abort and reschedule itself to try again later.</li>\n<li>Improvement: IP-based filtering in Live Traffic can now use wildcards.</li>\n<li>Improvement: Updated the bundled GeoIP database.</li>\n<li>Improvement: Added an anti-crawler feature to the lockout page to avoid crawlers erroneously following the unlock link.</li>\n<li>Improvement: The live traffic &#8220;Group By&#8221; options now dynamically show the results in a more useful format depending on the option selected.</li>\n<li>Improvement: Improved the unknown core files check to include all extra files in core locations regardless of whether or not the &#8220;Scan images, binary, and other files as if they were executable&#8221; option is on.</li>\n<li>Improvement: Better wording for the whitelisting IP range error message.</li>\n<li>Fix: Addressed a performance issue on databases with tens of thousands of tables when trying to load the diagnostics page.</li>\n<li>Fix: All dashboard and activity report email times are now displayed in the time zone configured for the WordPress installation.</li>\n</ul>\n<h4>6.3.10</h4>\n<ul>\n<li>Improvement: Reduction in overall memory usage and peak memory usage for the scanner.</li>\n<li>Improvement: Support for exporting a list of all blocked and locked out IP addresses.</li>\n<li>Improvement: Updated the WAF&#8217;s CA certificate bundle.</li>\n<li>Improvement: Updated the browscap database.</li>\n<li>Improvement: Suppressed the automatic HTTP referer added by WordPress for API calls to reduce overall bandwidth usage.</li>\n<li>Improvement: When all issues for a scan stage have been previously ignored, the results now indicate this rather than saying problems were found.</li>\n<li>Fix: Worked around an issue with WordPress caching to allow password audits to succeed on sites with tens of thousands of users.</li>\n<li>Fix: Fixed an IPv6 detection issue with one form of IPv6 address.</li>\n<li>Fix: An empty ignored IP list for WAF alerts no longer creates a PHP notice.</li>\n<li>Fix: Better detection for when to use secure cookies.</li>\n<li>Fix: Fixed a couple issue types that were not able to be permanently ignored.</li>\n<li>Fix: Adjusted the changelog link in the scan results email to work for the new wordpress.org repository.</li>\n<li>Fix: Fixed some broken links in the activity summary email.</li>\n<li>Fix: Fixed a typo in the scan summary text.</li>\n<li>Fix: The increased attack rate emails now correctly identify blacklist blocks.</li>\n<li>Fix: Fixed an issue with the dashboard where it could show the last scan failed when one has never ran.</li>\n<li>Fix: Brute force records are now coalesced when possible prior to sending.</li>\n</ul>\n<h4>6.3.9</h4>\n<ul>\n<li>Improvement: Malware signature checking has been better optimized to improve overall speed.</li>\n<li>Improvement: Updated the bundled GeoIP database.</li>\n<li>Improvement: The memory tester now tests up to the configured scan limit rather than a fixed value.</li>\n<li>Improvement: Added a test to the diagnostics page that verifies permissions to the WAF config location.</li>\n<li>Improvement: The diagnostics page now contains a callback test for the server itself.</li>\n<li>Improvement: Updated the styling of dashboard notifications for better separation.</li>\n<li>Improvement: Added additional constants to the diagnostics page.</li>\n<li>Change: Wordfence now enters a read-only mode with its configuration files when run via the &#8216;cli&#8217; PHP SAPI on a misconfigured web server to avoid file ownership changing.</li>\n<li>Change: Changed how administrator accounts are detected to compensate for managed WordPress sites that do not have the standard permissions.</li>\n<li>Change: The table list on the diagnostics page is now limited in length to avoid being exceedingly large on big multisite installations.</li>\n<li>Fix: Improved updating of WAF config values to minimize writing to disk.</li>\n<li>Fix: The blacklist&#8217;s blocked IP records are now correctly trimmed when expired.</li>\n<li>Fix: Added error suppression to the WAF attack data functions to prevent corrupt records from breaking the no-cache headers.</li>\n<li>Fix: Fixed some incorrect documentation links on the diagnostics page.</li>\n<li>Fix: Fixed a typo in a constant on the diagnostics page.</li>\n</ul>\n<h4>6.3.8</h4>\n<ul>\n<li>Fix: Addressed an issue that could cause scans to time out on sites with tens of thousands of potential URLs in files, comments, and posts.</li>\n</ul>\n<h4>6.3.7</h4>\n<ul>\n<li>Improvement: All URLs are now checked against the Wordfence Domain Blacklist in addition to Google&#8217;s.</li>\n<li>Improvement: Better page load performance for multisite installations with thousands of tables.</li>\n<li>Improvement: Updated the bundled GeoIP database.</li>\n<li>Improvement: Integrated blacklist blocking statistics into the dashboard for Premium users.</li>\n<li>Fix: Added locking to the automatic update process to ensure non-standard crons don&#8217;t break Wordfence.</li>\n<li>Fix: Fixed an activation error on multisite installations on very old WordPress versions.</li>\n<li>Fix: Adjusted the behavior of the blacklist toggle for Free users.</li>\n</ul>\n<h4>6.3.6</h4>\n<ul>\n<li>Improvement: Optimized the malware signature scan to reduce memory usage.</li>\n<li>Improvement: Optimized the overall scan to make fewer network calls.</li>\n<li>Improvement: Running an update now automatically dismisses the corresponding scan issue if present.</li>\n<li>Improvement: Added a time limit to the live activity status so only current messages are shown.</li>\n<li>Improvement: WAF configuration files are now excluded by default from the recently modified files list in the activity report.</li>\n<li>Improvement: Background pausing for live activity and traffic may now be disabled.</li>\n<li>Improvement: Added additional WAF support to allow us to more easily address false positives.</li>\n<li>Improvement: Blocking pages presented by Wordfence now indicate the source and contain information to help diagnose caching problems.</li>\n<li>Fix: All external URLs in the tour are now https.</li>\n<li>Fix: Corrected a typo in the unlock email template.</li>\n<li>Fix: Fixed the target of a label on the options page.</li>\n</ul>\n<h4>6.3.5</h4>\n<ul>\n<li>Improvement: Sites can now specify a list of trusted proxies when using X-Forwarded-For for IP resolution.</li>\n<li>Improvement: Added options to customize which dashboard notifications are shown.</li>\n<li>Improvement: Improvements to the scanner&#8217;s malware stage to avoid timing out on larger files.</li>\n<li>Improvement: Provided additional no-caching indicators for caches that erroneously save pages with HTTP error status codes.</li>\n<li>Improvement: Updated the bundled GeoIP database.</li>\n<li>Improvement: Optimized the country update process in the upgrade handler so it only updates changed records.</li>\n<li>Improvement: Added our own prefixed version of jQuery.DataTables to avoid conflicts with other plugins.</li>\n<li>Improvement: Changes to readme.txt and readme.md are now ignored by the scanner unless high sensitivity is on.</li>\n<li>Fix: Addressed an issue with multisite installations where they would execute the upgrade handler for each subsite.</li>\n<li>Fix: Added additional error handling to the blocked IP list to avoid outputting notices when another plugin resets the error handler.</li>\n<li>Fix: Made the description in the summary email for blocks resulting from the blacklist more descriptive.</li>\n<li>Fix: Updated the copyright date on several pages.</li>\n<li>Fix: Fixed incorrect wrapping of the Group by field on the live traffic page.</li>\n</ul>\n<h4>6.3.4</h4>\n<ul>\n<li>Improvement: Added a path for people blocked by the IP blacklist (Premium Feature) to report false positives.</li>\n</ul>\n<h4>6.3.3</h4>\n<ul>\n<li>New: Malicious IPs are now preemptively blocked by a regularly-updated blacklist. [Premium Feature]</li>\n<li>Improvement: Better layout and display for mobile screen sizes.</li>\n<li>Improvement: Dashboard chart data is now updated more frequently.</li>\n<li>Fix: Fixed database errors on notifications page on multisite installations.</li>\n<li>Fix: Fixed site URL detection for multisite installations.</li>\n<li>Fix: Fixed tour popup positioning on multisite.</li>\n<li>Fix: Increased the z-index of the AJAX error watcher alert.</li>\n<li>Fix: Addressed an additional way to enumerate authors with the REST JSON API.</li>\n</ul>\n<h4>6.3.2</h4>\n<ul>\n<li>Improvement: Improved the WAF&#8217;s ability to inspect POST bodies.</li>\n<li>Improvement: Dashboard now shows up to 100 each of failed/successful logins.</li>\n<li>Improvement: Updated internal GeoIP database.</li>\n<li>Improvement: Updated internal browscap database.</li>\n<li>Improvement: Better documentation on Country Blocking regarding Google AdWords</li>\n<li>Advanced: Added constant &#8220;WORDFENCE_DISABLE_FILE_VIEWER&#8221; to prohibit file-viewing actions from Wordfence.</li>\n<li>Advanced: Added constant &#8220;WORDFENCE_DISABLE_LIVE_TRAFFIC&#8221; to prohibit live traffic from capturing regular site visits.</li>\n<li>Fix: Fixed a few links that didn&#8217;t open the correct configuration pages.</li>\n<li>Fix: Unknown countries in the dashboard now show &#8220;Unknown&#8221; rather than empty.</li>\n</ul>\n<h4>6.3.1</h4>\n<ul>\n<li>Improvement: Locked out IPs are now enforced at the WAF level to reduce server load.</li>\n<li>Improvement: Added a &#8220;Show more&#8221; link to the IP block list and login attempts list.</li>\n<li>Improvement: Added network data for the top countries blocked list.</li>\n<li>Improvement: Added a notification when a premium key is installed on one site but registered for another URL.</li>\n<li>Improvement: Switching tabs in the various pages now updates the page title as well.</li>\n<li>Improvement: Various styling consistency improvements.</li>\n<li>Change: Separated the various blocking-related pages out from the Firewall top-level menu into &#8220;Blocking&#8221;.</li>\n<li>Fix: Improved compatibility with our GeoIP interface.</li>\n<li>Fix: The updates available notification is refreshed after updates are installed.</li>\n<li>Fix: The scan notification is refreshed when issues are resolved or ignored.</li>\n</ul>\n<h4>6.3.0</h4>\n<ul>\n<li>Enhancement: Added Wordfence Dashboard for quick overview of security activity.</li>\n<li>Improvement: Simplified the UI by revamping menu structure and styling.</li>\n<li>Fix: Fixed minor issue with REST API user enumeration blocking.</li>\n<li>Fix: Fixed undefined index notices on password audit page.</li>\n</ul>\n<h4>6.2.10</h4>\n<ul>\n<li>Improvement: Better reporting for failed brute force login attempts.</li>\n<li>Change: Reworded setting for ignored IPs in the WAF alert email.</li>\n<li>Change: Updated support link on scan page.</li>\n<li>Fix: When a key is in place on multiple sites, it&#8217;s now possible to downgrade the ones not registered for it.</li>\n<li>Fix: Addressed an issue where the increased attack rate emails would send repeatedly if the threshold value was missing.</li>\n<li>Fix: Typo fix in firewall rule 11 name.</li>\n</ul>\n<h4>6.2.9</h4>\n<ul>\n<li>Improvement: Updated internal GeoIP database.</li>\n<li>Improvement: Better error handling when a site is unreachable publicly.</li>\n<li>Fix: Fixed a URL in alert emails that did not correctly detect when sent from a multisite installation.</li>\n<li>Fix: Addressed an issue where the scan did not alert about a new WordPress version.</li>\n</ul>\n<h4>6.2.8</h4>\n<ul>\n<li>Improvement: Added support for hiding the username information revealed by the WordPress 4.7 REST API. Thanks Vladimir Smitka.</li>\n<li>Improvement: Added vulnerability scanning for themes.</li>\n<li>Improvement: Reduced memory usage by up to 90% when scanning comments.</li>\n<li>Improvement: Performance improvements for the dashboard widget.</li>\n<li>Improvement: Added progressive loading of addresses on the blocked IP list.</li>\n<li>Improvement: The diagnostics page now displays a config reading/writing test.</li>\n<li>Change: Support for the Falcon cache has been removed.</li>\n<li>Fix: Better messaging when the WAF rules are manually updated.</li>\n<li>Fix: The proxy detection check frequency has been reduced and no longer alerts if the server is unreachable.</li>\n<li>Fix: Adjusted the behavior of parsing the X-Forwarded-For header for better accuracy. Thanks Jason Woods.</li>\n<li>Fix: Typo fix on the options page.</li>\n<li>Fix: Scan issue for known core file now shows the correct links.</li>\n<li>Fix: Links in &#8220;unlock&#8221; emails now work for IPv6 and IPv4-mapped-IPv6 addresses.</li>\n<li>Fix: Restricted caching of responses from the Wordfence Security Network.</li>\n<li>Fix: Fixed a recording issue with Wordfence Security Network statistics.</li>\n</ul>\n<h4>6.2.7</h4>\n<ul>\n<li>Improvement: WordPress 4.7 improvements for the Web Application Firewall.</li>\n<li>Improvement: Updated signatures for hash-based malware detection.</li>\n<li>Improvement: Automatically attempt to detect when a site is behind a proxy and has IP information in a different field.</li>\n<li>Improvement: Added additional contextual help links.</li>\n<li>Improvement: Significant performance improvement for determining the connecting IP.</li>\n<li>Improvement: Better messaging for two-factor recovery codes.</li>\n<li>Fix: Adjusted message when trying to block an IP in the whitelist.</li>\n<li>Fix: Error log download links now work on Windows servers.</li>\n<li>Fix: Avoid running out of memory when viewing very large activity logs.</li>\n<li>Fix: Fixed warning that could be logged when following an unlock email link.</li>\n<li>Fix: Tour popups on options page now scroll into view correctly.</li>\n</ul>\n<h4>6.2.6</h4>\n<ul>\n<li>Improvement: Improved formatting of attack data when it contains binary characters.</li>\n<li>Improvement: Updated internal GeoIP database.</li>\n<li>Improvement: Improved the ordering of rules in the malware scan so more specific rules are checked first.</li>\n<li>Fix: Country blocking redirects are no longer allowed to be cached.</li>\n<li>Fix: Fixed an issue with 2FA on multisite where the site could report URLs with different schemes depending on the state of plugin loading.</li>\n</ul>\n<h4>6.2.5</h4>\n<ul>\n<li>Fix: Fixed an issue that could occur on older WordPress versions when processing login attempts</li>\n</ul>\n<h4>6.2.4</h4>\n<ul>\n<li>Improvement: Scan times for very large sites with huge numbers of files are greatly improved.</li>\n<li>Improvement: Added a configurable time limit for scans to help reduce overall server load and identify configuration problems.</li>\n<li>Improvement: Email-based logins are now covered by &#8220;Don&#8217;t let WordPress reveal valid users in login errors&#8221;.</li>\n<li>Improvement: Extended rate limiting support to the login page.</li>\n<li>Fix: Fixed a case where files in the site root with issues could have them added multiple times.</li>\n<li>Fix: Improved IP detection in the WAF when using an IP detection method that can have multiple values.</li>\n<li>Fix: Added a safety check for when the database fails to return its max_allowed_packet value.</li>\n<li>Fix: Added safety checks for when the configuration table migration has failed.</li>\n<li>Fix: Added a couple rare failed login error codes to brute force detection.</li>\n<li>Fix: Fixed a sequencing problem when adding detection for bot/human that led to it being called on every request.</li>\n<li>Fix: Suppressed errors if a file is removed between the start of a scan and later scan stages.</li>\n<li>Fix: Addressed a problem where the scan exclusions list was not checked correctly in some situations.</li>\n</ul>\n<h4>6.2.3</h4>\n<ul>\n<li>Improvement: Reworked blocking for IP ranges, country blocking, and direct IP blocking to minimize server impact when under attack.</li>\n<li>Improvement: Live traffic better indicates the action taken by country blocking when it redirects a visitor.</li>\n<li>Improvement: Added support for finding server logs to the Diagnostics page to help with troubleshooting.</li>\n<li>Improvement: Whitelisted StatusCake IP addresses.</li>\n<li>Improvement: Updated GeoIP database.</li>\n<li>Improvement: Disabling Wordfence now sends an alert.</li>\n<li>Improvement: Improved detection for uploaded PHP content in the firewall.</li>\n<li>Fix: Eliminated memory-related errors resulting from the scan on sites with very large numbers of issues and low memory.</li>\n<li>Fix: Fixed admin page layout for sites using RTL languages.</li>\n<li>Fix: Reduced overhead of the dashboard widget.</li>\n<li>Fix: Improved performance of checking for whitelisted IPs.</li>\n<li>Fix: Changes to the default plugin hello.php are now detected correctly in scans.</li>\n<li>Fix: Fixed IPv6 warning in the dashboard widget.</li>\n</ul>\n<h4>6.2.2</h4>\n<ul>\n<li>Fix: Replaced a slow query in the dashboard widget that could affect sites with very large numbers of users.</li>\n</ul>\n<h4>6.2.1</h4>\n<ul>\n<li>Improvement: Now performing scanning for PHP code in all uploaded files in real-time.</li>\n<li>Improvement: Improved handling of bad characters and IPv6 ranges in Advanced Blocking.</li>\n<li>Improvement: Live traffic and scanning activity now display a paused notice when real-time updates are suspended while in the background.</li>\n<li>Improvement: The file system scan alerts for files flagged by antivirus software with a &#8216;.suspected&#8217; extension.</li>\n<li>Improvement: New alert option to get notified only when logins are from a new location/device.</li>\n<li>Change: First phase for removing the Falcon cache in place, which will add a notice of its pending removal.</li>\n<li>Fix: Included country flags for Kosovo and Curaçao.</li>\n<li>Fix: Fixed the .htaccess directives used to hide files found by the scanner.</li>\n<li>Fix: Dashboard widget shows correct status for failed logins by deleted users.</li>\n<li>Fix: Removed duplicate issues for modified files in the scan results.</li>\n<li>Fix: Suppressed warning from reverse lookup on IPv6 addresses without valid DNS records.</li>\n<li>Fix: Fixed file inclusion error with themes lacking a 404 page.</li>\n<li>Fix: CSS fixes for activity report email.</li>\n</ul>\n<h4>6.2.0</h4>\n<ul>\n<li>Improvement: Massive performance boost in file system scan.</li>\n<li>Improvement: Added low resource usage scan option for shared hosts.</li>\n<li>Improvement: Aggregated login attempts when checking the Wordfence Security Network for brute force attackers to reduce total requests.</li>\n<li>Improvement: Now displaying scan time in a more readable format rather than total seconds.</li>\n<li>Improvement: Added PHP7 compatible .htaccess directives to disable code execution within uploads directory.</li>\n<li>Fix: Added throttling to sync the WAF attack data.</li>\n<li>Fix: Removed unnecessary single quote in copy containing &#8220;IP&#8217;s&#8221;.</li>\n<li>Fix: Fixed rare, edge case where cron key does not match the key in the database.</li>\n<li>Fix: Fixed bug with regex matching carriage returns in the .htaccess based IP block list.</li>\n<li>Fix: Fixed scans failing in subdirectory sites when updating malware signatures.</li>\n<li>Fix: Fixed infinite loop in scan caused by symlinks.</li>\n<li>Fix: Remove extra slash from &#8220;File restored OK&#8221; message in scan results.</li>\n</ul>\n<h4>6.1.17</h4>\n<ul>\n<li>Fix: Replaced calls to json_decode with our own implentation for hosts without the JSON extension enabled.</li>\n</ul>\n<h4>6.1.16</h4>\n<ul>\n<li>Improvement: Now performing malware scanning on all uploaded files in real-time.</li>\n<li>Improvement: Added Web Application Firewall activity to Wordfence summary email.</li>\n<li>Fix: Now using 503 response code in the page displayed when an IP is locked out.</li>\n<li>Fix: <code>wflogs</code> directory is now correctly removed on uninstall.</li>\n<li>Fix: Fixed recently introduced bug which caused the Whitelisted 404 URLs feature to no longer work.</li>\n<li>Fix: Added try/catch to uncaught exception thrown when pinging the API key.</li>\n<li>Improvement: Improved performance of the Live Traffic page in Firefox.</li>\n<li>Improvement: Updated GeoIP database.</li>\n</ul>\n<h4>6.1.15</h4>\n<ul>\n<li>Improvement: Removed file-based config caching, added support for caching via WordPress&#8217;s object cache.</li>\n<li>Improvement: Whitelisted Uptime Robot&#8217;s IP range.</li>\n<li>Fix: Notify users if suPHP_ConfigPath is in their WAF setup, and prompt to update Extended Protection.</li>\n<li>Fix: Fixed bug with allowing logins on admin accounts that are not fully activated with invalid 2FA codes when 2FA is required for all admins.</li>\n<li>Fix: Removed usage of <code>wp_get_sites()</code> which was deprecated in WordPress 4.6.</li>\n<li>Fix: Fixed PHP notice from <code>Undefined index: url</code> with custom/premium plugins.</li>\n<li>Improvement: Converted the banned URLs input to a textarea.</li>\n</ul>\n<h4>6.1.14</h4>\n<ul>\n<li>Improvement: Support downloading a file of 2FA recovery codes.</li>\n<li>Fix: Fixed PHP Notice: Undefined index: coreUnknown during scans.</li>\n<li>Improvement: Add note to options page that login security is necessary for 2FA to work.</li>\n<li>Fix: Fixed WAF false positives introduced with WordPress 4.6.</li>\n<li>Improvement: Update Geo IP database.</li>\n</ul>\n<h4>6.1.12</h4>\n<ul>\n<li>Fix: Fixed fatal error on sites running Wordfence 6.1.11 in subdirectory and 6.1.10 or lower in parent directory.</li>\n<li>Fix: Added a few common files to be excluded from unknown WordPress core file scan.</li>\n</ul>\n<h4>6.1.11</h4>\n<ul>\n<li>Improvement: Alert on added files to wp-admin, wp-includes.</li>\n<li>Improvement: 2FA is now available via any authenticator program that accepts TOTP secrets.</li>\n<li>Fix: Fixed bug with specific Advanced Blocking user-agent patterns causing 500 errors.</li>\n<li>Improvement: Plugin updates are now only a critical issue if there is a security related fix, and a warning otherwise. A link to the changelog is included.</li>\n<li>Fix: Added group writable permissions to Firewall&#8217;s configuration files.</li>\n<li>Improvement: Changed whitelist entry area to textbox on options page.</li>\n<li>Fix: Move flags and logo served from wordfence.com over to locally hosted files.</li>\n<li>Fix: Fixed issues with scan in WordPress 4.6 beta.</li>\n<li>Fix: Fixed bug where Firewall rules could be missing on some sites running IIS.</li>\n<li>Improvement: Added browser-based malware signatures for .js, .html files in the malware scan.</li>\n<li>Fix: Added error suppression to <code>dns_get_record</code>.</li>\n</ul>\n<h4>6.1.10</h4>\n<ul>\n<li>Fix: Fixed fatal error in the event wflogs is not writable.</li>\n</ul>\n<h4>6.1.9</h4>\n<ul>\n<li>Fix: Using WP-CLI causes error Undefined index: SERVER_NAME.</li>\n<li>Improvement: Hooked up restore/delete file scan tools to Filesystem API.</li>\n<li>Fix: Reworked country blocking authentication check for access to XMLRPC.</li>\n<li>Improvement: Added option to require cellphone sign-in on all admin accounts.</li>\n<li>Improvement: Updated IPv6 GeoIP lite data.</li>\n<li>Fix: Removed suPHP_ConfigPath from WAF installation process.</li>\n<li>Fix: Prevent author names from being found through /wp-json/oembed.</li>\n<li>Improvement: Added better solutions for fixing wordfence-waf.php, .user.ini, or .htaccess in scan.</li>\n<li>Improvement: Added a method to view which files are currently used for WAF and to remove without reinstalling Wordfence.</li>\n<li>Improvement: Changed rule compilation to use atomic writes.</li>\n<li>Improvement: Removed security levels from Options page.</li>\n<li>Improvement: Added option to disable ajaxwatcher (for whitelisting only for Admins) on the front end.</li>\n</ul>\n<h4>6.1.8</h4>\n<ul>\n<li>Fix: Change wfConfig::set_ser to split large objects into multiple queries.</li>\n<li>Fix: Fixed bug in multisite with &#8220;You do not have sufficient permissions to access this page&#8221; error after logging in.</li>\n<li>Improvement: Update Geo IP database.</li>\n<li>Fix: Fixed deadlock when NFS is used for WAF file storage, in wfWAFAttackDataStorageFileEngine::addRow().</li>\n<li>Fix: Added third param to http_build_query for hosts with arg_separator.output set.</li>\n<li>Improvement: Show admin notice if WAF blocks an admin (mainly needed for ajax requests).</li>\n<li>Improvement: Clarify error message &#8220;Error reading config data, configuration file could be corrupted.&#8221;</li>\n<li>Improvement: Added better crawler detection.</li>\n<li>Improvement: Add currentUserIsNot(&#8216;administrator&#8217;) to any generic firewall rules that are not XSS based.</li>\n<li>Improvement: Update URLs in Wordfence for documentation about LiteSpeed and lockouts.</li>\n<li>Improvement: Show message on scan results when a result is caused by enabling &#8220;Scan images and binary files as if they were executable&#8221; or&#8230;</li>\n<li>Fix: Suppressed warning: dns_get_record(): DNS Query failed.</li>\n<li>Fix: Suppressed warning gzinflate() error in scan logs.</li>\n<li>Fix: On WAF roadblock page: Warning: urlencode() expects parameter 1 to be string, array given &#8230;</li>\n<li>Fix: Scheduled update for WAF rules doesn&#8217;t decrease from 7 days, to 12 hours, when upgrading to a premium account.</li>\n<li>Improvement: Better message for dashboard widget when no failed logins.</li>\n</ul>\n<h4>6.1.7</h4>\n<ul>\n<li>Security Fix: Fixed reflected XSS vulnerability: CVSS 6.1 (Medium). Thanks Kacper Szurek.</li>\n</ul>\n<h4>6.1.6</h4>\n<ul>\n<li>Fix: Fixed bug with 2FA not properly handling email address login.</li>\n<li>Fix: Show logins/logouts when Live Traffic is disabled.</li>\n<li>Fix: Fixed bug with PCRE versions &lt; 7.0 (repeated subpattern is too long).</li>\n<li>Fix: Now able to delete whitelisted URL/params containing ampersands and non-UTF8 characters.</li>\n<li>Improvement: Reduced 2FA activation code to expire after 30 days.</li>\n<li>Improvement: Live Traffic now only shows verified Googlebot under Google Crawler filter for new visits.</li>\n<li>Improvement: Adjusted permissions on Firewall log/config files to be 0640.</li>\n<li>Fix: Fixed false positive from Maldet in the wfConfig table during the scan.</li>\n</ul>\n<h4>6.1.5</h4>\n<ul>\n<li>Fix: WordPress language files no longer flagged as changed.</li>\n<li>Improvement: Accept wildcards in &#8220;Immediately block IP&#8217;s that access these URLs.&#8221;</li>\n<li>Fix: Fixed bug when multiple authors have published posts, /?author=N scans show an author archive page.</li>\n<li>Fix: Fixed issue with IPv6 mapped IPv4 addresses not being treated as IPv4.</li>\n<li>Improvement: Added WordPress version and various constants to Diagnostics report.</li>\n<li>Fix: Fixed bug with Windows users unable to save Firewall config.</li>\n<li>Improvement: Include option for IIS on Windows in Firewall config process, and recommend manual php.ini change only.</li>\n<li>Fix: Made the &#8216;administrator email address&#8217; admin notice dismissable.</li>\n</ul>\n<h4>6.1.4</h4>\n<ul>\n<li>Fix: Fixed potential bug with &#8216;stored data not found after a fork. Got type: boolean&#8217;.</li>\n<li>Improvement: Added bulk actions and filters to WAF whitelist table.</li>\n<li>Improvement: Added a check while in learning mode to verify the response is not 404 before whitelising.</li>\n<li>Fix: Added index to attackLogTime. wfHits trimmed on runInstall now.</li>\n<li>Fix: Fixed attack data sync for hosts that cannot use wp-cron.</li>\n<li>Improvement: Use wftest@wordfence.com as the Diagnostics page default email address.</li>\n<li>Improvement: When WFWAF_ENABLED is set to false to disable the firewall, show this on the Firewall page.</li>\n<li>Fix: Prevent warnings when $_SERVER is empty.</li>\n<li>Fix: Bug fix for illegal string offset.</li>\n<li>Fix: Hooked up multibyte string functions to binary safe equivalents.</li>\n<li>Fix: Hooked up reverse IP lookup in Live Traffic.</li>\n<li>Fix: Add the user the web server (or PHP) is currently running as to Diagnostics page.</li>\n<li>Improvement: Pause Live Traffic after scrolling past the first entry.</li>\n<li>Improvement: Move &#8220;Permanently block all temporarily blocked IP addresses&#8221; button to top of blocked IP list.</li>\n<li>Fix: Added JSON fallback for PHP installations that don&#8217;t have JSON enabled.</li>\n</ul>\n<h4>6.1.3</h4>\n<ul>\n<li>Improvement: Added dismiss button to the Wordfence WAF setup admin notice.</li>\n<li>Fix: Removed .htaccess and .user.ini from publicly accessible config and backup file scan.</li>\n<li>Fix: Removed the disallow file mods for admins created outside of WordPress.</li>\n<li>Fix: Fixed bug with &#8216;Hide WordPress version&#8217; causing issues with reCAPTCHA.</li>\n<li>Improvement: Added instructions for NGINX users to restrict access to .user.ini during Firewall configuration.</li>\n<li>Fix: Fixed bug with multiple API calls to &#8216;get_known_files&#8217;.</li>\n</ul>\n<h4>6.1.2</h4>\n<ul>\n<li>Fix: Fixed fatal error when using a whitelisted IPv6 range and connecting with an IPv6 address.</li>\n</ul>\n<h4>6.1.1</h4>\n<ul>\n<li>Enhancement: Added Web Application Firewall</li>\n<li>Enhancement: Added Diagnostics page</li>\n<li>Enhancement: Added new scans:\n<ul>\n<li>Admins created outside of WordPress</li>\n<li>Publicly accessible common (database or wp-config.php) backup files</li>\n</ul>\n</li>\n<li>Improvement: Updated Live Traffic with filters and to include blocked requests in the feed.</li>\n</ul>\n<p>You can find a <a href=\"https://www.wordfence.com/help/advanced/changelog/\" rel=\"nofollow\">complete changelog</a> on our documentation site.</p>\n\";s:11:\"screenshots\";s:3410:\"<ol><li><a href=\"https://ps.w.org/wordfence/assets/screenshot-1.png?rev=1808795\"><img src=\"https://ps.w.org/wordfence/assets/screenshot-1.png?rev=1808795\" alt=\"The dashboard gives you an overview of your site&#039;s security including notifications, attack statistics and Wordfence feature status.\"></a><p>The dashboard gives you an overview of your site\'s security including notifications, attack statistics and Wordfence feature status.</p></li><li><a href=\"https://ps.w.org/wordfence/assets/screenshot-2.png?rev=1808795\"><img src=\"https://ps.w.org/wordfence/assets/screenshot-2.png?rev=1808795\" alt=\"The firewall protects your site from common types of attacks and known security vulnerabilities.\"></a><p>The firewall protects your site from common types of attacks and known security vulnerabilities.</p></li><li><a href=\"https://ps.w.org/wordfence/assets/screenshot-3.png?rev=1808795\"><img src=\"https://ps.w.org/wordfence/assets/screenshot-3.png?rev=1808795\" alt=\"The Wordfence Security Scanner lets you know if your site has been compromised and alerts you to other security issues that need to be addressed.\"></a><p>The Wordfence Security Scanner lets you know if your site has been compromised and alerts you to other security issues that need to be addressed.</p></li><li><a href=\"https://ps.w.org/wordfence/assets/screenshot-4.png?rev=1808795\"><img src=\"https://ps.w.org/wordfence/assets/screenshot-4.png?rev=1808795\" alt=\"Wordfence is highly configurable, with a deep set of options available for each feature. High level scan options are shown above.\"></a><p>Wordfence is highly configurable, with a deep set of options available for each feature. High level scan options are shown above.</p></li><li><a href=\"https://ps.w.org/wordfence/assets/screenshot-5.png?rev=1808795\"><img src=\"https://ps.w.org/wordfence/assets/screenshot-5.png?rev=1808795\" alt=\"Brute Force Protection features protect you from password guessing attacks.\"></a><p>Brute Force Protection features protect you from password guessing attacks.</p></li><li><a href=\"https://ps.w.org/wordfence/assets/screenshot-6.png?rev=1808795\"><img src=\"https://ps.w.org/wordfence/assets/screenshot-6.png?rev=1808795\" alt=\"Block attackers by IP, Country, IP range, Hostname, Browser or Referrer.\"></a><p>Block attackers by IP, Country, IP range, Hostname, Browser or Referrer.</p></li><li><a href=\"https://ps.w.org/wordfence/assets/screenshot-7.png?rev=1808795\"><img src=\"https://ps.w.org/wordfence/assets/screenshot-7.png?rev=1808795\" alt=\"The Wordfence Live Traffic view shows you real-time activity on your site including bot traffic and exploit attempts.\"></a><p>The Wordfence Live Traffic view shows you real-time activity on your site including bot traffic and exploit attempts.</p></li><li><a href=\"https://ps.w.org/wordfence/assets/screenshot-8.png?rev=1808795\"><img src=\"https://ps.w.org/wordfence/assets/screenshot-8.png?rev=1808795\" alt=\"Take login security to the next level with Two Factor Authentication.\"></a><p>Take login security to the next level with Two Factor Authentication.</p></li><li><a href=\"https://ps.w.org/wordfence/assets/screenshot-9.png?rev=1808795\"><img src=\"https://ps.w.org/wordfence/assets/screenshot-9.png?rev=1808795\" alt=\"Audit the strength of your site passwords with our high performance GPU cluster.\"></a><p>Audit the strength of your site passwords with our high performance GPU cluster.</p></li></ol>\";}s:17:\"short_description\";s:158:\"Asegura tu web con el plugin de seguridad WordPress más completo. Cortafuegos, escaneo de malware, bloqueos, tráfico en directo, seguridad de acceso y más.\";s:13:\"download_link\";s:58:\"https://downloads.wordpress.org/plugin/wordfence.7.0.4.zip\";s:11:\"screenshots\";a:9:{i:1;a:2:{s:3:\"src\";s:62:\"https://ps.w.org/wordfence/assets/screenshot-1.png?rev=1808795\";s:7:\"caption\";s:132:\"The dashboard gives you an overview of your site\'s security including notifications, attack statistics and Wordfence feature status.\";}i:2;a:2:{s:3:\"src\";s:62:\"https://ps.w.org/wordfence/assets/screenshot-2.png?rev=1808795\";s:7:\"caption\";s:96:\"The firewall protects your site from common types of attacks and known security vulnerabilities.\";}i:3;a:2:{s:3:\"src\";s:62:\"https://ps.w.org/wordfence/assets/screenshot-3.png?rev=1808795\";s:7:\"caption\";s:145:\"The Wordfence Security Scanner lets you know if your site has been compromised and alerts you to other security issues that need to be addressed.\";}i:4;a:2:{s:3:\"src\";s:62:\"https://ps.w.org/wordfence/assets/screenshot-4.png?rev=1808795\";s:7:\"caption\";s:129:\"Wordfence is highly configurable, with a deep set of options available for each feature. High level scan options are shown above.\";}i:5;a:2:{s:3:\"src\";s:62:\"https://ps.w.org/wordfence/assets/screenshot-5.png?rev=1808795\";s:7:\"caption\";s:75:\"Brute Force Protection features protect you from password guessing attacks.\";}i:6;a:2:{s:3:\"src\";s:62:\"https://ps.w.org/wordfence/assets/screenshot-6.png?rev=1808795\";s:7:\"caption\";s:72:\"Block attackers by IP, Country, IP range, Hostname, Browser or Referrer.\";}i:7;a:2:{s:3:\"src\";s:62:\"https://ps.w.org/wordfence/assets/screenshot-7.png?rev=1808795\";s:7:\"caption\";s:117:\"The Wordfence Live Traffic view shows you real-time activity on your site including bot traffic and exploit attempts.\";}i:8;a:2:{s:3:\"src\";s:62:\"https://ps.w.org/wordfence/assets/screenshot-8.png?rev=1808795\";s:7:\"caption\";s:69:\"Take login security to the next level with Two Factor Authentication.\";}i:9;a:2:{s:3:\"src\";s:62:\"https://ps.w.org/wordfence/assets/screenshot-9.png?rev=1808795\";s:7:\"caption\";s:80:\"Audit the strength of your site passwords with our high performance GPU cluster.\";}}s:4:\"tags\";a:5:{s:9:\"antivirus\";s:9:\"antivirus\";s:8:\"firewall\";s:8:\"firewall\";s:15:\"malware-scanner\";s:15:\"malware scanner\";s:8:\"security\";s:8:\"security\";s:24:\"web-application-firewall\";s:24:\"web application firewall\";}s:8:\"versions\";a:201:{s:3:\"1.1\";s:56:\"https://downloads.wordpress.org/plugin/wordfence.1.1.zip\";s:3:\"1.2\";s:56:\"https://downloads.wordpress.org/plugin/wordfence.1.2.zip\";s:3:\"1.3\";s:56:\"https://downloads.wordpress.org/plugin/wordfence.1.3.zip\";s:5:\"1.3.1\";s:58:\"https://downloads.wordpress.org/plugin/wordfence.1.3.1.zip\";s:5:\"1.3.2\";s:58:\"https://downloads.wordpress.org/plugin/wordfence.1.3.2.zip\";s:5:\"1.3.3\";s:58:\"https://downloads.wordpress.org/plugin/wordfence.1.3.3.zip\";s:5:\"1.4.2\";s:58:\"https://downloads.wordpress.org/plugin/wordfence.1.4.2