(15849, '_site_transient_loopia_plugin_api_wp-super-cache', 'O:8:\"stdClass\":27:{s:4:\"name\";s:14:\"WP Super Cache\";s:4:\"slug\";s:14:\"wp-super-cache\";s:7:\"version\";s:5:\"1.5.9\";s:6:\"author\";s:48:\"<a href=\"https://automattic.com/\">Automattic</a>\";s:14:\"author_profile\";s:41:\"https://profiles.wordpress.org/automattic\";s:8:\"requires\";s:3:\"3.0\";s:6:\"tested\";s:5:\"4.9.4\";s:12:\"requires_php\";s:5:\"5.2.4\";s:6:\"rating\";d:86;s:7:\"ratings\";a:5:{i:5;i:1000;i:4;i:107;i:3;i:49;i:2;i:23;i:1;i:161;}s:11:\"num_ratings\";i:1340;s:15:\"support_threads\";i:82;s:24:\"support_threads_resolved\";i:5;s:15:\"active_installs\";i:1000000;s:10:\"downloaded\";i:20205280;s:12:\"last_updated\";s:21:\"2017-12-15 4:50pm GMT\";s:5:\"added\";s:10:\"2007-11-05\";s:8:\"homepage\";s:45:\"https://wordpress.org/plugins/wp-super-cache/\";s:8:\"sections\";a:4:{s:11:\"description\";s:20276:\"<p>Este plugin crea archivos html estáticos de tu sitio WordPress dinámico. Una vez se haya creado el archivo html tu servidor servirá ese archivo en vez de procesar los scripts PHP de WordPress, en comparación mucho más pesados y consumidores de recursos. </p>\n<p>Los archivos estáticos html se servirán a la gran mayoría de sus usuarios:</p>\n<ul>\n<li>Usuarios que no están conectados.</li>\n<li>Usuarios que no han comentado en tu sitio.</li>\n<li>O usuarios que no han visto una entrada protegida por contraseña.</li>\n</ul>\n<p>El 99% de tus visitantes recibirán archivos html estáticos. Un archivo en caché se puede servir miles de veces. Otros visitantes recibirán archivos en caché personalizados a la medida de su visita. Si están conectados, o han dejado comentarios, esa información se mostrará y almacenará en caché para ellos.</p>\n<p>El plugin sirve los archivos en caché en 3 maneras (ordenados por velocidad):</p>\n<ol>\n<li>Experto. El modo más rápido es usar el módulo de Apache mod_rewrite (o cualquier módulo similar que tenga tu servidor web) para servir archivos html estáticos &#8220;supercacheados&#8221;. Esto omite completamente PHP y es extremadamente rápido. Si tu servidor recibe un aluvión de tráfico le será más fácil afrontarlo ya que las peticiones son más &#8220;livianas&#8221;. Esto requiere el módulo de Apache mod_rewrite (que seguramente esté instalado si tienes enlaces permanentes personalizados) y una modificaci´n de tu archivo .htaccess. Las visitas a los usuarios anónimos o desconocidos se sirven de este modo. </li>\n<li>Fácil. Los archivos estáticos supercacheados pueden servirse por PHP y esta es la forma recomendada de usar el plugin. El plugin servirá un archivo &#8220;supercacheado&#8221; si existe y es casi tan rápido como el método mod_rewrite. Es más fácil de configurar ya que no necesita cambiar el archivo .htaccess. Sin embargo necesita un enlace permanente personalizado. Puedes mantener partes de tu página dinámica en este modo de almacenamiento en caché.</li>\n<li>Caché de WP-Cache. Esto se usa principalmente para almacenar en caché las páginas para usuarios conocidos, URL con parámetros y feeds. Los usuarios conocidos son usuarios registrados, visitantes que dejan comentarios o aquellos a quienes deben mostrarse datos personalizados por usuario. Es el método de almacenamiento en caché más flexible y un poco más lento. El almacenamiento en memoria caché de WP-Cache también almacenará en caché las visitas de usuarios desconocidos si supercache está desactivado. Puedes tener partes dinámicas en tu página en este modo también. Este modo siempre está activado pero puedes desactivar el almacenamiento en caché para usuarios conocidos, URL con parámetros o feeds por separado. Establece la constante &#8220;DISABLE_SUPERCACHE&#8221; en 1 en tu wp-config.php si solo deseas usar el almacenamiento en caché de WP-Cache.</li>\n</ol>\n<p>Si no te sientes cómodo editando archivos PHP, utiliza el modo fácil. Es fácil y muy rápido de configurar.</p>\n<h3>Ajustes recomendados</h3>\n<ol>\n<li>Almacenamiento en caché fácil.</li>\n<li>Comprimir páginas.</li>\n<li>No cachear páginas a los usuarios conocidos.</li>\n<li>Reconstrucción de caché.</li>\n<li>Compatibilidad con CDN.</li>\n<li>Comprobaciones adicionales de portada.</li>\n</ol>\n<p>La recogida de basura es el acto de limpiar los archivos de caché que están desactualizados y obsoletos. No hay un valor correcto para el tiempo de caducidad, pero un buen punto de inicio es 1800 segundos.</p>\n<p>Considera eliminar el contenido de la caja de texto &#8220;Agentes de usuario rechazados&#8221; y permite que los motores de búsqueda guarden los archivos en caché para tí.</p>\n<p>A ser posible precarga tantas entradas como puedas y activa el &#8220;Modo de precarga&#8221;. La recogida de residuos todavía funcionará pero no afectará a los archivos precargados. Si no te importa que los widgets de barra lateral no se actualicen muy a menudo pon el intervalo de precarga a 2880 minutos (2 días) para que tus entradas no se vuelvan a cachear muy a menudo. Cuando se realiza la precarga los archivos en caché de la entrada se actualizan y se borran, y luego se regeneran. Después se realiza una recogida de residuos de todos los archivos antiguos para limpiar los archivos en caché anticuados.<br />\nCon la precarga de archivos de caché se siguen borrando cuando creas o editas entradas o cuando se hacen comentarios.</p>\n<h3>Development</h3>\n<ul>\n<li>Active development of this plugin is handled <a href=\"https://github.com/Automattic/wp-super-cache\" rel=\"nofollow\">on GitHub</a>.</li>\n<li>Translation of the plugin into different languages is on the <a href=\"https://translate.wordpress.org/projects/wp-plugins/wp-super-cache\" rel=\"nofollow\">translation page</a>.</li>\n</ul>\n<h3>Documentation</h3>\n<p>If you need more information than the following, you can have a look at the <a href=\"https://odd.blog/wp-super-cache-developers/\" rel=\"nofollow\">Developer documentation</a>.</p>\n<h4>Precarga</h4>\n<p>Puedes generar archivos almacenados en caché para las publicaciones, categorías y etiquetas de tu sitio mediante precarga. La precarga visitará cada página de tu sitio y generará una página en caché a medida que avance, al igual que cualquier otro visitante del sitio. Debido a la naturaleza secuencial de esta función, precargar un sitio completo puede llevar algún tiempo si hay muchas publicaciones.<br />\nPara que la precarga sea más efectiva, puede ser útil desactivar la recogida de basura para que no se eliminen los archivos de caché más antiguos. Esto se hace activando el &#8220;Modo de precarga&#8221; en los ajustes. Ten en cuenta, sin embargo, que las páginas quedarán desactualizadas eventualmente, pero que las actualizaciones al enviar comentarios o editar publicaciones borrarán partes de la caché.</p>\n<h4>Recogida de basura</h4>\n<p>El directorio de caché se llena con el tiempo, y eso ocupa espacio en el servidor. Si el espacio es limitado o te pasa factura o si te preocupa que las páginas en caché se vuelvan obsoletas, entonces debes realizarse la recogida de basura. La recolección de basura se hace regularmente y borra archivos viejos en el directorio de caché. En la página de ajustes avanzados puedes especificar:<br />\n1. Tiempo de caducidad. Cuánto tiempo se consideran válidos los archivos de caché. Después de este tiempo, están obsoletos y se pueden eliminar.<br />\n2. Programador. Configura la frecuencia con la que se debe realizar la recogida de basura.<br />\n3. Mensajes de notificación por correo electrónico. Puedes recibir información sobre la evolución del proceso de recogida de basura. No hay configuraciones correctas o incorrectas para la recolección de basura. Depende de tu propio sitio.<br />\nSi tu sitio recibe actualizaciones periódicas o comentarios, establece el tiempo de caducidad en 1800 segundos y configura el temporizador en 600 segundos.<br />\nSi tu sitio es principalmente estático, puedes desactivar la recogida de basura escribiendo 0 como tiempo de caducidad o usando un valor de tiempo de caducidad francamente grande.</p>\n<p>El directorio de caché, generalmente wp-content/cache/ es solo para archivos temporales. Nunca coloques en ese directorio archivos importantes o enlaces simbólicos a archivos o directorios importantes. Se eliminarán si el plugin tiene acceso de escritura a ellos.</p>\n<h4>CDN</h4>\n<p>Una red de distribución de contenido (CDN) generalmente es una red de computadoras ubicadas en todo el mundo que sirven el contenido del sitio web más rápidamente mediante el uso de servidores cercanos a tí. Los archivos estáticos como imágenes, Javascript y CSS se pueden servir a través de estas redes para acelerar la carga del sitio. También puedes crear una &#8220;CDN de pobre&#8221; utilizando un subdominio de tu dominio para servir archivos estáticos.</p>\n<p><a href=\"https://wordpress.org/plugins/ossdl-cdn-off-linker/\">OSSDL CDN off-linker</a> se ha integrado en WP Super Cache para proporcionar compatibilidad básica con CDN. Funciona reescribiendo las URLs de los archivos (excepto los archivos.php) en wp-content y wp-includes de tu servidor, por lo que apuntan a un hostname diferente. Muchos CDN admiten <a href=\"https://www.google.com/search?hl=en&amp;q=%22origin+pull%22\" rel=\"nofollow\">extracción de origen</a>. Esto significa que el CDN descargará el archivo automáticamente de tu servidor cuando se le solicite por primera vez, y lo continuará sirviendo durante un período de tiempo configurable antes de volver a descargarlo de tu servidor.</p>\n<p>Configura esto en la pestaña &#8220;CDN&#8221; de la página de ajustes del plugin. Esta es una técnica avanzada y requiere una comprensión básica de cómo funciona tu servidor web o CDN. Asegúrate de borrar los archivos en caché después de configurar el CDN.</p>\n<h4>REST API</h4>\n<p>Ahora hay endpoints en la REST API para acceder a la configuración de este plugin. Deberá ser autenticado como usuario administrador con permiso para ver la página de configuración y poder usarla. Esto aún no se ha documentado, pero puede encontrar todo el código de esto en el directorio &#8220;rest&#8221;.</p>\n<h4>Caché personalizada</h4>\n<p>Ahora es posible conectar el proceso de almacenamiento en caché utilizando la función add_cacheaction().</p>\n<p>Hay tres ganchos disponibles:</p>\n<ol>\n<li>&#8216;wp_cache_get_cookies_values&#8217; &#8211; modifica la clave utilizada por WP Cache.</li>\n<li>&#8216;add_cacheaction&#8217; &#8211; se ejecuta en fase2. Permite que un plugin agregue ganchos de WordPress.</li>\n<li>&#8216;cache_admin_page&#8217; &#8211; se ejecuta en la página de administración. Úsalo para modificar esa página, quizás agregando nuevas opciones de configuración.</li>\n</ol>\n<p>Hay un filtro regular de WordPress también. Usa el filtro the &#8220;do_createsupercache&#8221;<br />\npara personalizar los controles realizados antes del almacenamiento en caché. El filtro acepta un parámetro.<br />\nLa función de salida de WP-Cache wp_cache_get_cookies_values().</p>\n<p>Ver en plugins/searchengine.php un ejemplo que uso para mi plugin <a href=\"https://odd.blog/no-adverts-for-friends/\" rel=\"nofollow\">No Adverts for Friends</a>.</p>\n<h3>Soluciones a fallos</h3>\n<p>Si algunas cosas no funcionan desde que instalaste el plugin, hay algunas cosas que debes comprobar:</p>\n<ol>\n<li>¿Tiene wp-content permisos de escritura para el servidor?</li>\n<li>¿Existe un wp-content/wp-cache-config.php? Si no existe, debes copiar el archivo wp-super-cache/wp-cache-config-sample.php en wp-content/wp-cache-config.php y asegurarte de que WPCACHEHOME apunte al lugar correcto.</li>\n<li>¿Existe un wp-content/advanced-cache.php? Si no existe, debes copiar wp-super-cache/advanced-cache.php en wp-content/. Debes editar el archivo y cambiar la ruta para que apunte a la carpeta wp-super-cache.</li>\n<li>Si no hay páginas en la memoria caché, elimina wp-content/advanced-cache.php y vuelve a crearlo, siguiendo los consejos anteriores.</li>\n<li>\n<p>Asegúrate de que la siguiente línea esté en wp-config.php y esté ENCIMA de la línea &#8220;require_once(ABSPATH.&#8217;wp-settings.php&#8217;);&#8221;:</p>\n<pre><code>define( \'WP_CACHE\', true );\n</code></pre>\n</li>\n<li>Prueba de nuevo en página Ajustes-&gt;WP Super Cache y activa la caché.</li>\n<li>Pasa a ver wp-content/cache/supercache/. ¿Hay directorios y archivos allí?</li>\n<li>¿Hay algo en el error_log de php?</li>\n<li>Si el navegador sigue pidiéndote que guardes el archivo después de instalar supercaché, debes desactivar la compresión de Super Cache. Ve a la página Ajustes-&gt;WP Super Cache y desactívala ahí.</li>\n<li>El plugin no funciona muy bien con el modo seguro de PHP activo. Debe ser desactivado por tu administrador.</li>\n<li>Si las páginas se supercachean aleatoriamente y a veces no, probablemente tu blog  se puede ver con y sin el prefijo &#8220;www&#8221; en la URL. Debes elegir una forma e instalar el plugin <a href=\"http://txfx.net/code/wordpress/enforce-www-preference/\" rel=\"nofollow\">Enforce www preference</a> si estás usando una instalación antigua de WordPress. Las últimas versiones se redireccionan (de todos modos ¡siempre deberías usar la última versión de WordPress!)</li>\n<li>Los usuarios de servidores privados en Dreamhost deberían editar wp-content/wp-cache-config.php y apuntar el directorio de caché a &#8220;/tmp/&#8221; si reciben errores sobre el aumento del uso de la CPU. Consulta este <a href=\"https://wordpress.org/support/topic/145895?replies=42\" rel=\"nofollow\">debate</a> para saber más.</li>\n<li>Errores de bloqueo de archivos como &#8220;no se pudo obtener la clave 0x152b: Permiso denegado en &#8230;&#8221; o &#8220;Página no almacenada en caché por WP Super Cache. No se pudo obtener el bloqueo de exclusión mutua.&#8221; son una señal de que debes usar el bloqueo de archivos. Edita wp-content/wp-cache-config.php y descomenta &#8220;$use_flock = true&#8221; o define un valor diferente para $sem_id. También puedes desactivar el bloqueo de archivos desde la pantalla de administración como último recurso.</li>\n<li>Asegúrate de que el servidor web pueda escribir en la memoria  cache/wp_cache_mutex.lock si utilizas el bloqueo basto de archivos.</li>\n<li>La carpeta de caché no se puede colocar en un compartimiento NFS o Samba o NAS. Tiene que estar en un disco local. El bloqueo de archivos y la eliminación de archivos caducados no funcionarán correctamente a menos que la carpeta de caché esté en la máquina local.</li>\n<li>\n<p>La recogida de basura de archivos antiguos de caché no funcionará si WordPress no puede encontrar wp-cron.php. Si stu hostname se resuelve en 127.0.0.1, podría estar impidiendo que funcione la recogida de elementos no utilizados. Verifica los access_logs de las entradas de wp-cron.php. ¿Devuelven un código 404 (archivo no encontrado) o 200? Si es 404 o no ves wp-cron.php en cualquier lugar, WordPress puede estar buscando esa secuencia de comandos en el lugar equivocado. Debes hablar con el administrador de tu servidor para corregir esto o editar /etc/hosts en servidores Unix y eliminar la siguiente línea. Tu hostname debe resolverse en la dirección IP externa de otros servidores en el uso de la red/Internet. Ver http://yoast.com/wp-cron-issues/ para más info. Una línea como &#8220;127.0.0.1 localhost localhost.localdomain&#8221; está bien.</p>\n<pre><code>127.0.0.1 example.com\n</code></pre>\n</li>\n<li>Si se están sirviendo páginas anticuadas a tus visitantes a través de la supercaché, es posible que te falten módulos Apache (o sus equivalentes si no usas Apache). Se requieren 3 módulos: mod_mime, mod_headers y mod_expires. Los dos últimos son especialmente importantes para garantizar que los navegadores carguen las nuevas versiones de páginas existentes en tu sitio.</li>\n<li>El mensaje de error &#8220;WP Super Cache está instalado pero roto. La ruta a wp-cache-phase1.php in wp-content/advanced-cache.php debe corregirse!&#8221; aparece al final de cada página. Abre el archivo wp-content/advanced-cache.php en su editor favorito. ¿Es correcta la ruta a wp-cache-phase1.php? Este archivo estará normalmente en wp-content/plugins/wp-super-cache/. Si no es correcto, el motor de almacenamiento en caché no se cargará.</li>\n<li>El almacenamiento en caché no funciona. La marca de tiempo en mi blog cambia constantemente cuando recargo. Comprueba en las reglas .htaccess que la ruta coincide con el lugar donde está el directorio supercache. Puede que tengas que codificarlo. Intenta desactivar el modo supercaché.</li>\n<li>\n<p>Si se generan archivos de caché de supercaché pero no se sirven, comprueba los permisos en todas las carpetas de wp-content/cache/supercache (y en cada una de las carpetas de memoria caché y supercaché de wp-content) y wp-content/cache/.htaccess. Si tu PHP se ejecuta como un usuario diferente a Apache y los permisos son estrictos, es posible que Apache no pueda leer los archivos de caché generados por PHP. Para solucionarlo, debes agregar la siguiente línea a tu wp-config.php (agrégala encima de WP_CACHE define). Después borra la caché.</p>\n<pre><code>umask( 0022 );\n</code></pre>\n</li>\n<li>\n<p>Si ves basura en tu navegador después de activar la compresión en el plugin, es posible que la compresión ya esté activada en el servidor web. En Apache debes desactivar mod_deflate, o en PHP la compresión zlib puede estar activada. Puedes desactivarla de tres maneras. Si tienes acceso de administrador, edita el php.ini y encuentra la configuración de zlib.output_compression y asegúrate de que esté &#8220;Desactivada&#8221; o agrega esta línea al .htaccess:</p>\n<pre><code>php_flag zlib.output_compression off\n</code></pre>\n<p>Si eso no funciona, añade esta línea a tu wp-config.php:</p>\n<pre><code>ini_set(\'zlib.output_compression\', 0);\n</code></pre>\n</li>\n<li>La &#8220;pantalla blanca de la muerte&#8221; o una página en blanco cuando visitas tu sitio casi siempre es causada por un error de PHP, pero <a href=\"http://www.johnberns.com/2010/03/19/wp-super-cache-blank-page-problem-fixed/\" rel=\"nofollow\">también puede ser causado por APC</a>. Desactiva esa extensión de PHP si tienes problemas y reemplázala con eAccelerator o Xcache.</li>\n<li>Después de desinstalar, los enlaces permanentes pueden romperse si eliminas también las reglas de mod_rewrite de WordPress. Vuelve a generar esas reglas visitando la página Ajustes-&gt;Enlaces permanentes y guarda ese formulario de nuevo.</li>\n<li>Si tu blog se niega a cargar, asegúrate de que tu wp-config.php sea correcto. ¿Has perdido una etiqueta PHP de apertura o cierre?</li>\n<li>¿Tu página principal está bien, pero las entradas y las páginas dan un 404? Ve a Ajustes-&gt; enlaces permanentes y haz clic en &#8220;Guardar&#8221; una vez hayas seleccionado una estructura personalizada de enlaces permanentes. Es posible que debas actualizar manualmente el archivo .htaccess.</li>\n<li>\n<p>Si algunos caracteres no aparecen correctamente en tu sitio web, es posible que tu servidor no esté configurado correctamente. Debes decirle a los visitantes qué conjunto de caracteres usas. Ve a Ajustes-&gt;Lectura y copia el valor &#8216;Codificación de páginas y feeds&#8217;. Edita el archivo .htaccess con todas las reglas de reescritura de Supercache y WordPress y añade esto en la parte superior, reemplazando CHARSET con el valor copiado. (por ejemplo, &#8216;UTF-8&#8217;)</p>\n<pre><code>AddDefaultCharset CHARSET\n</code></pre>\n</li>\n<li>Usa <a href=\"https://wordpress.org/plugins/cron-view/\">Cron View</a> para ayudar a diagnosticar problemas de recogida de basura y precarga. Usa el plugin para asegurarte de que las tareas estén programadas y para qué hora. Busca las tareas wp_cache_gc y wp_cache_full_preload_hook.</li>\n<li>El mensaje de error &#8220;WP Super Cache está instalado pero roto. La constante WPCACHEHOME se debe establecer en el archivo wp-config.php y apuntar al directorio del plugin WP Super Cache.&#8221; aparece al final de cada página. Puedes eliminar wp-content/advanced-cache.php y recargar la página de configuración del plugin o editar wp-config.php y buscar WPCACHEHOME y asegurarte de que apunte a la carpeta wp-super-cache. Normalmente será wp-content/plugins/wp-super-cache/ pero es probable que necesites la ruta completa a ese archivo (por lo que es más fácil dejar que la página de ajustes lo solucione). Si no es correcto, el motor de almacenamiento en caché no se cargará.</li>\n<li>Si tu servidor está teniendo problemas debido a la cantidad de semáforos que utiliza el plugin, es porque tus usuarios están utilizando el bloqueo de archivos, que no es recomendable (pero lo necesitan un reducido número de usuarios). Puedes desactivar globalmente el bloqueo de archivos definiendo la constante  WPSC_DISABLE_LOCKING, o definiendo la constante WPSC_REMOVE_SEMAPHORE para que llame a sem_remove() después de almacenar cada página en caché, pero eso parece causar problemas en otros procesos que solicitan el mismo semáforo. Lo mejor es desactivarlo.</li>\n</ol>\n\";s:12:\"installation\";s:1788:\"<p>Instalar como cualquier otro plugin, directamente desde tu página de plugins, pero asegúrate de tener activos los enlaces permanentes personalizados. Ve a la página de ajustes del plugin en Ajustes-&gt;WP Super Cache y activa el almacenamiento en caché.</p>\n<h3>Cómo desinstalar WP Super Cache</h3>\n<p>Prácticamente todo lo que tienes que hacer es desactivar el plugin en la página de plugins. El plugin debería limpiar la mayoría de archivos creados y modificados, pero aún no borra las reglas de mod_rewrite del archivo .htaccess. Busca la sección de ese archivo marcada con las etiquetas SuperCache BEGIN y END. El plugin no borra eso debido a que algunas personas añaden también reglas de WordPress en ese bloque.</p>\n<p>Para desinstalarlo manualmente:</p>\n<ol>\n<li>Desactiva la caché en la página de ajustes del plugin y vacía la caché.</li>\n<li>Desactiva el plugin en la página de plugins.</li>\n<li>Borra la variable WP_CACHE de tu wp-config.php. Será algo como <code>define( \'WP_CACHE\', true );</code></li>\n<li>Borra las reglas mod_rewrite de Super Cache de tu archivo .htaccess.</li>\n<li>Borra los archivos wp-content/advanced-cache.php y wp-content/wp-cache-config.php</li>\n<li>Borra el directorio wp-content/cache/</li>\n<li>Borra el directorio wp-super-cache de tu directorio de plugins.</li>\n</ol>\n<h3>Si todo falla y tu sitio está roto</h3>\n<ol>\n<li>Borra la variable WP_CACHE de tu wp-config.php. Será algo como <code>define( \'WP_CACHE\', true );</code></li>\n<li>Borra las reglas (ver arriba) que el plugin escribió en el archivo .htaccess de tu directorio raíz.</li>\n<li>Borra la carpeta wp-super-cache de la carpeta de plugins.</li>\n<li>Opcionalmente borra advanced-cache.php, wp-cache-config.php la la carpeta de caché en wp-content/.</li>\n</ol>\n\";s:3:\"faq\";s:18571:\"\n<h4>Instrucciones de instalación</h4>\n<p>\n<p>Instalar como cualquier otro plugin, directamente desde tu página de plugins, pero asegúrate de tener activos los enlaces permanentes personalizados. Ve a la página de ajustes del plugin en Ajustes-&gt;WP Super Cache y activa el almacenamiento en caché.</p>\n<h3>Cómo desinstalar WP Super Cache</h3>\n<p>Prácticamente todo lo que tienes que hacer es desactivar el plugin en la página de plugins. El plugin debería limpiar la mayoría de archivos creados y modificados, pero aún no borra las reglas de mod_rewrite del archivo .htaccess. Busca la sección de ese archivo marcada con las etiquetas SuperCache BEGIN y END. El plugin no borra eso debido a que algunas personas añaden también reglas de WordPress en ese bloque.</p>\n<p>Para desinstalarlo manualmente:</p>\n<ol>\n<li>Desactiva la caché en la página de ajustes del plugin y vacía la caché.</li>\n<li>Desactiva el plugin en la página de plugins.</li>\n<li>Borra la variable WP_CACHE de tu wp-config.php. Será algo como <code>define( \'WP_CACHE\', true );</code></li>\n<li>Borra las reglas mod_rewrite de Super Cache de tu archivo .htaccess.</li>\n<li>Borra los archivos wp-content/advanced-cache.php y wp-content/wp-cache-config.php</li>\n<li>Borra el directorio wp-content/cache/</li>\n<li>Borra el directorio wp-super-cache de tu directorio de plugins.</li>\n</ol>\n<h3>Si todo falla y tu sitio está roto</h3>\n<ol>\n<li>Borra la variable WP_CACHE de tu wp-config.php. Será algo como <code>define( \'WP_CACHE\', true );</code></li>\n<li>Borra las reglas (ver arriba) que el plugin escribió en el archivo .htaccess de tu directorio raíz.</li>\n<li>Borra la carpeta wp-super-cache de la carpeta de plugins.</li>\n<li>Opcionalmente borra advanced-cache.php, wp-cache-config.php la la carpeta de caché en wp-content/.</li>\n</ol>\n</p>\n<h4>¿Cómo sé que mi blog se está cacheando?</h4>\n<p>\n<p>Ve a Ajustes-&gt;WP Super Cache y busca el formulario &#8220;Probar caché&#8221; en la página de ajustes fáciles. Haz clic en &#8220;Probar Cache&#8221; y el plugin solicitará la página principal del sitio dos veces, comparando una marca de tiempo en cada una para asegurarse de que coincidan.</p>\n<p>Si deseas hacerlo manualmente, activa la depuración en la página de ajustes del plugin y carga el archivo de registro en una nueva pestaña del navegador. Luego, mira tu blog mientras estás conectado y tras haber cerrado sesión. Deberías ver actividad en el registro. Mira el código fuente de cualquier página de tu sitio. Cuando se crea una página por primera vez, verás el texto &#8220;Página dinámica generada en XXXX segundos&#8221;. y &#8220;Página en caché generada por WP-Super-Cache en YYYY-MM-DD HH: MM: SS&#8221; al final del código fuente. Al volver a cargar, una página almacenada en caché mostrará la misma marca de tiempo, así que espera unos segundos antes de verificar.<br />\nSi el Supercaching está desactivado y tienes activada la compresión, se agregará el texto &#8220;Compression = gzip&#8221;. Si la compresión está desactivada y la página se sirve como un archivo html estático, se agregará el texto &#8220;super cache&#8221;. La única forma de comprobar si el archivo en caché es servido por el script PHP o desde la caché estática es mirando los encabezados HTTP. Las páginas en caché de PHP tendrán el encabezado &#8220;WP-Super-Cache: archivo de super cache servido desde PHP&#8221;. Los archivos en caché de WPCache tendrán el encabezado, &#8220;WP-Super-Cache: servido archivo de caché WPCache&#8221;. También debes verificar el directorio de caché en wp-content/cache/supercache/hostname/ para archivos de caché estáticos.<br />\nSi las reglas del plugin no aparecen en tu archivo .htaccess, el plugin intentará mostrar la página super cache si la encuentra. Si esto sucede el encabezado será &#8220;WP-Super-Cache: archivo de supercache servido desde PHP&#8221;.</p>\n</p>\n<h4>¿Cómo desactivo Supercache?</h4>\n<p>\n<p>Si solo quieres usar el motor WP-Cache, entonces edita tu wp-config.php o crea un mu-plugin que establezca la constante &#8216;DISABLE_SUPERCACHE&#8217; en 1.</p>\n</p>\n<h4>WP-Cache vs archivos Supercache</h4>\n<p>\n<p>Todos los archivos de caché se almacenan en wp-content/cache/supercache/HOSTNAME/ donde HOSTNANE es tu nombre de dominio. Los archivos se almacenan en directorios que coinciden con la estructura de enlaces permanentes de tu sitio. Los archivos de Supercache son index.html o alguna variante de eso, dependiendo del tipo de visitante que llegue al blog. Otros archivos se llaman wp-cache-XXXXXXXXXXXXXXXXX.php. Los metaarchivos asociados comienzan con &#8220;meta&#8221;. Esos archivos contienen información sobre el archivo en caché. Estos archivos son generados por el motor &#8220;WPCache caching&#8221; del plugin.</p>\n</p>\n<h4>¿Se actualizarán de inmediato los comentarios y otras partes dinámicas de mi blog?</h4>\n<p>\n<p>Los comentarios se mostrarán tan pronto como se moderen, según la política de comentarios del propietario del blog. Es posible que otros elementos dinámicos de una página no se actualicen a menos que estén escritos en JavaScript, Flash, Java u otro lenguaje de navegador del lado del cliente. El plugin realmente produce páginas html estáticas. Cuando esas páginas se sirven no se ejecuta PHP. &#8220;Popularity Contest&#8221; es uno de esos plugins que no funcionarán.</p>\n</p>\n<h4>¿Reducirá la velocidad de mi servidor la compresión de Super Cache?</h4>\n<p>\n<p>No, hará lo contrario. Los archivos de Super Cache se comprimen y almacenan de esa forma, por lo que la compresión intensa se realiza solo una vez. Generalmente estos archivos son mucho más pequeños y se envían al navegador de un visitante mucho más rápido que los html sin comprimir. Como resultado, el servidor pasa menos tiempo hablando por la red, lo que ahorra tiempo de CPU y ancho de banda, y también puede atender la próxima solicitud mucho más rápidamente.</p>\n</p>\n<h4>¿Cómo hago para que ciertas partes de la página se mantengan dinámicas?</h4>\n<p>\n<p>Nota: esta funcionalidad está desactivada por defecto. Deberás activarla en la página de ajustes avanzados.</p>\n<p>Hay 2 formas de hacer esto. Puedes usar Javascript para dibujar la parte de la página que deseas mantener dinámica. Eso es lo que Google Adsense y muchos widgets de sitios externos hacen y es la forma recomendada. O puedes usar un filtro de WP Super Cache para hacer el trabajo pero no puedes usar el caché de modo mod_rewrite. Has de usar el método de entrega &#8220;fácil&#8221; o desactivar supercache.</p>\n<p>WP Super Cache 1.4 introdujo un filtro de caché llamado wpsc_cachedata. La página en caché a mostrar pasa por este filtro y permite la modificación de la página. Si la página contiene una etiqueta de marcador de posición, el filtro se puede usar para reemplazar esa etiqueta con tu html generado dinámicamente.<br />\nLa función que se engancha al filtro wpsc_cachedata debe colocarse en un archivo en la carpeta de plugins de WP Super Cache si no usas la función late_init feature. Hay un plugin de ejemplo incluido. Edita <a href=\"http://svn.wp-plugins.org/wp-super-cache/trunk/plugins/dynamic-cache-test.php\" rel=\"nofollow\">dynamic-cache-test.php</a> para ver el código de ejemplo.<br />\nHay dos ejemplos de funciones allí. Hay una función simple que reemplaza una cadena (o etiqueta) que define cuando se sirve la página en caché. La otra función de ejemplo usa un buffer de salida para generar el contenido dinámico. Debido a una limitación en la forma en que PHP funciona, el código del buffer de salida DEBE ejecutarse antes que el filtro wpsc_cachedata, al menos para cuando se almacena en la memoria caché de una página. No importa cuando se publican páginas en caché. Consulta <a href=\"https://odd.blog/y/6j\" rel=\"nofollow\">esta entrada</a> para obtener una explicación más técnica y extensa.<br />\nPara ejecutar funciones de WordPress debes activar la característica &#8216;Late init&#8217; en la página de ajustes avanzados.</p>\n</p>\n<h4>¿Cómo puedo retrasar la entrega de caché hasta que se active la acción &#8220;init&#8221;?</h4>\n<p>\n<p>Los archivos cacheados se sirven antes de que cargue casi todo WordPress. Si bien es genial para el rendimiento, es un dolor cuando quieres ampliar el plugin usando una parte del core de WordPress. Activa el modo &#8216;Retrasar init&#8217; en la página de ajustes avanzados y los archivos en caché se servirán cuando se active &#8220;init&#8221;. WordPress y sus plugins se cargarán ahora.</p>\n</p>\n<h4>¿Por qué ahora no funcionan o no se actualizan en mi blog WP UserOnline, Popularity Contest, WP Postratings o el plugin X?</h4>\n<p>\n<p>Este plugin almacena en caché páginas enteras, pero algunos plugins piensan que pueden ejecutar código PHP cada vez que se carga una página. Para solucionarlo, el plugin necesita usar los métodos de Javascript/AJAX o el filtro wpsc_cachedata descrito en la respuesta anterior para actualizar o mostrar información dinámica.</p>\n</p>\n<h4>¿Por qué desaparecen mis plugins de WP Super Cache cuando actualizo el plugin?</h4>\n<p>\n<p>WordPress borra la carpeta del plugin cuando actualiza un plugin. Lo mismo sucede con WP Super Cache, por lo que los archivos modificados en wp-super-cache/plugins/ se eliminarán. Puedes definir la variable $wp_cache_plugins_dir en wp-config.php o wp-content/wp-cache-config.php y apuntarla a un directorio fuera de la carpeta wp-super-cache. El plugin buscará allí sus plugins.</p>\n</p>\n<h4>¿Qué hace la característica reconstruir caché?</h4>\n<p>\n<p>Cuando una visita deja un comentario, el archivo en caché de esa página se elimina y la siguiente visita vuelve a crear la página en caché. Una página emplea tiempo en cargarse, entonces ¿qué sucede si recibes 100 visitantes en ese momento? No habrá una página almacenada en caché para que WordPress sirva una página actualizada para cada usuario y el plugin intentará crear una página en caché para cada uno de esos 100 visitantes, causando una gran carga en el servidor. Esta característica evita que esto ocurra. La página almacenada en caché no se borra cuando dejan un comentario. Está marcada para que en lugar de eso se reconstruya. La siguiente visita dentro de los siguientes 10 segundos regenerará la página en caché mientras se sirve la página antigua a las otras 99 visitas. La página es eventualmente cargada por la primera visita y la página en caché se actualiza. Consulta <a href=\"https://odd.blog/2009/01/23/wp-super-cache-089/\" rel=\"nofollow\">esta entrada</a> para saber más.</p>\n</p>\n<h4>¿Por qué el plugin no cachea por defecto las solicitudes de los robots del motor de búsqueda?</h4>\n<p>\n<p>Esos bots normalmente solo visitan cada página una vez y si la página no es popular no tiene sentido crear un archivo de caché que permanezca inactivo en el servidor. Sin embargo, puedes permitir que estas visitas se almacenen en caché eliminando la lista de bots de &#8220;Agentes de usuario rechazados&#8221; en la página de configuración avanzada.</p>\n</p>\n<h4>Se está mostrando una página de categoría en lugar de mi página de inicio</h4>\n<p>\n<p>Una pequeña proporción de sitios web tendrán problemas con la siguiente configuración:</p>\n<ol>\n<li>Utiliza una página estática para la página principal.</li>\n<li>Usa la estructura de enlaces permanentes /%category%/%postname%/.</li>\n</ol>\n<p>A veces, una página de categoría se almacena en caché como la página de inicio del sitio en lugar de la página estática. No puedo <a href=\"https://wordpress.org/support/topic/237415/page/2?replies=38\" rel=\"nofollow\">replicar el problema</a> pero una solución simple es usar el modo &#8220;Fácil&#8221;. También puedes habilitar los &#8220;Comprobaciones adicionales de página de inicio&#8221; en la página de ajustes avanzados.</p>\n</p>\n<h4>¿Por qué recibo advertencias sobre el almacenamiento en caché desde http://ismyblogworking.com/ ?</h4>\n<p>\n<p>&#8220;Tu blog no admite el almacenamiento en memoria caché del cliente (no hay respuesta 304 a If-modified-since).&#8221;<br />\n&#8220;Tu feed no admite cacheo (no hay respuesta 304 a If-modified-since)&#8221;</p>\n<p>Supercache no es compatible con control de encabezado 304 en el modo Avanzado, pero sí lo es en modo Fácil. Esto es el almacenamiento en caché realizado por el navegador, no el servidor. Es un control que hace el navegador para preguntarle al servidor si hay disponible una versión actualizada de la página actual. Si no, no descarga la versión anterior de nuevo. El servidor aún almacena la página en caché, pero no en los navegadores de los visitantes.<br />\nPrueba el motor de Cacheability en http://www.ircache.net/cgi-bin/cacheability.py o https://redbot.org/ para un análisis más detallado.</p>\n</p>\n<h4>¿Cómo debo usar las herramientas de seguimiento utm_source en Google Analytics con este plugin?</h4>\n<p>\n<p>Ese seguimiento agrega una cadena de consulta a cada URL vinculada desde varias fuentes como Twitter y lectores de noticias. Desafortunadamente, evita que las páginas se supercacheen. Consulta <a href=\"https://odd.blog/remove-unused-utmsource-urls/#comment-672813\" rel=\"nofollow\">el comentario de Joost aquí</a> sobre cómo convertirlo en una etiqueta de anclaje que pueda supercachearse.</p>\n</p>\n<h4>¡El plugin se queja de que wp-content tiene permisos de escritura! ¡htdocs tiene permisos de escritura!</h4>\n<p>\n<p>No es bueno quw el servidor web pueda escribir en estos directorios, pero a veces las cuentas de hosting compartido se configuran así para facilitar la administración. Usa <code>chmod 755 directory</code> para corregir los permisos o busca la sección de permisos en tu cliente ftp. Este <a href=\"https://www.google.com/search?sourceid=chrome&amp;ie=UTF-8&amp;q=ftp+fix+directory+permissions+755\" rel=\"nofollow\">búsqueda en Google</a> te guiará para obtener más información sobre este tema y también hay <a href=\"https://codex.wordpress.org/Changing_File_Permissions\" rel=\"nofollow\">esta página del codex page</a>. Lamentablemente, algunos hosts requieren que esos directorios sean escribibles. Si ese es el caso, simplemente ignora esta advertencia.</p>\n</p>\n<h4>¿Cómo borro WP_CACHE define de wp-config.php?</h4>\n<p>\n<p>Carga tu cliente ftp de escritorio y conéctate a tu sitio. Navega hasta la raíz (o el directorio debajo de ella) del sitio donde encontrarás wp-config.php. Descarga ese archivo y edítalo en un editor de texto. Borra la línea  <code>define( \'WP_CACHE\', true );</code> y guarda el archivo. Ahora súbelo, sobrescribiendo el wp-config.php en tu servidor.</p>\n</p>\n<h4>¿Cómo elimino las reglas de Super Cache del archivo .htaccess?</h4>\n<p>\n<p>Carga tu cliente ftp de escritorio y conéctate a tu sitio. Es posible que debas activar &#8220;Mostrar archivos ocultos&#8221; en las preferencias de tu cliente ftp. Navegua a la raíz del sitio donde encontrarás el archivo .htaccess. Descarga ese archivo y edítalo en un editor de texto. Elimina las líneas entre &#8220;# BEGIN WPSuperCache&#8221; y &#8220;# END WPSuperCache&#8221; y guarda el archivo. Ahora cárgalo y sobrescribe el archivo .htaccess en tu servidor.</p>\n</p>\n<h4>¿Cómo cambio los permisos de archivos?</h4>\n<p>\n<p>Esta <a href=\"https://codex.wordpress.org/Changing_File_Permissions\" rel=\"nofollow\">página</a> del Codex de WordPress explica todo lo que necesitas saber sobre los permisos de archivos en el servidor y varias formas de cambiarlos.</p>\n</p>\n<h4>¿Por qué obtengo picos de carga cuando se hacen nuevas publicaciones?</h4>\n<p>\n<p>Puedes permitir la opción &#8220;borrar todos los archivos almacenados en caché cuando se realicen nuevas publicaciones&#8221;. Limpiar esos archivos puede llevar tiempo, y tus visitantes ahora visitarán las páginas que no están en caché. ¿Estás usando el seguimiento de campañas de Google Analytics con utm_source en la url? Esas páginas no están en caché. Consulta la pregunta &#8220;¿Cómo debo usar las herramientas de seguimiento de utm_source en Google Analytics con este plugin?&#8221; para saber cómo usarlas correctamente.<br />\nLas páginas en caché deben actualizarse cuando se realizan las publicaciones. Tal vez tu servidor simplemente no está a la altura de la cantidad de tráfico que recibes. Activa la función &#8220;reconstrucción de caché&#8221; ya que puede ser útil.</p>\n</p>\n<h4>¿Cuántas páginas puedo cachear?</h4>\n<p>\n<p>El único límite real son los límites definidos por tu servidor. Por ejemplo, EXT2 y EXT3 permiten un máximo de 31,999 subdirectorios, así que si tienes una estructura plana de enlaces permanentes (como /%POSTNAME%/) y tienes más de 32.000 entradas puede que te metas en problemas. Igualmente, si es una red multisitio y tienes más de 31.999 sitios (blogs) no podrás cachearlos todos. Siendo realistas, si tienes tantos sitios activos no deberías estar ejecutándolos en un mismo servidor.</p>\n</p>\n<h4>I can see that the www version of my site is cached separately. How do I stop that?</h4>\n<p>\n<p>WordPress should redirect to the canonical URL of your site but if it doesn&#8217;t, add this to your .htaccess above the Supercache and WordPress rules. Change example.com to your own hostname.<br />\n    RewriteCond %{HTTP_HOST} www.example.com$ [NC]<br />\n    RewriteRule ^(.*)$ https://example.com/$1 [L,R=301]</p>\n</p>\n<h4>¿Cómo sirvo páginas móviles en caché a clientes con pantallas pequeñas como teléfonos y tabletas?</h4>\n<p>\n<p>Tu tema es probablemente adaptable, lo que significa que cambia el tamaño de la página para adaptarse a cualquier dispositivo en el que se muestre. Si no es adaptable, tendrás que usar un complemento independiente para móvil  para procesar una página formateada para esos visitantes. Se han probado los siguientes complementos pero YMMV depende del cliente móvil. Tendrás que habilitar el soporte para navegador móvil también en la página de ajustes avanzada.</p>\n<ul>\n<li><a href=\"https://wordpress.org/plugins/jetpack/\">Módulo de tema móvil de Jetpack</a></li>\n<li><a href=\"https://wordpress.org/plugins/wptouch/\">WPTouch</a></li>\n<li><a href=\"https://wordpress.org/plugins/wordpress-mobile-edition/\">WordPress Mobile Edition</a></li>\n<li><a href=\"https://wordpress.org/plugins/wordpress-mobile-pack/\">WordPress Mobile Pack</a>  (no puede tener activo &#8220;No almacenar en caché las páginas para usuarios conocidos&#8221;)</li>\n</ul>\n</p>\n\n\";s:9:\"changelog\";s:25688:\"<h3>1.5.9</h3>\n<ul>\n<li>Fixed fatal error if the debug log was deleted while debugging was enabled and a visitor came to the site.</li>\n<li>Fixed the dynamic caching test plugin because of PHP7 changes. Dynamic cache mode must be enabled now.</li>\n<li>Lots of WordPress coding style formatting fixes to the code.</li>\n<li>All changes: https://github.com/Automattic/wp-super-cache/compare/1.5.8&#8230;1.5.9</li>\n</ul>\n<h3>1.5.8</h3>\n<ul>\n<li>Correcciones de PHP 7. (#429)</li>\n<li>Arreglada casilla de verificación de comentarios de depuración. (#433)</li>\n<li>Solo registra la función de desinstalación en las páginas de administración para guardar consultas. (#430)</li>\n<li>Comprueba que wp-cache-phase1.php está cargado antes de guardar la página de ajustes. (#428)</li>\n<li>Si una url contiene un &#8220;?&#8221; entonces no elimina la caché asociada. ¿Eliminará toda la caché después de eliminar?&#8230; parte. (#427 &amp; #420)</li>\n<li>Permite funciones estáticas en clases para ser utilizadas en acciones de caché. (#425)</li>\n<li>No hace anónimas las solicitudes AJAX. (#423)</li>\n<li>Corregido enlace a la explicación de chmod. (#421)</li>\n<li>Agregados más escapes a la página de ajustes de CDN. (#416)</li>\n<li>Usa SERVER_PROTOCOL para determinar el protocolo http. (#412 &amp; #413)</li>\n<li>Si la precarga se detiene solo envía un correo electrónico por día, pero muestra un aviso al administrador. (#432)</li>\n<li>Corregidas más advertencias de PHP en #438 y #437</li>\n<li>Oculta las advertencias de mod_rewrite para los usuarios de Nginx. #434</li>\n</ul>\n<h3>1.5.7.1</h3>\n<ul>\n<li>Si HTTP HOST está vacío, no lo usa en strpos para evitar una advertencia de PHP. (#408)</li>\n<li>No precarga las publicaciones con enlaces permanentes que contengan cadenas rechazadas. (#407)</li>\n<li>Genera una lista de feeds de archivos que se pueden eliminar al actualizar el sitio. También corrige el problema de archivo de configuración dañado y el error fatal con versiones anteriores de WordPress. (#403)</li>\n</ul>\n<h3>1.5.7</h3>\n<ul>\n<li>Arreglado error fatal error en plugins/searchengine.php (#398)</li>\n</ul>\n<h3>1.5.6</h3>\n<ul>\n<li>REST API: Added /plugins endpoint to handle the plugins settings page. (#382)</li>\n<li>Cambios menores en sangría y espacios para la conversión de pestañas (#371) (#395)</li>\n<li>Don&#8217;t set $wp_super_cache_comments here as it&#8217;s not saved. (#379)</li>\n<li>realpath() solo funciona en directorios. cache_file no estaba cofigurado correctamente. (#377)</li>\n<li>Arreglado problema debido a realpath() al eliminar la caché de la barra de administración (#381)</li>\n<li>Use trigger_error() instead of echoing to the screen if a config file isn&#8217;t writeable. (#394)</li>\n<li>Agregado el filtro &#8220;wpsc_enable_wp_config_edit&#8221; para desactivar la edición de wp-config.php (#392)</li>\n<li>Repara algunos avisos de PHP cuando los comentarios se editan/publican/mantienen. (#386)</li>\n<li>Cambios menores en la descripción en la página de plugins. (#393)</li>\n</ul>\n<h3>1.5.5</h3>\n<ul>\n<li>Captura errores fatales para que no se almacenen en la memoria caché, mejora el código que capta tipos de página desconocidos.(#367)</li>\n<li>Fix caching on older WP installs, and if the plugin is inactive on a blog, but still caching, give feeds a short TTL to ensure they&#8217;re fresh. (#366)</li>\n<li>Al precargar, no elimina subdirectorios ni páginas secundarias mientras cachea páginas. (#363)</li>\n<li>Evitar advertencias de PHP de REST API en configuraciones que aún no están definidas. (#361)</li>\n<li>Agregados ajustes que faltaban al archivo de configuración.(#360)</li>\n</ul>\n<h3>1.5.4</h3>\n<ul>\n<li>Reparados mensajes relacionados con la creación de advanced-cache.php (#355, #354)</li>\n<li>Al eliminar el plugin no es necesario eliminar el directorio de caché, ya se hizo al desactivarlo.(#323)</li>\n<li>Disable Jetpack mobile detection if Jetpack Beta is detected. (#298)</li>\n<li>Add more checks on directories to make sure they exist before deleting them. (#324)</li>\n<li>Add siteurl setting to CDN page for users who have WordPress in it&#8217;s own directory. (#332)</li>\n<li>Don&#8217;t enable and then not save debug comments when toggling logging. (#334)</li>\n<li>Show plugin activity html comments to users who disable caching for logged in users. (#335)</li>\n<li>Better notifications on Preload page, and redo sql to fetch posts. Added &#8220;wpsc_preload_post_types_args&#8221; filter on post visibility, and wpsc_preload_post_types filter on post types used. (#336)</li>\n<li>Usa un feed almacenado en caché si es más reciente que el último cambio de una publicación. (#337)</li>\n<li>Better define a sitemap (#340) but when the content type is unknown add more checks to find out what it is. (#346)</li>\n<li>Guarda correctamente la ubicación de la caché en la página de ajustes avanzados. (#345)</li>\n<li>Asegúrate de que el registro de depuración existe antes de activarlo/desactivarlo para garantizar que se le agregue el código de autenticación http.</li>\n<li>Devuelve el tipo de caché correcto a la REST API. Ignorar el estado habilitado de supercaché. (#352)</li>\n<li>Fix cache contents in REST API showing double count of supercache files. (#353)</li>\n<li>Move the nonce in the CDN page back into a function. (#346)</li>\n<li>Use realpath to compare directories when loading the sample config file to account for symlinked directories. (#342)</li>\n<li>Other minor changes to html or typos<br />\n(Numbers are <a href=\"https://github.com/Automattic/wp-super-cache/pulls\" rel=\"nofollow\">pull requests</a> on Github.)</li>\n</ul>\n<h3>1.5.3</h3>\n<ul>\n<li>Corregido un error crítico que causaba que el desenlace se ejecutara en nulo al eliminar el plugin.</li>\n</ul>\n<h3>1.5.2</h3>\n<ul>\n<li>Agrega una barra inclinada a la ruta principal. Arregla problemas al buscar el archivo .htaccess.</li>\n<li>Elimina WPCACHEHOME y WP_CACHE de wp-config.php cuando el plugin se desactive.</li>\n<li>Comprueba que WPCACHEHOME es la ruta correcta en cada carga de la página de ajustes.</li>\n<li>Carga el código REST API sin usar WPCACHEHOME.</li>\n<li>Corregido el almacenamiento en caché del navegador móvil al usar el almacenamiento en caché de WP-Cache.</li>\n<li>Arregladas las comprobaciones de directorio en máquinas con Windows.</li>\n<li>Cambios de CDN revertidos en 1.5.0 por causar problemas en instalaciones anteriores de &#8220;WordPress en un directorio separado&#8221;.</li>\n<li>Agregada una nota a la página de CDN cuando la url del sitio != home url. Los administradores del sitio pueden usar un filtro para ajustar la URL utilizada.</li>\n<li>Stop preload quicker when requested while preloading taxonomies.</li>\n<li>Agregada más información para cuando falla la actualización del archivo .htaccess.</li>\n<li>&#8220;Served by&#8221; header is now optional. Enable it by setting $wpsc_served_header to true in the config file.</li>\n</ul>\n<h3>1.5.1</h3>\n<ul>\n<li>No usar funciones anónimas en REST API</li>\n<li>Verifica que el Controlador REST API esté disponible antes de cargar la REST API.</li>\n<li>No use funciones de cadenas multibyte porque algunos sitios no lo tienen activado.</li>\n</ul>\n<h3>1.5.0</h3>\n<ul>\n<li>Ajustes de variables REST API.</li>\n<li>Página de ajustess simplificada.</li>\n<li>Reorganizados archivos WP-Cache.</li>\n<li>Almacenamiento en caché de más encabezados http.</li>\n<li>Muchos errores corregidos.</li>\n</ul>\n<h3>1.4.9</h3>\n<ul>\n<li>Fixed bug when not running sem_remove after sem_release. See https://github.com/Automattic/wp-super-cache/issues/85</li>\n<li>Fixed a PHP error impacting PHP 7.1.</li>\n<li>Fixed a bug where we cached PUT and DELETE requests. We&#8217;re treating them like POST requests now.</li>\n<li>Delete supercache cache files, even when supercache is disabled, because mod_rewrite rules might still be active.</li>\n<li>Updated the settings page, moving things around. <a href=\"https://github.com/Automattic/wp-super-cache/pull/173\" rel=\"nofollow\">#173</a></li>\n<li>Make file locking less attractive on the settings page and fixed the WPSC_DISABLE_LOCKING constant so it really disables file locking even if the user has enabled it already.</li>\n<li>Added a WPSC_REMOVE_SEMAPHORE constant that must be defined if sem_remove() is to be used as it may cause problems.  <a href=\"https://github.com/Automattic/wp-super-cache/pull/174\" rel=\"nofollow\">#174</a></li>\n<li>Added a &#8220;wpsc_delete_related_pages_on_edit&#8221; filter that on returning 0 will disable deletion of pages outside of page being edited. <a href=\"https://github.com/Automattic/wp-super-cache/pull/175\" rel=\"nofollow\">#175</a></li>\n<li>Fixed plugin deleting all cached pages when a site had a static homepage. <a href=\"https://github.com/Automattic/wp-super-cache/pull/175\" rel=\"nofollow\">#175</a></li>\n<li>Make sure $cache_path has a trailing slash <a href=\"https://github.com/Automattic/wp-super-cache/pull/77\" rel=\"nofollow\">#177</a></li>\n<li>Remove flush() <a href=\"https://github.com/Automattic/wp-super-cache/pull/127\" rel=\"nofollow\">#127</a> but also check if headers are empty and flush and get headers again. <a href=\"https://github.com/Automattic/wp-super-cache/pull/179\" rel=\"nofollow\">#179</a></li>\n<li>Añadida corrección al personalizador <a href=\"https://github.com/Automattic/wp-super-cache/pull/161\" rel=\"nofollow\">#161</a> y no cachear las peticiones PUT AND DELETE <a href=\"https://github.com/Automattic/wp-super-cache/pull/178\" rel=\"nofollow\">#178</a></li>\n<li>Comprueba si hay superglobales antes de usarlos. <a href=\"https://github.com/Automattic/wp-super-cache/pull/131\" rel=\"nofollow\">#131</a></li>\n</ul>\n<h3>1.4.8</h3>\n<ul>\n<li>Removed malware URL in a code comment. (harmless to operation of plugin but gets flagged by A/V software)</li>\n<li>Updated translation file.</li>\n</ul>\n<h3>1.4.7</h3>\n<ul>\n<li>Actualizada la página de ajustes para WordPress 4.4. Cambios de diseño.</li>\n</ul>\n<h3>1.4.6</h3>\n<ul>\n<li>Generate the file cache/.htaccess even when one exists so gzip rules are created and gzipped pages are served correctly. Props Tigertech. https://wordpress.org/support/topic/all-website-pages-downloading-gz-file-after-latest-update?replies=36#post-7494087</li>\n</ul>\n<h3>1.4.5</h3>\n<ul>\n<li>Enhancement: Only preload public post types. Props webaware.</li>\n<li>Añadida una función de desinstalación que elimina el archivo de configuración. La función de desactivación ya no la borra.</li>\n<li>Ahora es posible desactivar el plugin sin visitar la página de configuración.</li>\n<li>Arreglado el sistema de reconstrucción de caché. Los archivos de reconstrucción ahora sobreviven más tiempo que la solicitud que los genera.</li>\n<li>Optimizaciones menores: prune_super_cache() sale inmediatamente si el archivo no existe. La salida de wp_cache_get_cookies_values() ahora se cachea.</li>\n<li>Añadido PHP pid al registro de depuración para ayudar a la depuración.</li>\n<li>Various small bug fixes.</li>\n<li>Corregido restablecimiento de hora de caducidad y configuración de RB al actualizar la configuración avanzada.</li>\n<li>Removed CacheMeta class to avoid APC errors. It&#8217;s not used any more.</li>\n<li>Fixed reset of advanced settings when using &#8220;easy&#8221; settings page.</li>\n<li>Fixed XSS in settings page.</li>\n<li>Ocultar archivos de caché si los servidores muestran índices del directorio.</li>\n<li>Evita la inyección de objetos PHP mediante el uso de serialize().</li>\n</ul>\n<h3>1.4.4</h3>\n<ul>\n<li>Fixed fatal error in output handler if GET parameters present in query. Props webaware.</li>\n<li>Fixed debug log. It wasn&#8217;t logging the right message.</li>\n</ul>\n<h3>1.4.3</h3>\n<ul>\n<li>Security release fixing an XSS bug in the settings page. Props Marc Montpas from Sucuri.</li>\n<li>Added wp_debug_log(). Props Jen Heilemann.</li>\n<li>Minor fixes.</li>\n</ul>\n<h3>1.4.2</h3>\n<ul>\n<li>Fixed &#8220;acceptable file list&#8221;.</li>\n<li>Fixed &#8220;Don&#8217;t cache GET requests&#8221; feature.</li>\n<li>Maybe fixed &#8220;304 not modified&#8221; problem for some users.</li>\n<li>Fixed some PHP warnings.</li>\n</ul>\n<h3>1.4.1</h3>\n<ul>\n<li>Fixed XSS in settings page. Props Simon Waters, Surevine Limited.</li>\n<li>Fix to object cache so entries may now be deleted when posts updated. (object cache still experimental)</li>\n<li>Documentation updates and cleanup of settings page.</li>\n</ul>\n<h3>1.4</h3>\n<ul>\n<li>Replace legacy mfunc/mnclude/dynamic-cached-content functionality with a &#8220;wpsc_cachedata&#8221; cacheaction filter.</li>\n<li>Added dynamic-cache-test.php plugin example wpsc_cachedata filter plugin.</li>\n<li>Delete post, tag and category cache when a post changes from draft to publish or vice versa. Props @Biranit.</li>\n<li>Update advanced-cache.php and wp-config.php if wp-cache-phase1.php doesn&#8217;t load, usually happening after migrating to a new hosting service.</li>\n<li>Misc bugfixes.</li>\n</ul>\n<h3>1.3.2</h3>\n<ul>\n<li>Any mfunc/mclude/dynamic-cached-content tags in comments are now removed.</li>\n<li>Dynamic cached content feature disabled by default and must be enabled on the Advanced Settings page.</li>\n<li>Support for the mobile theme in Jetpack via helper plugin on script&#8217;s Plugins tab.</li>\n</ul>\n<h3>1.3.1</h3>\n<ul>\n<li>Minor updates to documentation</li>\n<li>Fixed XSS in settings page.</li>\n</ul>\n<h3>1.3</h3>\n<ul>\n<li>mfunc tags could be executed in comments. Fixed.</li>\n<li>More support for sites that use the LOGGED_IN_COOKIE constant and custom cookies.</li>\n</ul>\n<h3>1.2</h3>\n<ul>\n<li>Garbage collection of old cache files is significantly improved. I added a scheduled job that keeps an eye on things and restarts the job if necessary. Also, if you enable caching from the Easy page garbage collection will be enabled too.</li>\n<li>Editors can delete single cached files from the admin bar now.</li>\n<li>Fixed the cached page counter on the settings page.</li>\n<li>Some sites that updated to 1.0 experienced too much garbage collection. There are still stragglers out there who haven&#8217;t upgraded but that&#8217;s fixed now!</li>\n<li>Supercached mobile files are now used as there was a tiny little typo that needed fixing.</li>\n<li>If your site is in a directory and you saw problems updating a page then that should be fixed now.</li>\n<li>The deactivate hook has been changed so your configuration isn.t hosed when you upgrade. Unfortunately this will only happen after you do this upgrade.</li>\n<li>Some sites use custom cookies with the LOGGED_IN_COOKIE constant. Added support for that.</li>\n<li>Added support for WPTouch Pro, but it appears to be flaky still. Anyone have time to work on that? I don.t.</li>\n<li>Some sites had problems with scheduled posts. For some reason the plugin thought the post was in draft mode and then because it only checked the same post once, when the post magically became published the cache wasn.t cleared. That.s fixed, thanks to the debug logging of several patient users.</li>\n<li>And more bug fixes and translation updates.</li>\n</ul>\n<h3>1.1</h3>\n<ul>\n<li>Use $_SERVER[ &#8216;SERVER_NAME&#8217; ] to create cache directories.</li>\n<li>Only create blogs cached directories if valid requests and blogs exist.</li>\n<li>Only clear current blog&#8217;s cache files if navigation menu is modified</li>\n<li>Added clean_post_cache action to clear cache on post actions</li>\n<li>Removed garbage collection details on Contents tab</li>\n<li>Added wp_cache_check_mobile cacheaction filter to shortcircuit mobile device check.</li>\n<li>Don&#8217;t delete cache files for draft posts</li>\n<li>Added action on wp_trash_post to clear the cache when trashed posts are deleted</li>\n<li>Show a warning when 304 browser caching is disabled (because mod_rewrite caching is on)</li>\n<li>New check for safe mode if using less that PHP 5.3.0</li>\n<li>Added wp_supercache_remove_cookies filter to disable anonymous browsing mode.</li>\n<li>Fixed garbage collection schedule dropdown</li>\n<li>Fixed preload problem clearing site&#8217;s cache on &#8220;page on front&#8221; sites.</li>\n<li>Fix for PHP variable not defined warnings</li>\n<li>Fixed problem refreshing cache when comments made as siteurl() sometimes didn&#8217;t work</li>\n<li>Preloading of taxonomies is now optional</li>\n<li>Domain mapping fixes.</li>\n<li>Better support for https sites. Remove https:// to get cache paths.</li>\n<li>Added AddDefaultCharset .htaccess rule back in and added an option to remove it if required.</li>\n<li>Added multisite plugin that adds a &#8220;Cached&#8221; column to Network-&gt;Sites to disable caching on a per site basis.</li>\n<li>Added WPTouch plugin to modify browser and prefix list in mobile detection code. Added support for that plugin&#8217;s exclude list.</li>\n<li>Fixed cache tester</li>\n<li>Filter the tags that are used to detect end-of-page using the wp_cache_eof_tags filter.</li>\n<li>Removed debug level from logging as it wasn&#8217;t helpful.</li>\n<li>Removed mention of wp-minify.</li>\n</ul>\n<h3>1.0</h3>\n<ul>\n<li>Removed AddDefaultCharset .htaccess rule</li>\n<li>Fixed problem with blogs in a folder and don&#8217;t have a trailing slash</li>\n<li>New scheduling of garbage collection</li>\n<li>Added a &#8220;Delete cache&#8221; link to admin bar to delete cache of current page.</li>\n<li>Updated documentation</li>\n<li>Sorry Digg, Stephen Fry power now!</li>\n<li>Updated translations</li>\n<li>Preload taxonomies and all post types except revisionsand nav menu items</li>\n<li>Fixed previews by logged in users.</li>\n<li>Added option to make logged in users anonymous</li>\n<li>Use WP 3.0 variables to detect multisite installs</li>\n<li>Hash filenames so files are served from the same CDNs</li>\n</ul>\n<h3>0.9.9.9</h3>\n<ul>\n<li>Fixed typo, is_front_page.</li>\n<li>Serve repeated static files from the same CDN hostname.</li>\n<li>Updated translations.</li>\n<li>Make supercache dir lowercase to avoid problems with unicode URLs.</li>\n<li>Add option to skip https loaded static content.</li>\n<li>Remove 5 second check on age of existing cache files. Should help with posts that get lots of comments and traffic.</li>\n<li>Lots of bugs fixed.</li>\n</ul>\n<h3>0.9.9.8</h3>\n<ul>\n<li>CDN updates: can be switched off, multiple CNAMEs.</li>\n<li>Uninstall process improved. It removes generated files and fixes edited files.</li>\n<li>Cached dynamic pages can now be stored in Supercache files and compressed.</li>\n<li>1and1 Webhosting fix (/kunden/)</li>\n<li>Remove log by email functionality as it caused problems for users who were inundated by email</li>\n<li>Many more minor fixes and changes.</li>\n</ul>\n<h3>0.9.9.6</h3>\n<ul>\n<li>Fixed problem serving cached files with PHP</li>\n<li>Added support for 304 &#8220;file not modified&#8221; header to help browser caching. (PHP caching only)</li>\n<li>Added French &amp; German translations, updated Italian translation and fixed translation strings.</li>\n<li>Sleep 4 seconds between preload urls to reduce load on the server</li>\n<li>Updated docs and FAQs.</li>\n</ul>\n<h3>0.9.9.5</h3>\n<ul>\n<li>Disable compression on on easy setup page. Still causes problems on some hosts.</li>\n<li>Remove footerlink on easy setup page.</li>\n<li>Don&#8217;t delete mod_rewrite rules when caching is disabled.</li>\n<li>Don&#8217;t stop users using settings page when in safe mode.</li>\n</ul>\n<h3>0.9.9.4</h3>\n<ul>\n<li>Settings page split into tabbed pages.</li>\n<li>Added new &#8220;Easy&#8221; settings page for new users.</li>\n<li>New PHP caching mode to serve supercached files.</li>\n<li>Mobile support fixes.</li>\n<li>Added Domain mapping support plugin.</li>\n<li>Added &#8220;awaiting moderation&#8221; plugin that removes that text from posts.</li>\n<li>Terminology change. Changed &#8220;half on&#8221; to &#8220;legacy caching&#8221;.</li>\n<li>Fixed cache tester on some installs of WordPress.</li>\n<li>Updated documentation</li>\n<li>Added $wp_super_cache_lock_down config variable to hide lockdown and directly cached pages admin items.</li>\n<li>Preloaded checks if it has stalled and reschedules the job to continue.</li>\n<li>Serve the gzipped page when first cached if the client supports compression.</li>\n<li>Lots more bug fixes..</li>\n</ul>\n<h3>0.9.9.3</h3>\n<ul>\n<li>Fixed division by zero error in half on mode.</li>\n<li>Always show &#8220;delete cache&#8221; button.</li>\n<li>Fixed &#8220;Update mod_rewrite rules&#8221; button.</li>\n<li>Minor text changes to admin page.</li>\n</ul>\n<h3>0.9.9.2</h3>\n<ul>\n<li>Forgot to change version number in wp-cache.php</li>\n</ul>\n<h3>0.9.9.1</h3>\n<ul>\n<li>Added preloading of static cache.</li>\n<li>Better mobile plugin support</li>\n<li>.htaccess rules can be updated now. Added wpsc_update_htaccess().</li>\n<li>Fixed &#8220;page on front&#8221; cache clearing bug.</li>\n<li>Check for wordpress_logged_in cookie so test cookie isn&#8217;t detected.</li>\n<li>Added clear_post_supercache() to clear supercache for a single post.</li>\n<li>Put quotes around rewrite rules in case paths have spaces.</li>\n</ul>\n<h3>0.9.9</h3>\n<ul>\n<li>Added experimental object cache support.</li>\n<li>Added Chinese(Traditional) translation by Pseric.</li>\n<li>Added FAQ on WP-Cache vs Supercache files.</li>\n<li>Use Supercache file if WP-Cache file not found. Useful if mod_rewrite rules are broken or not working.</li>\n<li>Get mobile browser list from WP Mobile Edition if found. Warn user if .htaccess out of date.</li>\n<li>Make sure writer lock is unlocked after writing cache files.</li>\n<li>Added link to developer docs in readme.</li>\n<li>Added Ukranian translation by Vitaly Mylo.</li>\n<li>Added Upgrade Notice section to readme.</li>\n<li>Warn if zlib compression in PHP is enabled.</li>\n<li>Added compression troubleshooting answer. Props Vladimir (http://blog.sjinks.pro/)</li>\n<li>Added Japanese translation by Tai (http://tekapo.com/)</li>\n<li>Updated Italian translation.</li>\n<li>Link to WP Mobile Edition from admin page for mobile support.</li>\n</ul>\n<h3>0.9.8</h3>\n<ul>\n<li>Added Spanish translation by Omi.</li>\n<li>Added Italian translation by Gianni Diurno.</li>\n<li>Addded advanced debug code to check front page for category problem. Enable by setting $wp_super_cache_advanced_debug to 1 in the config file.</li>\n<li>Fixed wordpress vs wordpress_logged_in cookie mismatch in cookie checking function.</li>\n<li>Correctly check if WP_CACHE is set or not. PHP is weird.</li>\n<li>Added wp_cache_clear_cache() to clear out cache directory.</li>\n<li>Only show logged in message when debugging enabled.</li>\n<li>Added troubleshooting point 20. PHP vs Apache user.</li>\n<li>Fixed problem deleting cache file.</li>\n<li>Don&#8217;t delete cache files when moderated comments are deleted.</li>\n</ul>\n<h3>0.9.7</h3>\n<ul>\n<li>Fixed problem with blogs in folders.</li>\n<li>Added cache file listing and delete links to admin page.</li>\n<li>Added &#8220;Newest Cached Pages&#8221; listing in sidebox.</li>\n<li>Made admin page translatable.</li>\n<li>Se ha agregado &#8220;¿Cómo puedo hacer que ciertas partes de la página se mantengan dinámicas?&#8221; a preguntas frecuentes.</li>\n<li>Advanced: added &#8220;late init&#8221; feature so that plugin activates on &#8220;init&#8221;. Set $wp_super_cache_late_init to true in config file to use.</li>\n<li>Disable supercaching when GET parameters present instead of disabling all caching. Disable on POST (as normal) and preview.</li>\n<li>Fixed problem with cron job and mutex filename.</li>\n<li>Warn users they must enable mobile device support if rewrite rules detected. Better detection of when to warn that .htaccess rules must be updated (no need when rewrite rules not present)</li>\n<li>Advanced: Added &#8220;wpsupercache_404&#8221; filter. Return true to cache 404 error pages.</li>\n<li>Use the wordpress_test_cookie in the cache key.</li>\n<li>Show correct number of cache files when compression off.</li>\n<li>Fixed problem with PHP safe_mode detection.</li>\n<li>Various bugfixes and documentation updates. See Changelog.txt</li>\n</ul>\n<h3>0.9.6.1</h3>\n<ul>\n<li>Move &#8220;not logged in&#8221; message init below check for POST.</li>\n<li>Add is_admin() check so plugin definitely can&#8217;t cache the backend.</li>\n<li>Add &#8220;do not cache&#8221; page type to admin page.</li>\n</ul>\n<h3>0.9.6</h3>\n<ul>\n<li>Add uninstall.php uninstall script.</li>\n<li>Updated cache/.htaccess rules (option to upgrade that)</li>\n<li>Added FAQ about category and static homepage problem.</li>\n<li>Add wp_cache_user_agent_is_rejected() back to wp-cache-phase2.php</li>\n<li>Show message for logged in users when caching disable for them.</li>\n<li>Check filemtime on correct supercache file</li>\n</ul>\n<h3>0.9.5</h3>\n<ul>\n<li>Show next and last GC times in minutes, not local time.</li>\n<li>Don&#8217;t serve wp_cache cache files to rejected user agents. Supercache files are still served to them.</li>\n<li>If enabled, mobile support now serves php cached files to mobile clients and static cached files to everyone else.</li>\n<li>Added checks for &#8220;WPSC_DISABLE_COMPRESSION&#8221; and &#8220;WPSC_DISABLE_LOCKING&#8221; constants to disable compression and file locking. For hosting companies primarily.</li>\n<li>Added check for DONOTCACHEPAGE constant to avoid caching a page.</li>\n<li>Use PHP_DOCUMENT_ROOT when creating .htaccess if necessary.</li>\n</ul>\n<h3>0.9.4.3</h3>\n<ol>\n<li>Added &#8220;Don&#8217;t cache for logged in users&#8221; option.</li>\n<li>Display file size stats on admin page.</li>\n<li>Clear the cache when profile page is updated.</li>\n<li>Don&#8217;t cache post previews.</li>\n<li>Added backslashes to rejected URI regex list.</li>\n<li>Corregidos problemas con entradas y comentarios que no se refrescaban.</li>\n</ol>\n\";}s:17:\"short_description\";s:83:\"Un motor de caché para WordPress muy rápido que produce archivos html estáticos.\";s:13:\"download_link\";s:63:\"https://downloads.wordpress.org/plugin/wp-super-cache.1.5.9.zip\";s:11:\"screenshots\";a:0:{}s:4:\"tags\";a:5:{s:5:\"cache\";s:5:\"cache\";s:7:\"caching\";s:7:\"caching\";s:11:\"performance\";s:11:\"performance\";s:8:\"wp-cache\";s:8:\"WP Cache\";s:14:\"wp-super-cache\";s:14:\"WP Super Cache\";}s:8:\"versions\";a:84:{s:3:\"0.1\";s:61:\"https://downloads.wordpress.org/plugin/wp-super-cache.0.1.zip\";s:3:\"0.2\";s:61:\"https://downloads.wordpress.org/plugin/wp-super-cache.0.2.zip\";s:3:\"0.3\";s:61:\"https://downloads.wordpress.org/plugin/wp-super-cache.0.3.zip\";s:5:\"0.3.1\";s:63:\"https://downloads.wordpress.org/plugin/wp-super-cache.0.3.1.zip\";s:3:\"0.4\";s:61:\"https://downloads.wordpress.org/plugin/wp-super-cache.0.4.zip\";s:3:\"0.5\";s:61:\"https://downloads.wordpress.org/plugin/wp-super-cache.0.5.zip\";s:5:\"0.5.1\";s:63:\"https://downloads.wordpress.org/plugin/wp-super-cache.0.5.1.zip\";s:5:\"0.5.2\";s:63:\"https://downloads.wordpress.org/plugin/wp-super-cache.0.5.2.zip\";s:5:\"0.5.3\";s:63:\"https://downloads.wordpress.org/plugin/wp-super-cache.0.5.3.zip\";s:5:\"0.6.2\";s:63:\"https://downloads.wordpress.org/plugin/wp-super-cache.0.6.2.zip\";s:5:\"0.6.3\";s:63:\"https://downloads.wordpress.org/plugin/wp-super-cache.0.6.3.zip\";s:5:\"0.6.4\";s:63:\"https://downloads.wordpress.org/plugin/wp-super-cache.0.6.4.zip\";s:5:\"0.6.5\";s:63:\"https://downloads.wordpress.org/plugin/wp-super-cache.0.6.5.zip\";s:5:\"0.6.6\";s:63:\"https://downloads.wordpress.org/plugin/wp-super-cache.0.6.6.zip\";s:5:\"0.6.7\";s:63:\"https://downloads.wordpress.org/plugin/wp-super-cache.0.6.7.zip\";s:5:\"0.6.8\";s:63:\"https://downloads.wordpress.org/plugin/wp-super-cache.0.6.8.zip\";s:3:\"0.7\";s:61:\"https://downloads.wordpress.org/plugin/wp-super-cache.0.7.zip\";s:5:\"0.7.1\";s:63:\"https://downloads.wordpress.org/plugin/wp-super-cache.0.7.1.zip\";s:3:\"0.8\";s:61:\"https://downloads.wordpress.org/plugin/wp-super-cache.0.8.zip\";s:5:\"0.8.1\";s:63:\"https://downloads.wordpress.org/plugin/wp-super-cache.0.8.1.zip\";s:5:\"0.8.2\";s:63:\"https://downloads.wordpress.org/plugin/wp-super-cache.0.8.2.zip\";s:5:\"0.8.3\";s:63:\"https://downloads.wordpress.org/plugin/wp-super-cache.0.8.3.zip\";s:5:\"0.8.4\";s:63:\"https://downloads.wordpress.org/plugin/wp-super-cache.0.8.4.zip\";s:5:\"0.8.5\";s:63:\"https://downloads.wordpress.org/plugin/wp-super-cache.0.8.5.zip\";s:5:\"0.8.6\";s:63:\"https://downloads.wordpress.org/plugin/wp-super-cache.0.8.6.zip\";s:5:\"0.8.7\";s:63:\"https:/