INSERT INTO `wp_amorlibre_n_1_options` (`option_id`, `option_name`, `option_value`, `autoload`) VALUES
(15850, '_site_transient_timeout_loopia_plugin_api_easy-wp-smtp', '1518560990', 'no'),
(15851, '_site_transient_loopia_plugin_api_easy-wp-smtp', 'O:8:\"stdClass\":27:{s:4:\"name\";s:12:\"Easy WP SMTP\";s:4:\"slug\";s:12:\"easy-wp-smtp\";s:7:\"version\";s:5:\"1.3.5\";s:6:\"author\";s:51:\"<a href=\"https://wp-ecommerce.net/\">wpecommerce</a>\";s:14:\"author_profile\";s:42:\"https://profiles.wordpress.org/wpecommerce\";s:8:\"requires\";s:3:\"4.3\";s:6:\"tested\";s:5:\"4.9.4\";s:12:\"requires_php\";b:0;s:6:\"rating\";d:88;s:7:\"ratings\";a:5:{i:5;i:98;i:4;i:5;i:3;i:4;i:2;i:2;i:1;i:14;}s:11:\"num_ratings\";i:123;s:15:\"support_threads\";i:20;s:24:\"support_threads_resolved\";i:13;s:15:\"active_installs\";i:200000;s:10:\"downloaded\";i:1607753;s:12:\"last_updated\";s:21:\"2018-01-19 9:43am GMT\";s:5:\"added\";s:10:\"2013-04-17\";s:8:\"homepage\";s:106:\"https://wp-ecommerce.net/easy-wordpress-smtp-send-emails-from-your-wordpress-site-using-a-smtp-server-2197\";s:8:\"sections\";a:5:{s:11:\"description\";s:3390:\"<p>Easy WP SMTP te permite configurar y enviar todos los correos electrónicos salientes a través de un servidor SMTP. Esto evitará que tus correos electrónicos entren en la carpeta de correo electrónico no deseado / spam de los destinatarios.</p>\n<h4>Características de Easy WP SMTP</h4>\n<ul>\n<li>Envía correo electrónico usando un servidor SMTP.</li>\n<li>Puedes usar el servidor SMTP de Gmail, Yahoo o de Hotmail si tienes una cuenta con ellos.</li>\n<li>Conecta sin problema tu blog de WordPress con un servidor de correo para gestionar todos los correos electrónicos salientes (es como si el correo electrónico se haya escrito dentro de tu cuenta de correo).</li>\n<li>Entrega de manera segura mensajes de correo electrónico a tus destinatarios.</li>\n<li>Opción para activar el registro de depuración para ver si los correos electrónicos se envían con éxito o no.</li>\n<li>Capacidad de especificar una dirección de correo electrónico de respuesta.</li>\n</ul>\n<h4>Uso del plugin Easy WP SMTP</h4>\n<p>Una vez que hayas instalado el plugin, hay algunas opciones que debes configurar en los ajustes del plugin (ves a <code>Ajustes-&gt;Easy WP SMTP</code> desde tu escritorio de WordPress).</p>\n<p><strong>a)</strong> Ajustes generales de Easy WP SMTP</p>\n<p>La sección de ajustes generales consiste en las siguientes opciones</p>\n<ul>\n<li>Desde la dirección de correo electrónico: la dirección de correo electrónico que se utilizará para enviar correos electrónicos a tus destinatarios</li>\n<li>Nombre de remitente: El nombre que tus destinatarios verán como parte del valor &#8220;De&#8221; o &#8220;Remitente&#8221; cuando reciban tu mensaje</li>\n<li>SMTP Host: Tu servidor de correo saliente (ejemplo: smtp.gmail.com)</li>\n<li>Tipo de cifrado: ninguno/SSL/TLS</li>\n<li>Puerto SMTP: El puerto que se utilizará para retransmitir el correo saliente a tu servidor de correo (ejemplo: 465)</li>\n<li>Identificación SMTP: No/Sí (Esta opción siempre debe estar marcada &#8220;Sí&#8221;)</li>\n<li>Nombre de usuario: El nombre de usuario que utilizas para acceder a tu servidor de correo</li>\n<li>Contraseña: La contraseña que utilizas para el acceso a tu servidor de correo</li>\n</ul>\n<p>Para obtener una documentación detallada sobre cómo configurar estas opciones, visita la página del plugin <a href=\"https://wp-ecommerce.net/easy-wordpress-smtp-send-emails-from-your-wordpress-site-using-a-smtp-server-2197\" rel=\"nofollow\">Easy WordPress SMTP</a> </p>\n<p><strong>b)</strong> Pruebas de Easy WP SMTP &amp; Ajustes de depuración</p>\n<p>Esta sección te permite realizar algunas pruebas de correo electrónico para asegurarte de que su sitio de WordPress está listo para retransmitir todos los correos electrónicos salientes a tu servidor SMTP configurado. Se compone de las siguientes opciones:</p>\n<ul>\n<li>Para: La dirección de correo electrónico que se utilizará para enviar correos electrónicos a tus destinatarios</li>\n<li>Asunto: El asunto de tu mensaje</li>\n<li>Mensaje: Una área de texto para escribir tu mensaje de prueba.</li>\n</ul>\n<p>Una vez que haces clic en el botón &#8220;Enviar correo electrónico de prueba&#8221;, el plugin intentará enviar un correo electrónico al destinatario especificado en el campo &#8220;Para&#8221;. Inspirado por <a href=\"https://es.wordpress.org/plugins/wp-mail-smtp/\" rel=\"nofollow\">WP Mail SMTP</a></p>\n\";s:12:\"installation\";s:357:\"<ol>\n<li>Haz clic en Añadir nuevo en la pantalla de plugins de tu área de administrador de WordPress</li>\n<li>Haz clic en la pestaña de Subir plugin</li>\n<li>Busca el archivo del plugin (easy-wp-smtp.zip)</li>\n<li>Haz clic en Instalar ahora y luego activa el plugin</li>\n<li>Ahora, ves al menú de ajustes del plugin y sigue las instrucciones</li>\n</ol>\n\";s:3:\"faq\";s:522:\"\n<h4>Instrucciones de instalación</h4>\n<p>\n<ol>\n<li>Haz clic en Añadir nuevo en la pantalla de plugins de tu área de administrador de WordPress</li>\n<li>Haz clic en la pestaña de Subir plugin</li>\n<li>Busca el archivo del plugin (easy-wp-smtp.zip)</li>\n<li>Haz clic en Instalar ahora y luego activa el plugin</li>\n<li>Ahora, ves al menú de ajustes del plugin y sigue las instrucciones</li>\n</ol>\n</p>\n<h4>¿Se puede utilizar este plugin para enviar correos electrónicos a través de SMTP?</h4>\n<p>\n<p>Sí.</p>\n</p>\n\n\";s:9:\"changelog\";s:7805:\"<h4>1.3.5</h4>\n<ul>\n<li>Añadida una opción configurable para forzar el reemplazo del nombre del remitente. Antes el plugin forzaba a reemplazarlo, ahora puedes configurarlo (gracias a daymobrew).</li>\n</ul>\n<h4>1.3.4</h4>\n<ul>\n<li>Arreglado que la opción &#8220;Permitir certificados SSL inseguros&#8221; era ignorada (gracias a bogesman).</li>\n<li>Añadida explicación del genérico utilizado en el campo de contraseña SMTP.</li>\n<li>Añadido enlace al foro de soporte.</li>\n<li>Algunas pequeñas mejoras a la página de ajustes.</li>\n</ul>\n<h4>1.3.3</h4>\n<ul>\n<li>Añadida opción para permitir certificados SSL inseguros en el servidor SMTP (gracias a ravipatel y bradclarke365).</li>\n<li>Cambiar los campos en la pestaña Correo electrónico de prueba no muestra el aviso &#8220;Tienes ajustes no guardados&#8221;.</li>\n<li>El plugin es compatible de nuevo con la versión 4.3+ de WP (gracias a lucrus por informar).</li>\n</ul>\n<h4>1.3.2</h4>\n<ul>\n<li>Esperemos haber arreglado la incapacidad del plugin para guardar la configuración en algunas circunstancias (gracias a todos los que siguieron informando sobre este problema).</li>\n<li>El plugin ya no falla si la extensión de PHP mbsrting no está instalada en el servidor.</li>\n<li>La página de ajustes ahora utiliza pestañas.</li>\n<li>Se ha arreglado los ajustes por defecto que no se establecieron con la activación del plugin.</li>\n<li>Arregladas algunas lineas que no se podían traducir a otros idiomas (gracias a jranavas).</li>\n</ul>\n<h4>1.3.1</h4>\n<ul>\n<li>Arreglado un error potencial con las contraseñas que tienen caracteres especiales.</li>\n<li>Comprueba si las variables están configuradas antes de interactuar con ellas (elimina avisos de PHP cuando el modo de depuración de WP está activado) (gracias a rubas y matward).</li>\n<li>El cuerpo del mensaje de correo electrónico de prueba ya no tiene un exceso de barras (gracias a tdcsforeveryone).</li>\n<li>Añadida opción para bloquear TODOS los correos electrónicos si la opción de chequeo de dominio está activada y la comprobación de dominio falla (gracias a erikmolenaar).</li>\n</ul>\n<h4>1.3.0</h4>\n<ul>\n<li>El plugin muestra un mensaje de error cuando haces clic en &#8220;Borrar registro&#8221; si no tiene permisos de escritura sobre el fichero de registro.</li>\n<li>La contraseña real de SMTP se reemplaza por asteriscos en la página de ajustes.</li>\n<li>Arreglado un fallo menor en la gestión de de la opción Reply-To (gracias a arildur).</li>\n<li>Algunas mejoras en las opciones para desarrolladores (gracias a erikmolenaar).</li>\n</ul>\n<h4>1.2.9</h4>\n<ul>\n<li>Añadida una opción de ajuste adicional para tratar los alias de correo electrónico (gracias a bradclarke365).</li>\n<li>Se corrigió la opción &#8220;Responder a&#8221;, que no se guardaba si estaba en blanco.</li>\n</ul>\n<h4>1.2.8</h4>\n<ul>\n<li>Nueva opción de ajustes para especificar una dirección de correo electrónico de respuesta.</li>\n<li>Hay una nueva opción de ajuste para activar el registro de depuración.</li>\n</ul>\n<h4>1.2.7</h4>\n<ul>\n<li>Se agregó información adicional de depuración (cuando se utiliza la función de correo electrónico de prueba). Esta información de depuración mostrará más detalles si algo falla. Esto será útil para depurar el error de conexión SMTP en tu servidor.</li>\n</ul>\n<h4>1.2.6</h4>\n<ul>\n<li>Algunos caracteres especiales en el campo de contraseña fueron eliminados cuando se realizó la desinfección del texto. Esto ha sido mejorado.</li>\n<li>Los ajustes de configuración no se eliminaran si has desactivado el plugin. Esto evitará la pérdida de configuración si desactivas accidentalmente el plugin.</li>\n</ul>\n<h4>1.2.5</h4>\n<ul>\n<li>Se ha corregido posible vulnerabilidad XSS con el asunto del correo electrónico y los campos de entrada del cuerpo del correo electrónico.</li>\n</ul>\n<h4>1.2.4</h4>\n<ul>\n<li>Mejora de la interfaz de administración.</li>\n<li>Los detalles del correo electrónico de prueba ahora se guardan después de usarlo. Por lo tanto, no necesitas escribirlo cada vez que quieras enviar un correo electrónico de prueba.</li>\n</ul>\n<h4>1.2.3</h4>\n<ul>\n<li>Easy WP SMTP ahora es compatible con WordPress 4.5.</li>\n</ul>\n<h4>1.2.2</h4>\n<ul>\n<li>Easy WP SMTP ahora es compatible con WordPress 4.4.</li>\n</ul>\n<h4>1.2.1</h4>\n<ul>\n<li>Establezca SMTPAutoTLS como falso por defecto, ya que podría causar problemas si el servidor está publicitando TLS con un certificado no válido.</li>\n<li>Muestra un mensaje de error cerca de la parte superior de las páginas de administración si las credenciales SMTP no están configuradas.</li>\n</ul>\n<h4>1.2.0</h4>\n<ul>\n<li>Establece el conjunto de caracteres de correo electrónico en UTF-8 para la funcionalidad de correo electrónico de prueba.</li>\n<li>Ejecutar comprobaciones adicionales en la contraseña sólo si mbstring está activado en el servidor. Esto debería solucionar el problema con el campo de entrada de contraseña que no aparece en algunos servidores.</li>\n</ul>\n<h4>1.1.9</h4>\n<ul>\n<li>Easy SMTP ahora es compatible con WordPress 4.3</li>\n</ul>\n<h4>1.1.8</h4>\n<ul>\n<li>Easy SMTP ahora elimina las barras del campo &#8220;Nombre de remitente&#8221;.</li>\n</ul>\n<h4>1.1.7</h4>\n<ul>\n<li>Hechas algunas mejoras en la opción de codificación.</li>\n</ul>\n<h4>1.1.7</h4>\n<ul>\n<li>Hechas algunas mejoras en la opción de codificación.</li>\n</ul>\n<h4>1.1.6</h4>\n<ul>\n<li>Se han corregido algunos problemas de codificación de caracteres de la funcionalidad de correo electrónico de prueba</li>\n<li>El plugin ahora forzará el nombre del remitente y la dirección de correo electrónico guardados en la configuración (al igual que la versión 1.1.1)</li>\n</ul>\n<h4>1.1.5</h4>\n<ul>\n<li>Se ha corregido un error en los ajustes del plugin</li>\n<li>La contraseña de SMTP ahora está codificada antes de guardarla en la tabla wp_options</li>\n</ul>\n<h4>1.1.4</h4>\n<ul>\n<li>El plugin ahora también anulará el valor por defecto de nombre del remitente y correo electrónico (WordPress)</li>\n</ul>\n<h4>1.1.3</h4>\n<ul>\n<li>Eliminado el atributo &#8220;Responder a&#8221; ya que estaba causando problemas de compatibilidad con algunos plugins de formularios</li>\n</ul>\n<h4>1.1.2</h4>\n<ul>\n<li>El atributo &#8220;Responder a&#8221; se establecerá al enviar un correo electrónico</li>\n<li>El plugin sólo anulará &#8220;Correo del remitente&#8221; y &#8220;Nombre&#8221; si no están presentes</li>\n</ul>\n<h4>1.1.1</h4>\n<ul>\n<li>Se ha corregido un problema por el que el CSS del plug-in estaba afectando a otros campos de entrada en la parte de administración.</li>\n</ul>\n<h4>1.1.0</h4>\n<ul>\n<li>El aviso de &#8220;Los ajustes se han cambiado&#8221; sólo se muestra si se cambia un campo de entrada</li>\n</ul>\n<h4>1.0.9</h4>\n<ul>\n<li>Se ha corregido algunos errores en la configuración SMTP y la funcionalidad de correo</li>\n</ul>\n<h4>1.0.8</h4>\n<ul>\n<li>El plugin ahora funciona con WordPress 3.9. </li>\n</ul>\n<h4>1.0.7</h4>\n<ul>\n<li>El plugin ahora funciona con WordPress 3.8. </li>\n</ul>\n<h4>1.0.6</h4>\n<ul>\n<li>El plugin ahora es compatible con WordPress 3.7.</li>\n</ul>\n<h4>1.0.5</h4>\n<ul>\n<li>El texto &#8220;Responder a&#8221; ya no se agregará al encabezado del correo electrónico</li>\n<li>A partir de ahora el campo Nombre de remitente puede contener comillas. Ya no se convertirá en &#8216;\\&#8217;</li>\n</ul>\n<h4>1.0.4</h4>\n<ul>\n<li>El plugin ahora es compatible con WordPress 3.6.</li>\n</ul>\n<h4>1.0.3</h4>\n<ul>\n<li>Se agregó una nueva opción a la configuración que permite al usuario activar/desactivar la depuración SMTP</li>\n</ul>\n<h4>1.0.2</h4>\n<ul>\n<li>Se ha corregido un error en el que se estaba mostrando la salida de depuración en la portada</li>\n</ul>\n<h4>1.0.1</h4>\n<ul>\n<li>Primera versión del plugin</li>\n</ul>\n\";s:11:\"screenshots\";s:180:\"<ol><li><a href=\"https://ps.w.org/easy-wp-smtp/trunk/screenshot-1.png?rev=1805640\"><img src=\"https://ps.w.org/easy-wp-smtp/trunk/screenshot-1.png?rev=1805640\" alt=\"\"></a></li></ol>\";}s:17:\"short_description\";s:101:\"Envía fácilmente correos electrónicos desde tu blog de WordPress usando tu servidor SMTP preferido\";s:13:\"download_link\";s:55:\"https://downloads.wordpress.org/plugin/easy-wp-smtp.zip\";s:11:\"screenshots\";a:1:{i:1;a:2:{s:3:\"src\";s:64:\"https://ps.w.org/easy-wp-smtp/trunk/screenshot-1.png?rev=1805640\";s:7:\"caption\";s:0:\"\";}}s:4:\"tags\";a:5:{s:4:\"mail\";s:4:\"mail\";s:9:\"phpmailer\";s:9:\"phpmailer\";s:4:\"smtp\";s:4:\"smtp\";s:14:\"wordpress-smtp\";s:14:\"wordpress smtp\";s:7:\"wp_mail\";s:7:\"wp_mail\";}s:8:\"versions\";a:22:{s:5:\"1.0.1\";s:61:\"https://downloads.wordpress.org/plugin/easy-wp-smtp.1.0.1.zip\";s:5:\"1.0.2\";s:61:\"https://downloads.wordpress.org/plugin/easy-wp-smtp.1.0.2.zip\";s:5:\"1.0.3\";s:61:\"https://downloads.wordpress.org/plugin/easy-wp-smtp.1.0.3.zip\";s:5:\"1.0.4\";s:61:\"https://downloads.wordpress.org/plugin/easy-wp-smtp.1.0.4.zip\";s:5:\"1.0.5\";s:61:\"https://downloads.wordpress.org/plugin/easy-wp-smtp.1.0.5.zip\";s:5:\"1.0.6\";s:61:\"https://downloads.wordpress.org/plugin/easy-wp-smtp.1.0.6.zip\";s:5:\"1.0.7\";s:61:\"https://downloads.wordpress.org/plugin/easy-wp-smtp.1.0.7.zip\";s:5:\"1.0.8\";s:61:\"https://downloads.wordpress.org/plugin/easy-wp-smtp.1.0.8.zip\";s:5:\"1.0.9\";s:61:\"https://downloads.wordpress.org/plugin/easy-wp-smtp.1.0.9.zip\";s:5:\"1.1.0\";s:61:\"https://downloads.wordpress.org/plugin/easy-wp-smtp.1.1.0.zip\";s:5:\"1.1.9\";s:61:\"https://downloads.wordpress.org/plugin/easy-wp-smtp.1.1.9.zip\";s:5:\"1.2.0\";s:61:\"https://downloads.wordpress.org/plugin/easy-wp-smtp.1.2.0.zip\";s:5:\"1.2.1\";s:61:\"https://downloads.wordpress.org/plugin/easy-wp-smtp.1.2.1.zip\";s:5:\"1.2.2\";s:61:\"https://downloads.wordpress.org/plugin/easy-wp-smtp.1.2.2.zip\";s:5:\"1.2.3\";s:61:\"https://downloads.wordpress.org/plugin/easy-wp-smtp.1.2.3.zip\";s:5:\"1.2.4\";s:61:\"https://downloads.wordpress.org/plugin/easy-wp-smtp.1.2.4.zip\";s:5:\"1.2.7\";s:61:\"https://downloads.wordpress.org/plugin/easy-wp-smtp.1.2.7.zip\";s:5:\"1.2.9\";s:61:\"https://downloads.wordpress.org/plugin/easy-wp-smtp.1.2.9.zip\";s:5:\"1.3.0\";s:61:\"https://downloads.wordpress.org/plugin/easy-wp-smtp.1.3.0.zip\";s:5:\"1.3.1\";s:61:\"https://downloads.wordpress.org/plugin/easy-wp-smtp.1.3.1.zip\";s:5:\"1.3.2\";s:61:\"https://downloads.wordpress.org/plugin/easy-wp-smtp.1.3.2.zip\";s:5:\"1.3.3\";s:61:\"https://downloads.wordpress.org/plugin/easy-wp-smtp.1.3.3.zip\";}s:11:\"donate_link\";s:106:\"https://wp-ecommerce.net/easy-wordpress-smtp-send-emails-from-your-wordpress-site-using-a-smtp-server-2197\";s:5:\"icons\";a:1:{s:2:\"1x\";s:65:\"https://ps.w.org/easy-wp-smtp/assets/icon-128x128.png?rev=1242044\";}s:12:\"contributors\";a:0:{}}', 'no'),
(15852, '_site_transient_timeout_loopia_plugin_api_really-simple-ssl', '1518560990', 'no'),
(15853, '_site_transient_loopia_plugin_api_really-simple-ssl', 'O:8:\"stdClass\":27:{s:4:\"name\";s:17:\"Really Simple SSL\";s:4:\"slug\";s:17:\"really-simple-ssl\";s:7:\"version\";s:6:\"2.5.25\";s:6:\"author\";s:64:\"<a href=\"https://really-simple-plugins.com\">Rogier Lankhorst</a>\";s:14:\"author_profile\";s:46:\"https://profiles.wordpress.org/rogierlankhorst\";s:8:\"requires\";s:3:\"4.2\";s:6:\"tested\";s:5:\"4.9.4\";s:12:\"requires_php\";b:0;s:6:\"rating\";d:96;s:7:\"ratings\";a:5:{i:5;i:321;i:4;i:5;i:3;i:2;i:2;i:2;i:1;i:13;}s:11:\"num_ratings\";i:343;s:15:\"support_threads\";i:34;s:24:\"support_threads_resolved\";i:32;s:15:\"active_installs\";i:700000;s:10:\"downloaded\";i:3438257;s:12:\"last_updated\";s:22:\"2018-02-08 11:02am GMT\";s:5:\"added\";s:10:\"2015-03-15\";s:8:\"homepage\";s:33:\"https://www.really-simple-ssl.com\";s:8:\"sections\";a:5:{s:11:\"description\";s:2943:\"<p>El plugin Really Simple SSL detecta automáticamente tus ajustes y configura tu web para que funcione en https.<br />\nPara hacer que sea ligero se han mantenido las opciones al mínimo. Todo el sitio se moverá a SSL.</p>\n<h4>Tres simples pasos para configurarlo:</h4>\n<ul>\n<li>Consigue un certificado SSL (no podemos hacerlo por ti, lo sentimos).</li>\n<li>Activa este plugin</li>\n<li>Activa SSL con un clic</li>\n</ul>\n<p>Always backup before you go! If you do not have a sound backup policy, start having one! See https://really-simple-ssl.com/knowledge-base/backing-up-your-site/ for our recommendations.</p>\n<p>¡Really Simple SSL está también en <a href=\"https://github.com/rlankhorst/really-simple-ssl\" rel=\"nofollow\">GitHub</a>!</p>\n<h4>¿Te encanta Really Simple SSL?</h4>\n<p>Afortunadamente este plugin te ahorra unas cuantas horas de trabajo. Si quieres apoyar el desarrollo continuo de este plugin podrías considerar comprar el <a href=\"https://www.really-simple-ssl.com/pro/\" rel=\"nofollow\">premium</a>, que incluye<br />\nalgunas características chulas.</p>\n<h4>Características pro</h4>\n<ul>\n<li>El escaneado de contenido mixto, que t muestra lo que tienes que hacer si no tienes aún el candado verde</li>\n<li>La opción de activar HTTP Strict Transport Security</li>\n<li>La opción de configurar tu sitio para la lista de precarga de HSTS</li>\n<li>Solucionador de contenido mixto en la administración</li>\n<li>Respuestas más detalladas en la página de configuración.</li>\n<li>Certificate expiration check: get an email when your SSL certificate is about to expire.</li>\n<li>Soporte premium</li>\n</ul>\n<h4>Qué hace el plugin en realidad</h4>\n<ul>\n<li>The plugin handles most issues that WordPress has with SSL, like when you&#8217;re behind a reverse proxy/loadbalancer, or when no headers are passed which WordPress can use to detect SSL.</li>\n<li>Todas las peticiones entrantes se redirigen a https. Por defecto mediante una redirección interna de WordPress, pero también puedes activar la redirección de .htaccess.</li>\n<li>La url del sitio y la url de portada se cambian a https.</li>\n<li>Tu contenido inseguro se repara reemplazando todas las urls http:// por https://, excepto enlaces a otros dominios. Se hace de manera dinámica, así que no se hacen cambios en la base de datos (excepto en el siteurl y homeurl).</li>\n</ul>\n<p><a href=\"https://www.really-simple-ssl.com/contact/\" rel=\"nofollow\">contact</a> me if you have any questions, issues, or suggestions. Really Simple SSL is developed by <a href=\"https://www.really-simple-plugins.com\" rel=\"nofollow\">Really Simple Plugins</a>.</p>\n<h4>¿Te gustaría tener este plugin en tu idioma?</h4>\n<p>Se pueden añadir muy fácilmente traducciones <a href=\"https://translate.wordpress.org/projects/wp-plugins/really-simple-ssl\" rel=\"nofollow\">aquí</a>. Si lo haces, puedo hacer que te añadan como editor de la traducción para aprobar las traducciones.</p>\n\";s:12:\"installation\";s:393:\"<p>Para instalar este plugin:</p>\n<ol>\n<li>¡Haz una copia de seguridad!</li>\n<li>Instala tu certificado SSL</li>\n<li>Descarga el plugin</li>\n<li>Sube el plugin al directorio wp-content/plugins.</li>\n<li>Ve a &#8220;plugins&#8221; en el admin de tu WordPress, luego haz clic en activar.</li>\n<li>Ahora verás un aviso pidiéndote que actives SSL. Haz clic en él y accede de nuevo.</li>\n</ol>\n\";s:3:\"faq\";s:2664:\"\n<h4>Instrucciones de instalación</h4>\n<p>\n<p>Para instalar este plugin:</p>\n<ol>\n<li>¡Haz una copia de seguridad!</li>\n<li>Instala tu certificado SSL</li>\n<li>Descarga el plugin</li>\n<li>Sube el plugin al directorio wp-content/plugins.</li>\n<li>Ve a &#8220;plugins&#8221; en el admin de tu WordPress, luego haz clic en activar.</li>\n<li>Ahora verás un aviso pidiéndote que actives SSL. Haz clic en él y accede de nuevo.</li>\n</ol>\n</p>\n<h4>Base de conocimiento</h4>\n<p>\n<p>Para obtener la documentación y explicaciones más detalladas sobre bucles de redirección, desactivación, contenido mixto, errores, etcétera, por favor busca en la <a href=\"https://www.really-simple-ssl.com/knowledge-base/\" rel=\"nofollow\">documentación</a></p>\n</p>\n<h4>¿Ralentizará mi sitio el reparador de contenido mixto?</h4>\n<p>\n<p>En un sitio en que el código tenga alrededor de 60.000 caracteres el retraso producido el reparador de contenido mixto puede estar en torno a los 0,00188 segundos. Si es demasiado para ti soluciona el contenido mixto por tu cuenta desactivándolo en los ajustes.</p>\n</p>\n<h4>Desinstalando Really Simple SSL</h4>\n<p>\n<p>El plugin comprueba tu certificado antes de activarse, pero si, por ejemplo, has migrado el sitio a un entorno sin ssl, puede que bloquearse la administración.<br />\n¡Si no puedes desactivarlo simplemente borra la carpeta del plugin para desinstalarlo! Sigue estas <a href=\"https://really-simple-ssl.com/knowledge-base/uninstall-websitebackend-not-accessible/\" rel=\"nofollow\">instrucciones</a>.</p>\n</p>\n<h4>Problemas con contenido mixto</h4>\n<p>\n<p>La mayoría de los problemas de contenido mixto los provocan urls en archivos css o js.<br />\nPara ver instrucciones en detalle de cómo encontrar contenido mixto lee este <a href=\"https://really-simple-ssl.com/knowledge-base/how-to-track-down-mixed-content-or-insecure-content/\" rel=\"nofollow\">artículo</a>.</p>\n</p>\n<h4>Problemas de bucle de redirección</h4>\n<p>\n<p>Si estás experimentando bucles de redirección en tu sitio prueba con estas <a href=\"https://really-simple-ssl.com/knowledge-base/my-website-is-in-a-redirect-loop/\" rel=\"nofollow\">instrucciones</a>.</p>\n</p>\n<h4>¿Es este plugin compatible con multisitio?</h4>\n<p>\n<p>Sí. Hay una página de ajustes de red específica en la que puedes cambiar entre SSL activo para la red o SSL por página. En la específica de la versión pro del plugin para multisitios puedes omitir los ajustes SSL de todos los sitios en la red, y puedes activar y desactivar SSL en cada sitio desde el menú de red.* Really Simple SSL mantiene una amplia base de conocimiento en https://www.really-simple-ssl.com.</p>\n</p>\n\n\";s:9:\"changelog\";s:18349:\"<h4>2.5.25</h4>\n<ul>\n<li>Fix: &#8220;switch mixed content fixer hook&#8221; option not visible on the multisites settings page</li>\n<li>Tweak: several typo&#8217;s and uppercasing</li>\n</ul>\n<h4>2.5.24</h4>\n<ul>\n<li>Fix: On multisite, admin_url forced current blog URL&#8217;s over http even when the current blog was loaded over https. This will now only force http for other blog_urls than the current one, when they are on http and not https.</li>\n</ul>\n<h4>2.5.23</h4>\n<ul>\n<li>Tested up to WP 4.9</li>\n<li>Added secure cookie notice</li>\n</ul>\n<h4>2.5.22</h4>\n<ul>\n<li>Changed mixed content fixer hook back from wp_print_footer_scripts to shutdown</li>\n</ul>\n<h4>2.5.21</h4>\n<ul>\n<li>Fixed double slash in paths to files</li>\n<li>Fixed typo in activation notice.</li>\n<li>Tweak: added option to not flush the rewrite rules</li>\n<li>Fix: prevent forcing admin_url to http when FORCE_SSL_ADMIN is defined</li>\n</ul>\n<h4>2.5.20</h4>\n<ul>\n<li>Tweak: constant RSSSL_DISMISS_ACTIVATE_SSL_NOTICE to allow users to hide notices.</li>\n<li>Tweak: setting to switch the mixed content fixer hook from template_redirect to init.</li>\n<li>Fix: nag in multisite didn&#8217;t dismiss properly</li>\n</ul>\n<h4>2.5.19</h4>\n<ul>\n<li>Multisite fix: due to a merge admin_url and site_url filters were dropped, re-added them</li>\n<li>Added constant RSSSL_CONTENT_FIXER_ON_INIT so users can keep on using the init hook for the mixed content fixer.</li>\n</ul>\n<h4>2.5.18</h4>\n<ul>\n<li>Tweak: Removed JetPack fix, as it is now incorporated in JetPack.</li>\n<li>Tweak: Moved mixed content fixer hook to template_redirect</li>\n<li>Fix: Changed flush rewrite rules hook from admin_init to shutdown, on activation of SSL.</li>\n<li>Multisite fix: Changed function which checks if admin_url and site_url should return http or https to check for https in home_url.</li>\n<li>Tweak: Explicitly excluded json and xmlrpc requests from the mixed content fixer</li>\n</ul>\n<h4>2.5.17</h4>\n<ul>\n<li>Tweak: Added a function where the home_url and site_url on multisite check if it should be http or https when SSL is enabled on a per site basis.</li>\n<li>Tweak: Added a notice that there will be no network menu when Really Simple SSL is activated per site.</li>\n<li>Tweak: Added hook for new multisite site so a new site will be activated as SSL when network wide is activated.</li>\n<li>Tweak: limited the JetPack listen on port 80 tweak to reverse proxy servers.</li>\n<li>Tweak: created a dedicated rest api redirect constant in case users want to prevent the rest api from redirecting to https.</li>\n<li>Fix: dismissal of SSL activated notice on multisite did not work properly</li>\n</ul>\n<h4>2.5.16</h4>\n<ul>\n<li>Reverted wp_safe_redirect to wp_redirect, as wp_safe_redirect causes a redirect to wp-login.php even when the primary url is domain.com and request url www.domain.com</li>\n</ul>\n<h4>2.5.15</h4>\n<ul>\n<li>No functional changes, version change because WordPress was not processing the version update</li>\n</ul>\n<h4>2.5.14</h4>\n<ul>\n<li>Fix: fixed issue in the mixed content fixer where on optimized html the match would match across elements.</li>\n<li>reemplazado wp_redirect con wp_safe_redirect</li>\n<li>Añadido forzar SSL en wp_rest_api</li>\n</ul>\n<h4>2.5.13</h4>\n<ul>\n<li>Tweak: configuration more function</li>\n</ul>\n<h4>2.5.12</h4>\n<ul>\n<li>Added multisite settings page</li>\n<li>Added filter for .htaccess code output</li>\n<li>Increased user capability to &#8220;activate_plugins&#8221;</li>\n<li>Added SSL_FORWARDED_PROTO = 1 in addition to SSL_FORWARDED_PROTO = on as supported SSL recognition variable.</li>\n</ul>\n<h4>2.5.11</h4>\n<ul>\n<li>Removed curl in favor of wp_remote_get</li>\n</ul>\n<h4>2.5.10</h4>\n<ul>\n<li>Fastest cache compatibility fix</li>\n</ul>\n<h4>2.5.9</h4>\n<ul>\n<li>Multisite tweaks</li>\n</ul>\n<h4>2.5.8</h4>\n<ul>\n<li>Removed automatic insertion of .htaccess redirects. The .htaccess redirects work fine for most people, but can cause issues in some edge cases.</li>\n<li>Added option to explicitly insert .htaccess redirect</li>\n<li>Added safe mode constant RSSSL_SAFE_MODE to enable activating in a minimized way</li>\n<li>Fix: RLRSSSL_DO_NOT_EDIT_HTACCESS constant did not override setting correctly when setting was used before.</li>\n<li>Dropped cache flushing on activation, as this does not always work as expected</li>\n</ul>\n<h4>2.5.7</h4>\n<ul>\n<li>Tweak: changes testurl to the function test_url()</li>\n</ul>\n<h4>2.5.6</h4>\n<ul>\n<li>version nr fix</li>\n</ul>\n<h4>2.5.5</h4>\n<ul>\n<li>Reverted some changes to 2.4.3, as it was causing issues for some users.</li>\n</ul>\n<h4>2.5.4</h4>\n<p>fix: Adjusted selection order of .htaccess rules, preventing redirect loops</p>\n<h4>2.5.3</h4>\n<ul>\n<li>Changed .htaccess redirects to use only one condition</li>\n</ul>\n<h4>2.5.2</h4>\n<ul>\n<li>removed file_get_contents function from class_url.php, as in some cases this causes issues.</li>\n</ul>\n<h4>2.5.1</h4>\n<ul>\n<li>Added help tooltips</li>\n<li>Fix: typos in explanations</li>\n<li>Added detected server to debug Log</li>\n<li>Added test folder for CloudFlare</li>\n<li>Added htaccess redirect to use all available server vars for checking SSL.</li>\n</ul>\n<h4>2.5.0</h4>\n<ul>\n<li>Tweak: Improved support for cloudflare</li>\n<li>Tweak: Added support for Cloudfront, thanks to Sharif Alexandre</li>\n<li>Fix: Prevent writing of empty .htaccess redirect</li>\n<li>Tweak: Added option for 301 internal wp redirect</li>\n<li>Tweak: Improved NGINX support</li>\n<li>Tweak: Added support for when only the $_ENV[HTTPS] variable is present</li>\n<li>Fix: Mixed content fixing of escaped URLS</li>\n</ul>\n<h4>2.4.3</h4>\n<ul>\n<li>Removed banner in admin</li>\n</ul>\n<h4>2.4.2</h4>\n<ul>\n<li>Tweak: Added reload over https link for when SSL was not detected</li>\n<li>Fixed: After reloading page when the .htaccess message shows, .htaccess is now rewritten.</li>\n<li>Tweak: Removed Yoast notices</li>\n<li>Tested for WP 4.7</li>\n<li>Fixed: bug where network options were not removed properly on deactivation</li>\n<li>Tweak: Changed mixed content marker to variation without quotes, to prevent issues with scripting etc.</li>\n</ul>\n<h4>2.4.1</h4>\n<ul>\n<li>Tweak: improved HSTS check</li>\n</ul>\n<h4>2.4.0</h4>\n<ul>\n<li>Fixed: added a version check on wp_get_sites / get_sites to get rid of deprecated function notice, and keep backward compatibility.</li>\n<li>Fixed: A bug in multisite where plugin_url returned a malformed url in case of main site containing a trailing slash, and subsite not. Thanks to @gahapati for reporting this bug.</li>\n<li>Tweak: Added button to settings page to enable SSL, for cases where another plugin is blocking admin notices.</li>\n<li>Tweak: Rebuilt the mixed content fixer, for better compatibility</li>\n<li>Tweak: Improved the mixed content marker on the front-end, so it&#8217;s less noticeable, and won&#8217;t get removed by minification code.</li>\n</ul>\n<h4>2.3.14</h4>\n<ul>\n<li>Fixed: Clearing of WP Rocket cache after SSL activation causing an error</li>\n<li>Fixed: Clearing of W3TC after SSL activation did not function properly</li>\n</ul>\n<h4>2.3.13</h4>\n<ul>\n<li>Re-inserted Jetpack fix.</li>\n</ul>\n<h4>2.3.12</h4>\n<ul>\n<li>Requires at least changed back to 4.2, as the function that this was meant for didn’t make it in current release yet.</li>\n</ul>\n<h4>2.3.11</h4>\n<ul>\n<li>Improved request method in url class</li>\n<li>Added check if .htaccess actually exists in htaccess_contains_redirect_rules()</li>\n<li>Made activation message more clear.</li>\n</ul>\n<h4>2.3.10</h4>\n<ul>\n<li>Tested for 4.6</li>\n<li>Tweak: changed check for htaccess redirect from checking the RSSSL comments to checking the redirect rule itself</li>\n<li>Fix: htaccess not writable message not shown anymore when SSL not yet enabled</li>\n<li>Tweak: extended mixed content fixer to cover actions in forms, as those should also be http in case of external urls.</li>\n<li>Tweak: added safe domain list for domains that get found but are no threat.</li>\n<li>Tweak: added filter for get_admin_url in multisite situations, where WP always returns an https url, although the site might not be on SSL</li>\n<li>Tweak: htaccess files and wpconfig are rewritten when the settings page is loaded</li>\n</ul>\n<h4>2.3.9</h4>\n<ul>\n<li>Fix: removed internal WordPress redirect as it causes issues for some users.</li>\n<li>Tweak: improved url request method</li>\n</ul>\n<h4>2.3.8</h4>\n<ul>\n<li>Tweak: Fallback redirect changed into internal wp redirect, which is faster</li>\n<li>Tweak: When no .htaccess rules are detected, redirect option is enabled automatically</li>\n<li>Tweak: Url request falls back to file_get_contents when curl does not give a result</li>\n</ul>\n<h4>2.3.7</h4>\n<ul>\n<li>Updated screenshots</li>\n</ul>\n<h4>2.3.6</h4>\n<ul>\n<li>Fixed: missing priority in template_include hook caused not activating mixed content fixer in some themes</li>\n</ul>\n<h4>2.3.5</h4>\n<ul>\n<li>Fixed: javascript redirect insertion</li>\n</ul>\n<h4>2.3.4</h4>\n<ul>\n<li>Tweak: load css stylesheet only on options page and before enabling ssl</li>\n<li>Tweak: mixed content fixer triggered by is_ssl(), which prevents fixing content on http.</li>\n<li>Start detection and configuration only for users with &#8220;manage_options&#8221; capability</li>\n</ul>\n<h4>2.3.3</h4>\n<ul>\n<li>Fixed bug in force-deactivate script</li>\n</ul>\n<h4>2.3.2</h4>\n<ul>\n<li>Changed SSL detection so test page is only needed when not currently on SSL.</li>\n<li>Some minor bug fixes.</li>\n</ul>\n<h4>2.3.1</h4>\n<ul>\n<li>Removed &#8220;activate ssl&#8221; option when no ssl is detected.</li>\n<li>Optimized emptying of cache</li>\n<li>Fixed some bugs in deactivation and activation of multisite</li>\n</ul>\n<h4>2.3.0</h4>\n<ul>\n<li>Gave more control over activation process by explicity asking to enable SSL.</li>\n<li>Added a notice if .htaccess is not writable</li>\n</ul>\n<h4>2.2.20</h4>\n<p>Fixed a bug in SSL detection</p>\n<h4>2.2.19</h4>\n<p>Changed followlocation in curl to an alternative method, as this gives issues when safemode or open_basedir is enabled.<br />\nAdded dismissable message when redirects cannot be inserted in the .htaccess</p>\n<h4>2.2.18</h4>\n<p>Fixed bug in logging of curl detection</p>\n<h4>2.2.17</h4>\n<p>Security fixes in ssl-test-page.php</p>\n<h4>2.2.16</h4>\n<p>Bugfix with of insecure content fixer.</p>\n<h4>2.2.13</h4>\n<p>Added a check if the mixed content fixer is functioning on the front end<br />\nFixed a bug where multisite per_site_activation variable wasn&#8217;t stored networkwide<br />\nAdded clearing of wp_rocket cache thans to Greg for suggesting this<br />\nAdded filter so you can remove the really simple ssl comment<br />\nFixed a bug in the output buffer usage, which resolves several issues.<br />\nAdded code so JetPack will run smoothly on SSL as well, thanks to Konstantin for suggesting this</p>\n<h4>2.2.12</h4>\n<ul>\n<li>To prevent lockouts, it is no longer possible to activate plugin when wp-config.php is not writable. In case of loadbalancers, activating ssl without adding the necessary fix in the wp-config would cause a redirect loop which would lock you out of the admin.</li>\n<li>Moved redirect above the WordPress rewrite rules in the htaccess file.</li>\n<li>Added an option to disable the fallback javascript redirection to https.</li>\n</ul>\n<h4>2.2.11</h4>\n<p>Brand new content fixer, which fixes all links on in the source of your website.</p>\n<h4>2.2.10</h4>\n<ul>\n<li>Roll back of mixed content fixer.</li>\n</ul>\n<h4>2.2.9</h4>\n<p>Improved the mixed content fixer. Faster and more effective.</p>\n<h4>2.2.8</h4>\n<p>Edited the wpconfig define check to prevent warnings when none are needed.</p>\n<h4>2.2.7</h4>\n<ul>\n<li>Extended detection of homeurl and siteurl constants in wp-config.php with regex to allow  for spaces in code.</li>\n<li>Changed text domain to make this plugin language packs ready</li>\n<li>Added 404 detection to SSL detection function, so subdomains can get checked properly on subdomain multisite installs</li>\n</ul>\n<h4>2.2.6</h4>\n<p>Added slash in redirect rule<br />\nsmall bugfixes</p>\n<h4>2.2.3</h4>\n<p>documentation update</p>\n<h4>2.2.2</h4>\n<ul>\n<li>Added multisite support for the missing https server variable issue</li>\n<li>Improved curl connection script</li>\n<li>Added French translation thanks to Cedric</li>\n</ul>\n<h4>2.2.1</h4>\n<ul>\n<li>Small bug fixes</li>\n</ul>\n<h4>2.2.0</h4>\n<ul>\n<li>Added per site activation for multisite, but excluded this option for subfolder installs.</li>\n<li>Added script to easily deactivate the plugin when you are locked out of the WordPress admin.</li>\n<li>Added support for a situation where no server variables are given which can indicate SSL, which can cause WordPress to generate errors and redirect loops.</li>\n<li>Removed warning on WooCommerce force SSL after checkout, as only unforce SSL seems to be causing problems</li>\n<li>Added Russian translation, thanks to xsascha</li>\n<li>Improved redirect rules in the .htaccess</li>\n<li>Added option te disable the plugin from editing the .htaccess in the settings</li>\n<li>Fixed a bug where multisite would not deactivate correctly</li>\n<li>Fixed a bug where insecure content scan would not scan custom post types</li>\n</ul>\n<h4>2.1.18</h4>\n<ul>\n<li>Made WooCommerce warning dismissable, as it does not seem to cause issues</li>\n<li>Fixed a bug caused by WP native plugin_dir_url() returning relative path, resulting in no SSL messages</li>\n</ul>\n<h4>2.1.17</h4>\n<ul>\n<li>Fixed a bug where example .htaccess rewrite rules weren&#8217;t generated correctly</li>\n<li>Added WooCommerce to the plugin conflicts handler, as some settings conflict with this plugin, and are superfluous when you force your site to SSL anyway.</li>\n<li>Excluded transients from mixed content scan results</li>\n</ul>\n<h4>2.1.16</h4>\n<ul>\n<li>Fixed a bug where script would fail because curl function was not installed.</li>\n<li>Added debug messages</li>\n<li>Improved FAQ, removed typos</li>\n<li>Replaced screenshots</li>\n</ul>\n<h4>2.1.15</h4>\n<ul>\n<li>Improved user interface with tabs</li>\n<li>Changed function to test SSL test page from file_get_contents to curl, as this improves response time, which might prevent &#8220;no SSL messages&#8221;</li>\n<li>Extended the mixed content fixer to replace src=&#8221;http:// links, as these should always be https on an SSL site.</li>\n<li>Added an error message in case of force rewrite titles in Yoast SEO plugin is used, as this prevents the plugin from fixing mixed content</li>\n</ul>\n<h4>2.1.14</h4>\n<ul>\n<li>Added support for loadbalancer and is_ssl() returning false: in that case a wp-config fix is needed.</li>\n<li>Improved performance</li>\n<li>Added debugging option, so a trace log can be viewed</li>\n<li>Fixed a bug where the rlrsssl_replace_url_args filter was not applied correctly.</li>\n</ul>\n<h4>2.1.13</h4>\n<ul>\n<li>Fixed an issue where in some configurations the replace url filter did not fire</li>\n</ul>\n<h4>2.1.12</h4>\n<ul>\n<li>Added the force SSL option, in cases where SSL could not be detected for some reason.</li>\n<li>Added a test to check if the proposed .htaccess rules will work in the current environment.</li>\n<li>Readded HSTS to the htaccess rules, but now as an option. Adding this should be done only when you are sure you do not want to revert back to http.</li>\n</ul>\n<h4>2.1.11</h4>\n<ul>\n<li>Improved instructions regarding uninstalling when locked out of back-end</li>\n</ul>\n<h4>2.1.10</h4>\n<ul>\n<li>Removed HSTS headers, because it is difficult to roll back.</li>\n</ul>\n<h4>2.1.9</h4>\n<ul>\n<li>Added the possibility to prevent htaccess from being edited, in case of redirect loop.</li>\n</ul>\n<h4>2.1.7</h4>\n<ul>\n<li>Refined SSL detection</li>\n<li>Bugfix on deactivation of plugin</li>\n</ul>\n<h4>2.1.6</h4>\n<ul>\n<li>Fixed an SSL detection issue which could lead to redirect loop</li>\n</ul>\n<h4>2.1.4</h4>\n<ul>\n<li>Improved redirect rules for .htaccess</li>\n</ul>\n<h4>2.1.3</h4>\n<ul>\n<li>Now plugin only changes .htaccess when one of three preprogrammed ssl types was recognized.</li>\n<li>Simplified filter use to add your own urls to replace, see f.a.q.</li>\n<li>Default javascript redirect when .htaccess redirect does not succeed</li>\n</ul>\n<h4>2.1.2</h4>\n<ul>\n<li>Fixed bug where number of options with mixed content was not displayed correctly</li>\n</ul>\n<h4>2.1.1</h4>\n<ul>\n<li>limited the number of files, posts and options that can be show at once in the mixed content scan.</li>\n</ul>\n<h4>2.1.0</h4>\n<ul>\n<li>Added version control to the .htaccess rules, so the .htaccess gets updated as well.</li>\n<li>Added detection of loadbalancer and cdn so .htaccess rules can be adapted accordingly. Fixes some redirect loop issues.</li>\n<li>Added the possibility to disable the auto replace of insecure links</li>\n<li>Added a scan to scan the website for insecure links</li>\n<li>Added detection of in wp-config.php defined siteurl and homeurl, which could prevent from successful url change.</li>\n<li>Dropped the force ssl option (used when not ssl detected)</li>\n<li>Thanks to Peter Tak, <a href=\"http://www.pta-security.nl/\" rel=\"nofollow\">PTA security</a> for mentioning the owasp security best practice https://www.owasp.org/index.php/HTTP_Strict_Transport_Security in .htaccess,</li>\n</ul>\n<h4>2.0.7</h4>\n<ul>\n<li>Added 301 redirect to .htaccess for seo purposes</li>\n</ul>\n<h4>2.0.3</h4>\n<ul>\n<li>Fixed some typos in readme</li>\n<li>added screenshots</li>\n<li>fixed a bug where on deactivation the https wasn&#8217;t removed from siturl and homeurl</li>\n</ul>\n<h4>2.0.0</h4>\n<ul>\n<li>Added SSL detection by opening a page in the plugin directory over https</li>\n<li>Added https redirection in .htaccess, when possible</li>\n<li>Added warnings and messages to improve user experience</li>\n<li>Added automatic change of siteurl and homeurl to https, to make backend ssl proof.</li>\n<li>Added caching flush support for WP fastest cache, Zen Cache and W3TC</li>\n<li>Fixed bug where siteurl was used as url to fix instead of homeurl</li>\n<li>Fixed issue where url was not replaced on front end, when used url in content is different from home url (e.g. http://www.domain.com as homeurl and http://domain.com in content)</li>\n<li>Added filter so you can add cdn urls to the replacement script</li>\n<li>Added googleapis.com/ajax cdn to standard replacement script, as it is often used without https.</li>\n</ul>\n<h4>1.0.3</h4>\n<ul>\n<li>Improved installation instructions</li>\n</ul>\n\";s:11:\"screenshots\";s:798:\"<ol><li><a href=\"https://ps.w.org/really-simple-ssl/assets/screenshot-1.jpg?rev=1426260\"><img src=\"https://ps.w.org/really-simple-ssl/assets/screenshot-1.jpg?rev=1426260\" alt=\"Después de la activación, si se detectó SSL, podrás activar SSL.\"></a><p>Después de la activación, si se detectó SSL, podrás activar SSL.</p></li><li><a href=\"https://ps.w.org/really-simple-ssl/assets/screenshot-2.jpg?rev=1426260\"><img src=\"https://ps.w.org/really-simple-ssl/assets/screenshot-2.jpg?rev=1426260\" alt=\"Ve tu configuración en la página de ajustes\"></a><p>Ve tu configuración en la página de ajustes</p></li><li><a href=\"https://ps.w.org/really-simple-ssl/assets/screenshot-3.jpg?rev=1230788\"><img src=\"https://ps.w.org/really-simple-ssl/assets/screenshot-3.jpg?rev=1230788\" alt=\"\"></a></li></ol>\";}s:17:\"short_description\";s:100:\"¡No hace falta configurarlo! Sólo necesitas un certificado SSL y este plugin hará todo lo demás.\";s:13:\"download_link\";s:67:\"https://downloads.wordpress.org/plugin/really-simple-ssl.2.5.25.zip\";s:11:\"screenshots\";a:3:{i:1;a:2:{s:3:\"src\";s:70:\"https://ps.w.org/really-simple-ssl/assets/screenshot-1.jpg?rev=1426260\";s:7:\"caption\";s:68:\"Después de la activación, si se detectó SSL, podrás activar SSL.\";}i:2;a:2:{s:3:\"src\";s:70:\"https://ps.w.org/really-simple-ssl/assets/screenshot-2.jpg?rev=1426260\";s:7:\"caption\";s:45:\"Ve tu configuración en la página de ajustes\";}i:3;a:2:{s:3:\"src\";s:70:\"https://ps.w.org/really-simple-ssl/assets/screenshot-3.jpg?rev=1230788\";s:7:\"caption\";s:0:\"\";}}s:4:\"tags\";a:5:{s:9:\"force-ssl\";s:9:\"force ssl\";s:5:\"https\";s:5:\"https\";s:16:\"insecure-content\";s:16:\"insecure content\";s:13:\"mixed-content\";s:13:\"mixed content\";s:3:\"ssl\";s:3:\"ssl\";}s:8:\"versions\";a:4:{s:6:\"2.5.23\";s:67:\"https://downloads.wordpress.org/plugin/really-simple-ssl.2.5.23.zip\";s:6:\"2.5.24\";s:67:\"https://downloads.wordpress.org/plugin/really-simple-ssl.2.5.24.zip\";s:6:\"2.5.25\";s:67:\"https://downloads.wordpress.org/plugin/really-simple-ssl.2.5.25.zip\";s:5:\"trunk\";s:60:\"https://downloads.wordpress.org/plugin/really-simple-ssl.zip\";}s:11:\"donate_link\";s:37:\"https://www.paypal.me/reallysimplessl\";s:5:\"icons\";a:1:{s:2:\"1x\";s:70:\"https://ps.w.org/really-simple-ssl/assets/icon-128x128.png?rev=1782452\";}s:12:\"contributors\";a:0:{}}', 'no'),
