(57, 1, '2018-02-12 22:06:40', '2018-02-12 21:06:40', '<p>Solo/sola, en compañia o lo que sea que te apetezca.</p>\n<p>Despedida de soltero o de soltera, tenemos todo lo que necesitas.</p>\n<p>Mira nuestro catálogo. ¡Disfrutar!</p>\n\n&nbsp;\n\n&nbsp;\n\n&nbsp;\n\n<p>Solo, together or whatever you feel like.</p>\n<p>Bachelor or bachelorette party, we have all you need.</p>\n<p>Check out our shop. Enjoy!</p>', 'Bienvenid@s / Welcome / Välkommen', '', 'inherit', 'closed', 'closed', '', '26-autosave-v1', '', '', '2018-02-12 22:06:40', '2018-02-12 21:06:40', '', 26, 'http://amorlibre.net/26-autosave-v1/', 0, 'revision', '', 0),
(58, 1, '2018-01-22 18:46:29', '2018-01-22 18:46:29', '<span style=\"font-family: -apple-system, BlinkMacSystemFont, \'Segoe UI\', Roboto, Oxygen-Sans, Ubuntu, Cantarell, \'Helvetica Neue\', sans-serif;\">Welcome to Amor Libre!</span>\r\n\r\nThis store aims to deliver more than sex-products. We want to spread love! Because sex is a passionate (and hormonal) way to express love.\r\n\r\nDue to the reality we read on the news and feel on the streets, we choose this name, amor libre. Which means free-will love. Because sex should always from a free-will for love. No more to say.\r\n\r\nDespite of this! You can find product for solo-time. But you are also allowed to love yourself! :p', 'Välkommen', '', 'inherit', 'closed', 'closed', '', '26-revision-v1', '', '', '2018-01-22 18:46:29', '2018-01-22 18:46:29', '', 26, 'http://amorlibre.net/26-revision-v1/', 0, 'revision', '', 0),
